INSERT INTO `category` (`id`, `cat`, `keywords`, `slung`, `home`, `image`, `description`, `col`, `created_at`, `updated_at`) VALUES
(1, 'Car Stereo', ',car sub woofer  ,car subwoofer,car subwoofer for sale in Kenya  ,car subwoofer price in kenya  ,Bass Speaker  ,car bass speker  ,car bass speakers for sale in kenya  ,car speakers  ,pioneer bass speaker  , Kenwood Bass Speaker ,kenwood kfc w3010  ,best car subwoofer for deep bass', 'car-stereo', 1, 'car-stereo-system-500x500.jpg', 'There are two types of Car radio stereos&nbsp;depending on size.\r\n\r\n<br><br><b>Single Din Radio</b> - The most common size for a car stereo is\r\na single DIN. These stereos are approximately 7‚Ä≥W x 2‚Ä≥H in size and will fit in\r\njust about every vehicle. Under this Category we have Car radio with FM, CD\r\nplayer, USB &amp; AUX, and Car Stereo with DVD player or Radio with DVD player,\r\nUSB, AUX input &amp; Bluetooth.<br><br>&nbsp;Car Radio with retractable screen falls under the single din\r\ncategory.&nbsp;<a href=\"https://www.amanivehiclesounds.co.ke/product/PIONEER%20AVH-Z7250BT%20pioneer%20Car%20radio%20system%20with%20Android%20Auto\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/product/PIONEER%20AVH-Z7250BT%20pioneer%20Car%20radio%20system%20with%20Android%20Auto</a><br><br><b>Double Din Radio </b>‚Äì A Double din car stereo is approximately\r\ntwice the height of a single din car stereo, it measures in at about 7‚Ä≥W x 4‚Ä≥H.\r\nCommon features include 6.2‚Äù to 7 ‚Äú Touch screen display, Reverse camera input,\r\nBluetooth, DVD, USB port, Spotify web link, android auto, apple car play &amp;\r\nNavigation depending on each radio. Car Stereo with Navigation tend to be\r\npopular as you can drive anywhere with the help of maps for direction.', '1', '2019-04-30 15:52:40', '2019-04-30 15:52:40'),
(2, 'Mid range Speakers', ',mid range speakers price in kenya  ,midrange speakers  ,kenwood midrange speakers, midrange speakers price in kenya  ,car speakers  ,car speakers for sale in kenya  ,pioneer car speakers  ,pioneer midrange car speakers\r\n,kenwood midrange speakers  ,sony midrange speakers', 'mid-range-speakers', 1, 'mIDrANGEsPEAKER.jpg', '<div>There are different types of <b>car speaker‚Äôs</b>/ <b>mid-range</b>\r\nspeakers based on their cone size &amp; shape, place of install. The most\r\ncommon types of speakers are; <br></div><div>\r\na)\r\n4-inch speaker commonly known as dashboard\r\nspeakers <br></div><div>\r\nb) 6.5 inch speakers commonly known as round/ door\r\nspeakers.</div><div>\r\n\r\nc) 6 by 9 inch speakers commonly known as oval\r\nspeakers. <br></div><div>\r\nd) 7 by 10-inch car speakers.\r\n\r\n<br></div><div>e)10-inch car speakers. <br></div><div><br></div><div>\r\nCar speakers are an essential part a cars entertainment,\r\n&amp; are normally the first step to a car audio system upgrade.<br></div><div><br></div><div>\r\n\r\nShop for <b>Kenwood</b>, <b>Sony</b>, <b>JVC </b>&amp; <b>Pioneer</b> speakers all in\r\none place.\r\n\r\n</div><br><br><br><br>', '1', '2019-04-30 17:32:57', '2019-04-30 17:32:57'),
(3, 'Car Tweeters', NULL, 'car-tweeters', 0, 'tweeters.jpg', '<div>Car Tweeter speakers may be the only component missing to complete your car audio setup. Tweeters purpose is to produce high audio frequencies.For speakers,tweeters make it seem like the sound is surrounded by a stage.</div><div><br></div><div>The most common types of car tweeters are Dome Tweeters &amp; Bullet tweeters with their difference in performance being realized in dispersion control &amp; efficiency.</div><div><br></div><div>Bullet tweeters have relatively a higher power output compared to dome tweeters.</div><div>For Personal Vehicles, tweeters are mostly mounted on either side of the dashboard close to the doors.</div><div><br></div><div>Shop for car tweeters by your favorite brand; Pioneer, Ken-wood &amp; Sony from the link below<br></div><div><a href=\"https://www.amanivehiclesounds.co.ke/products/cat/CAR%20TWEETERS\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/products/cat/CAR%20TWEETERS</a><br></div><br>', '1', '2019-05-01 04:49:41', '2019-05-01 04:49:41'),
(4, 'Car Sub woofers', 'car sub woofer  ,car subwoofer  ,car subwoofer for sale in kenya  ,car subwoofer price in kenya  ,Bass Speaker  ,car bass speaker  ,car bass speakers for sale in kenya  ,car speakers  ,pioneer bass speaker\r\n  ,Kenwood Bass Speaker  ,kenwood kfc w310  ,best car subwoofer for deep bass', 'car-sub-woofers', 1, 'subwoofers.jpg', '<div>A car Sub woofer is a vital product (for music lovers) in any\r\ncar music system. Installing a sub woofer speaker in your car improves the\r\nquality of the sound produced in a significant way.<br></div><div><br></div><div>\r\n\r\nCar Sub woofers are designed to produce low frequency sounds\r\nmaking any kind of music genre sound better. When choosing a Sub woofer for your\r\ncar sound system, there are a number of things to consider; Speaker size (depending\r\non your boot space), Enclosure type (sealed or ported). <br></div><div><br></div><div>\r\nBass Speakers, as they are commonly known are of Different\r\ntypes;</div><div><br>\r\n\r\n</div><ul><li>&nbsp;\r\n\r\n<span><b>Standard\r\nSub woofer Speakers</b> -These sub&nbsp;woofers come individually without being fitted\r\nin any type of enclosure in order to fit in every car. You can customize a\r\nspeaker cabinet for the sub woofer to your liking.</span>\r\n\r\n<a href=\"https://www.amanivehiclesounds.co.ke/products/cat/CABINETS\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/products/cat/CABINETS</a>\r\n\r\n&nbsp; <br></li></ul><br><ul><li><span><b>Bass Tube\r\nSpeakers</b> - A Bass Tube is a type of sub woofer where the speakers are\r\nenclosed in a tube.</span></li></ul><br>&nbsp;<a href=\"https://www.amanivehiclesounds.co.ke/product/JBL%20CS1204T%20BASS%20TUBE%20SUBWOOFER\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/product/JBL%20CS1204T%20BASS%20TUBE%20SUBWOOFER</a>&nbsp;\r\n\r\n<br><br><div><ul><li>&nbsp;<span><b>Powered\r\nSub woofers </b>‚Äì Also known as self-amplified sub woofers or Active sub woofers. This\r\nis a type of sub woofers that are built into an enclosure which is powered by an\r\namplifier.</span> These sub woofers are also great for a fast and\r\neasy upgrade and they allow you to save the maximum amount of space in your\r\nvehicle. They allow the user to add bass while conserving space. Under this\r\ncategory are Underseat sub woofers that are specially designed to fit below a\r\ncar seat.\r\n\r\n&nbsp; </li></ul><br><br></div><div><br></div>', '1', '2019-05-01 05:55:37', '2019-05-01 05:55:37'),
(5, 'Car Amplifiers Booster', 'car amplifier booster  ,car amplifier price in kenya  ,car amplifier  ,car amplifier for sale in kenya  ,car booster  ,car booster amplifier  ,sound booster  ,pioneer booster amplifier  ,pioneer amplifier  ,pioneer amplifier 1000w', 'car-amplifiers-booster', 1, 'amplifires.jpg', '<div>A car Amplifier is the component that gives your music power\r\nand Volume.\r\n\r\n<span><b>Amplifiers</b> take a signal from the stereo and use an\r\nindependent power source to change it into a more powerful signal for the\r\nspeakers. The more power the amplifier delivers, the cleaner the sound from the\r\nspeakers. </span>\r\n\r\n<br></div><div><br></div><div>Depending on the number of channels amplifier categories\r\nare; Mono block, 2 channel,4 channel, 5 channel Amplifiers.\r\n\r\n</div><br><br><br><br>', '1', '2019-05-01 06:05:52', '2019-05-01 06:05:52'),
(6, 'Car Monitor', 'headrest monitors kenya  ,headrest monitors  ,headrest screen ,car screen  ,car dashboard monitor  ,rearview monitor  ,in car accessories  ,car accessories shops in nairobi', 'car-monitor', 1, 'B1164962151.jpg', '<div>There are many types of car video monitors in the market today.\r\nCar Monitors come in different shapes and sizes. The most Common types are as\r\nfollows;</div><div><br></div><ul><li> \r\n\r\n<span><b>Headrest\r\nCar Video Monitors</b> ‚Äì They come in different sizes, colors &amp; features.\r\nHeadrest Monitors are universal to all cars &amp; are installed by either\r\nreplacing the car headrest or by hanging (depending on type). Headrest monitors\r\nare sold in pairs.</span>\r\n\r\n¬∑&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li></ul><br><ul><li><span><b>Flip Down\r\nCar Video Monitors / Roof Mount</b> -&nbsp;\r\nRoof Mount monitors come in different sizes &nbsp;&nbsp;11‚Äù 14‚Äù, 15‚Äù, 17‚Äù.</span>\r\n\r\n¬∑&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li></ul><br><ul><li><span>\r\n<b>Dashboard\r\nMonitors</b> ‚Äì Normally looks like the computers normal monitor &amp; it stands\r\nalone on the cars Dashboard. Dashboard Monitors come in different sizes.</span>\r\n\r\n<span>¬∑&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></span></li><li><span>\r\n<b>Rear View\r\nCar Video Monitors </b>‚Äì Rear View Monitors come with straps to mount on the\r\nexisting car rear view mirror. You can use them to play Videos, listen to the\r\nradio or as a reverse camera display.</span>\r\n\r\n</li></ul><br><br><br>', '2', '2019-05-01 06:17:28', '2019-05-01 06:17:28'),
(10, 'Car Accessories', 'car accessories  ,car accessories in kenya  ,car accessories nairobi  ,audio accessories car audio crossovers  ,boschmann equalizer  ,fm expander kenya  ,car mobile holder  ,car radio aux cable  ,reverse camera  ,reverse camera for cars', 'car-accessories', 1, 'Car Accessories.jpeg', '<div>Shop for the Best Car Accessories at the best price in Kenya. Choose from a wide range of supplementary Components such as Jump stater, Smartphone holders FM expanders and many more.<br><br>Our Car Accessory products are suitable for all car types.</div><br><br><br><br>', '2', '2019-05-03 08:42:53', '2019-05-03 08:42:53'),
(12, 'Led Lights', NULL, 'led-lights', 0, '2019-08-0815 07 56imageBLUE-5-METRE-SET-LED-STRIP-2.png', '<div><b>Led lights</b> are of different types. Some are <b>multicolor </b>coming with a remote control for color change while others <b>single colors.</b> <br></div><div><br></div><div>Led lights have <b>multipurpose</b> and can be used to decorate rooms, swimming pools, TV\'S, Vehicles interior or for commercial use for advertising.</div><div><br></div><div>Led lights bring <b>liveliness </b>wherever they are used!<br></div>', '3', '2019-05-03 08:43:13', '2019-05-03 08:43:13'),
(17, 'Car Security System', NULL, 'car-security-system', 0, 'security.jpg', 'The Car Security system category consists of Video Recorders, Trackers, Alarms and the Central locking system all meant to aid in keeping away intruders and thieves from your precious ride.&nbsp;<br><br>Get these products at affordable prices and have them delivered to your doorstep.', '3', '2019-05-24 04:38:15', '2019-05-24 04:38:15'),
(21, 'Conversion Fascia Kits', ',car conversion kit ,car fascia kit  , car fascia kit  ,radio trim fascia\r\n,radio fascia trim plate  ,radio conversion kit  ,car radio console', 'conversion-fascia-kits', 1, 'faacia.jpg', '<div>Amani Vehicle sounds stocks a variety of car stereo fascia kits also known as car stereo conversion kits to suit most makes and models of vehicles making aftermarket car stereo installation a breeze.</div><div><br></div><div>A <b>fascia panel</b> is designed to convert the aperture left after \r\nremoving the original manufacturer‚Äôs car audio stereo to the aftermarket\r\n car stereo whilst retaining the original visual appearance of the \r\ndashboard.</div><div><br></div><div><span>Get the best deal for Dashboard Installation <span><b>Fascia Kits</b> from us today &amp; have it delivered to your preferred location. <br></span></span><div><br></div> </div><br><br>', '4', '2019-06-01 00:46:45', '2019-06-01 00:46:45'),
(22, 'Bass Speaker Enclosure', 'bass speaker enclosure  ,bass speaker enclosure design  ,speaker cabinet  ,speaker cabinet for sale in kenya\r\n  ,speaker cabinet design  ,mdf cabinet', 'bass-speaker-enclosure', 1, 'enclosure.jpg', '<div>The only way your going to get&nbsp; full rich bass from your car stereo system is by adding a <b>subwoofer</b>.üé∂</div><div><br></div><div>There are two types of cabinets/ speaker enclosures ;</div><ul><li><b>Ported Enclosures</b> -f you like your music \"boomy\" vibrating your cars body panel, you want to consider a vented enclosure.These types of enclosures, when built with the correct materials , measurements &amp; subwoofer tuned to the correct frequency are generally louder than sealed&nbsp; enclosure.üîä<br></li></ul><ul><li><div><b>Sealed Enclosures</b> -&nbsp; produce \"tight\" more accurate bass however they aren\'t typically as loud as ported enclosures but still enhance the listening experience greatly by providing more defined low frequency passages. The bass can still be felt as if you are&nbsp; on front row in live concert.</div></li></ul>There are a couple of factors to consider when choosing the right enclosure for your bass speaker that includes the type of music you listen to, specifications of the subwoofer you choose and the available space to install your<b> bass box.</b><br><h1><br></h1><br><br><br><br>', '4', '2019-05-03 08:43:25', '2019-05-03 08:43:25'),
(23, 'Powered Speakers', 'powered speakers  ,powered speakers in kenya  ,amplified car speakers  ,self amplified car speakers\r\n  ,underseat subwoofer  ,underseat subwoofer kenya  ,underseat subwoofer nairobi  ,pioneer underseat subwoofer kenya, space saving subwoofer, pioneer space saving subwoofer', 'powered-speakers', 1, 'poweredSpealers.jpg', NULL, '0', '2020-08-19 05:57:43', '2020-08-19 05:57:43');
