INSERT INTO `portfolio` (`id`, `title`, `date`, `content`, `image_one`, `image_two`, `image_three`, `image_four`, `image_five`, `service`, `product`, `client`, `link`, `created_at`, `updated_at`) VALUES
(1, 'Toyota Fielder Car Radio Installation', NULL, '<p>The Client needed a modern affordable car stereo with Bluetooth , Auxiliary Input, USB and Excellent FM reception to replace his outdated factory stereo in his Toyota Fielder.&nbsp;<br />\r\n<br />\r\nWe recommended and installed&nbsp; the &nbsp;<a href=\"http://¬†amanivehiclesounds.co.ke/product/sony-wx-920bt-radio-receiver-with-bt¬†.\">Sony car Radio with Bluetooth</a><br />\r\n<br />\r\nHe was very happy with the Sony radio as he could pair 2 phones simultaneously with Bluetooth to receive calls hands Free &amp; stream audio . He was elated by the fact that the radio has Multicolor illumination &amp; he could toggle from one Color to another matching the color of his cars Dashboard.</p>', '2021-02-0116:28:31imageToyotaFielderBeforeInstallation-min.png', '2021-02-0116:28:31imageSonyBluetoothRadiowithMulticolorDisplay-min.png', '2021-02-0116:28:31imageToyotaFielderCarRadioUpgrade-min.png', '2021-02-0116:28:31imageSonyWX-920BT-min.png', '2021-02-0116:28:31imageSonyWX-920BTFittedinToyotaFielder-min.png', '1', NULL, NULL, NULL, '2021-02-01 16:28:31', '2021-02-01 16:28:31'),
(2, 'Underseat Sub woofer Installation', NULL, '<p>Are you looking to achieve Space Saving Bass in your car?ü§î</p>\r\n\r\n<p>Thats the exact request we received from Mr. Kamau. He wanted a Car Subwoofer for his Nissan Bluebird that wouldnt occuppy much of his boot Space.</p>\r\n\r\n<p>We recommended &amp; installed the <a href=\"http://amanivehiclesounds.co.ke/product/jvc-cw-dra8-under-seat-subwoofer\">JVC powered subwoofer</a>&nbsp;that would work&nbsp;well with his existing aftermarket radio&nbsp; due to high output. He particularly loved the JVC Underseat subwoofer for its quality bass -there was a great Improvement in his overall car audio system and its space saving feature-&nbsp;it was fitted under the co-drivers seat.üôÇ</p>', '2021-02-1611:35:45imagePoweredSpeaker-min.png', '2021-02-1611:35:45imageJVCUnderseatSubwoofer-min.png', NULL, NULL, NULL, '1', NULL, 'MR KAMAU', NULL, '2021-02-16 11:35:45', '2021-02-16 11:35:45'),
(3, 'Toyota Probox car Audio Upgrade', NULL, '<p>Before the car stereo upgrade, our client&#39;s Toyota Probox didn&#39;t have a functional stereo, how boring!!</p>\r\n\r\n<p>With the newly fitted&nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/sony-car-radio-cdx-g1200u\">Sony car Radio</a>, he can now listen to his favorite FM Station en route to work every morning or play his favorite music through a USB or CD Player.</p>\r\n\r\n<p>We also fitted a pair of&nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/sony-xs-h50s-car-tweeters\">Sony car tweeters</a>&nbsp;to achieve audio highs. Mr. Edward was happy for this simple but efficient car Audio upgrade.</p>', '2021-02-1811:04:25imageToyotaProboxcarstereo-min.png', '2021-02-1811:04:25imageToyotaproboxcarradioSonycdx-g1200u-min.png', '2021-02-1811:04:25imageSonycartweetersinstallation(1)-min.png', NULL, NULL, '1', NULL, NULL, NULL, '2021-02-18 16:04:25', '2021-02-18 16:04:25'),
(4, 'Audi Q3 Car radio replacement', NULL, '<p>Would you like to have a car radio that offers apple car play&nbsp;&amp; Android Auto all in one?&nbsp;</p>\r\n\r\n<p>The&nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/pioneer-avh-z5250bt-stereo-with-navigation\">Pioneer car Stereo</a>&nbsp;Offers that &amp; other great features such as Weblink, Waze, Spotify &amp; Dual Bluetooth Connection. The Amani Vehicle Sounds Team traveled all the way to Kimende, Nyandarua County to make Mr. Anthonys Dream come True!!</p>\r\n\r\n<p>With the new car stereo, he can now use navigation maps through apple car play or android auto to get through unfamiliar places. Truly, Mr. Anthonys Ssatisfaction was worth the Journey!üòÑ</p>', '2021-02-1811:56:03imageAudiq3beforeupgrade-min.png', '2021-02-1811:56:03imageAudiq3upgradedwithpioneeravh-z5250bt-min.png', '2021-02-1811:56:03imagePioneeravh-z5250bt-min.png', '2021-02-1811:56:03imageAudiQ3CarRadioUpgrade.-min.png', NULL, '1', NULL, 'Mr.Anthony', NULL, '2021-02-18 16:56:03', '2021-02-18 16:56:03'),
(5, 'Toyota Passo Sony car Radio Install', '2021-02-13', '<p>When Madam Carol Visited us at our shop, she was interested in the Bluetooth feature not available in her current Stock Radio.</p>\r\n\r\n<p>Being a business lady, the ability to connect her personal &amp; work phone simultaneously through Bluetooth was dear to her. We fitted the&nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/sony-bluetooth-car-stereo-dsx-a410bt\">Sony car radio</a>&nbsp;and she would now enjoy other features such as USB, AUX Input &amp; FM Radio.</p>\r\n\r\n<p>The newly installed Sony Bluetooth radio led to the improvement of her Factory door Speakers audio output due to its high power Output of 200 watts.</p>', '2021-02-1910:31:10imageToyotaPassoRadioUpgrade-min.png', '2021-02-1910:31:10imageSonycarradiowithBluetooth-min.png', NULL, NULL, NULL, '1', NULL, NULL, NULL, '2021-02-19 15:31:10', '2021-02-19 15:31:10'),
(7, 'Toyota Vanguard Car Android radio', '2021-02-10', '<p>Car Android radios are becoming more popular by the day. This is partly because they are built to function similarly to your smartphone with the ability to add your favorite applications from the Play Store.&nbsp;</p>\r\n\r\n<p>Pioneer car entertainment corporation has not been left behind evident with their product&nbsp;&nbsp;SDA-835TAB&nbsp;SPH-T20BT. This is an 8&quot; android tablet that can be fitted in the car &amp; be used outside of it as well.</p>\r\n\r\n<p>&nbsp;We fitted the same <a href=\"https://amanivehiclesounds.co.ke/product/pioneer-car-android-tablet\">Pioneer Android Tablet</a>&nbsp;in a Toyota Vanguard and the result&nbsp;was&nbsp;amazing!!.</p>', '2021-02-1911:49:13imageToyotaVanguardRadioupgrade-min.png', '2021-02-1911:49:13imagePioneerAndroidradiofitted-min.png', '2021-02-1911:49:13imageToyotaVanguard-min.png', NULL, NULL, '1', NULL, 'Sumeya mahat', NULL, '2021-02-19 16:49:13', '2021-02-19 16:49:13'),
(8, 'Subaru Forester Car Sound system', '2021-02-27', '<p>We Upgraded the Subaru Forester XT Sound&nbsp;system with the following car audio products;</p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" /><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-avh-a105dvd-car-radio-dvd-player\">Pioneer avh-a215bt</a></p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" /><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-ts-s20-car-tweeters\">pioneer TS-S20 tweeters</a></p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" /><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-gm-a6704-4-channel-amplifier\">pioneer 1000 watts 4 channel Amplifier</a></p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" /><a href=\"https://amanivehiclesounds.co.ke/product/kenwood-kac-ps917d-mono-amplifier\">Kenwood 2000 watts Monoblock</a></p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" />Pioneer TS-6900PRO</p>\r\n\r\n<p><img alt=\"üé∂\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f3b6.png\" style=\"height:16px; width:16px\" /><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-ts-d12d4-double-coil\">Pioneer 2000 watts subwoofer</a></p>\r\n\r\n<p>The results were spectacular!!</p>', '2021-03-0117:59:04imagePioneerts-d12d4-min.png', '2021-03-0117:59:04imagecaraudiosystem-min.png', '2021-03-0117:59:04imagePioneerkenwoodAmplifiers-min.png', '2021-03-0117:59:04imagePioneerTS-B600PRO-min.png', '2021-03-0117:59:04imagepioneermidrange-min.png', '1', NULL, NULL, NULL, '2021-03-01 22:59:04', '2021-03-01 22:59:04'),
(9, 'Nissan Cube Car Sound System', '2021-03-06', '<p>&nbsp;</p>\r\n\r\n<p>We had our first encounter with a Nissan Cube &amp; the results were amazing!! That&#39;s according to our happy Client Mr. John.&nbsp;</p>\r\n\r\n<p>We Fitted :</p>\r\n\r\n<ol>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/kenwood-kmm-bt306-car-radio-with-bluetooth\">Kenwood kmm-bt306</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-ts-s20-car-tweeters\">Pioneer TS-S20</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-ts-wx300ta-powered-subwoofer\">Pioneer Bass Tube</a></li>\r\n</ol>\r\n\r\n<p>John was very pleased with Bass Tube Performance not to mention the Kenwood Bluetooth audio player that could match his Dashboard.</p>', '2021-03-0909:48:36imageCarsoundsystem-min.png', '2021-03-0909:48:36imageBassTube-min.png', '2021-03-0909:48:36imagePioneerts-wx300ta-min.png', '2021-03-0909:48:36imagePioneerTs-min.png', '2021-03-0909:48:36imageKenwoodCarRadio-min.png', '1', NULL, 'John', NULL, '2021-03-09 14:48:36', '2021-03-09 14:48:36'),
(10, 'Toyota Bb Car Sound System Upgrade', '2021-03-03', '<p>We did a full Car Sound System Installation for a Toyota Bb Consisting of&nbsp;</p>\r\n\r\n<ol>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/kenwood-kfc-hqr3000-hq-reference-sub\">Kenwood hqr3000</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-gm-d9705-5-channel-amplifier\">Pioneer 5 Channel Amplifier</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/pioneer-ts-s20-car-tweeters\" target=\"_blank\">Pioneer Tweeters</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/kenwood-kw-m150bt-car-radio\">JVC car Stereo</a></li>\r\n	<li><a href=\"https://amanivehiclesounds.co.ke/product/boschmann-eqx-75-pro-audio-equalizer\" target=\"_blank\">Boschmann EQX-75 PRO Equalizer</a></li>\r\n</ol>\r\n\r\n<p>The Lows from the&nbsp;Kenwood 1500 watts Bass Speaker were out of this world!! not to mention the highs from pioneer tweeters, thanks to the pioneer GM-D9705 Amplifier.</p>\r\n\r\n<p>Boschmann Equalizer always does such a good job in controls, enabling&nbsp;you to customize your music to your favorite tune.</p>', '2021-03-1005:57:16imageJVCCarStereo.png', '2021-03-1005:57:16imageBoschmannEqualizer.png', '2021-03-1005:57:16imagePioneer5ChannelAmplifier2000watts.png', '2021-03-1005:57:16imageCarSoundSystem(1).png', '2021-03-1005:57:16imageBassSpeakerConnector.png', '1', NULL, NULL, NULL, '2021-03-10 10:57:21', '2021-03-10 10:57:21'),
(11, 'Sony XAV-AX8000 Fitted in Prado tx', '2021-05-20', '<p>The client needed a radio with a large display and with advanced smartphones&nbsp;connectivity features such as Android auto, apple car play, and weblink.</p>\r\n\r\n<p>The &nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/sony-car-stereo-system-with-webcast\">Sony XAV-AX8000</a>&nbsp;offers just that and more on a 9&quot; antiglare touch display.</p>', '2021-07-0610:28:32imagephoto1625384942.jpeg', '2021-07-0610:28:32imagephoto1625384942(1).jpeg', '2021-07-0610:28:32imagephoto1625384942(2).jpeg', '2021-07-0610:28:33imagephoto1625384942(3).jpeg', NULL, '1', NULL, NULL, 'https://youtu.be/H7YrJ3YAvHI', '2021-07-06 14:28:33', '2021-07-06 14:28:33'),
(12, 'Car Sound system Upgrade for Suzuki', '2021-07-04', '<p>We fitted Suzuki Swift with&nbsp;<a href=\"https://amanivehiclesounds.co.ke/product/sony-bluetooth-car-stereo-dsx-a410bt\">Sony DSX-A410BT</a>&nbsp;for Bluetooth hands-free calling &amp; Audio Streaming. Our client also wanted Bass but had limited space. as a result, we recommended and fitted 180watts MBQ under-seat Subwoofer.&nbsp;</p>\r\n\r\n<p>The result was amazing!!</p>\r\n\r\n<p>&nbsp;</p>', '2021-07-0610:51:23imagephoto1625384828.jpeg', '2021-07-0610:51:23imagephoto1625384828(3).jpeg', '2021-07-0610:51:23imagephoto1625384828(1).jpeg', '2021-07-0610:51:23imagephoto1625384828(4).jpeg', NULL, '1', NULL, NULL, NULL, '2021-07-06 14:51:23', '2021-07-06 14:51:23');
INSERT INTO `privacy` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'General Information', 'Amani Vehicle Sounds values privacy of any person or organization, business in nature or otherwise. We are therefore committed to protecting any personal information collected through the amanivehiclesounds.co.ke website Amani Vehicle Sounds&nbsp; may from time to time change this information and will inform all interested parties of the changes. <span><br>\r\n</span> <br>', '2019-05-04 02:33:34', '2019-05-04 02:33:34'),
(2, 'Policies', '<br><h4><i>Personal Information Collected</i> \r\n</h4>amanivehiclesounds.co.ke will gather information in the background when any person or legal entity visits the&nbsp; amanivehiclesounds.co.ke website using cookies. This may include IP address, device type, Internet browser type, operating system, location and other device specific infomation. Data collected is for business intelligence meant for enhancing user experience any time a user visits the amanivehiclesounds.co.ke.<h4>&nbsp;<i>Management of personal database</i></h4>\r\n<span> You can choose whether you wish to receive promotional communications from our web site by email using the subscribe form in the footer section of this page. If you receive promotional email or SMS messages from us and would like to opt out, you can request deletion of your email <a target=\"\" rel=\"\">info@</a></span><span><a target=\"\" rel=\"\">amanivehiclesounds.co.ke</a>. </span> <span><br><br>\r\n</span>\r\n<h4><i>Contact</i></h4>&nbsp;You have the right to review the personal data we keep about you. You can request an overview of your personal data that by emailing&nbsp;info@amanivehiclesounds.co.ke with the subject line Request for personal information. To help us prevent fraudulent collection of personal information, please include a scan of your passport or identity card. If you would like us to remove your personal information from our database, please email&nbsp;info@amanivehiclesounds.co.ke with the subject line Request for removal of personal information. Please bear in mind that we may need to retain certain information for legal and/or administrative purposes such as record keeping or to detect fraudulent or criminal activities. <br><br>', NULL, NULL);
