(3, 'Pioneer¬†DEH-S1052UB Radio CD Player', 'pioneer-deh-s1052ub-radio-cd-player', '0', NULL, 0, 'In Stock', 'in dash car radio with FM, CD, front USB & AUX Input', '7500', 500, '1', NULL, NULL, 1, 0, 0, 0, 'DEH-S1052UB', 'Pioneer', '0', NULL, '<p>Pioneer <strong>Deh-s1052UB</strong> is a universal One Din sized car stereo that fits all vehicles.<br />\r\n<br />\r\nWith this car, Stereo, you can listen to Local FM &amp; AM stations without requiring an FM Expander. This Audio receiver gives you several options to play your music; CD player, USB, AUX Input.&nbsp;<br />\r\n<br />\r\nThe Mixtrax feature creates a non-stop mix of your music library through USB, giving you the best experience during your drives.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>CD player</li>\r\n	<li>Front USB &amp; AUX In</li>\r\n	<li>Five band Internal Equalizer</li>\r\n	<li>Detachable face for security purposes</li>\r\n	<li>Dual illumination (Red &amp; Blue)</li>\r\n	<li>Pioneer Advanced Remote control (ARC)</li>\r\n	<li>Mixtrax via USB</li>\r\n	<li>Max power 50 W *4</li>\r\n	<li>1 RCA Pre-out</li>\r\n	<li>USB high Current</li>\r\n	<li>Smartphone Compatible</li>\r\n	<li>Six stations Pre-set</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s In The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer DEH-S1052UB Head-unit</li>\r\n	<li>Remote control</li>\r\n	<li>Power Cable</li>\r\n	<li>Face Case</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year Warranty</strong><br />\r\n<br />\r\n&nbsp;</p>', '146-fb_pixels.png', 505766, 'Pioneer-¬†DEH-S1052UB-Car-Radio-with-USB-&-FM-thumbnail.png', 'Pioneer¬†DEH-S1052UB-Radio-CD-Player-001.png', NULL, 'Pioneer-¬†DEH-S1052UB-Car-Radio-with-USB-and-FM-002.jpg', 'Pioneer¬†DEH-S1052UB-Radio-CD-Player-003.png', NULL, '2019-04-30 15:59:22', '2019-04-30 15:59:22'),
(4, 'Pioneer DEH-S4250BT Bluetooth Radio', 'pioneer-deh-s4250bt-bluetooth-radio', '0', NULL, 0, 'In Stock', 'Car Stereo with Dual Bluetooth, Spotify Connect, Siri Eyes Free & USB port.', '12000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DEH-S4250BT', 'Pioneer', '0', NULL, '<p>With <strong>Bluetooth </strong>now a necessity in the car, Pioneer DEH-S4250BT allows you to receive calls hands-free, stream music wirelessly.<br />\r\n<br />\r\nYou also get to enjoy the<strong> Pioneer Smart sync</strong> feature. Pioneer Smart Sync is an Application that intelligently brings your maps, messages &amp; music together.<br />\r\nListen to<strong> music</strong> from Spotify, pandora Youtube, <strong>Navigate</strong> using Google maps &amp; Waze and have your<strong> messages</strong> read out for you through Whatsapp Messenger, Hangouts, Messenger, Viber, etc.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>CD Player</li>\r\n	<li>FM/AM Tuner</li>\r\n	<li>Dual Bluetooth ( Connect two phones Simultaneously)</li>\r\n	<li>Front USB &amp; AUX In</li>\r\n	<li>Color Illumination Blue</li>\r\n	<li>Disc Playback</li>\r\n	<li>Detachable face for security purposes</li>\r\n	<li>Spotify (For Android, connected via Bluetooth. For iPhone, connected through USB &amp; Bluetooth.</li>\r\n	<li>Compatible with Pioneer Smart sync</li>\r\n	<li>Two pre-out</li>\r\n	<li>USB Quick Charge</li>\r\n	<li>Mixtrax</li>\r\n	<li>Subwoofer Control</li>\r\n	<li>Power Output 50W*4</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer DEH-S4250BT Radio head unit</li>\r\n	<li>Power Connection cable</li>\r\n	<li>User Manual</li>\r\n	<li>Microphone</li>\r\n	<li>Face case</li>\r\n	<li>Remote Control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Pioneer-DEH-S4250BT-Bluetooth-Radio-fb_pixels.png', 505766, 'Pioneer-DEH-S4250BT-Car-Radio-With-Bluetooth-thumbnail.png', 'Pioneer-DEH-S4250BT-Car-Radio-With-Bluetooth-001.png', NULL, 'PIONEER-DEH-S4250BT-Car-Radio-With-Bluetooth-002.jpg', 'Pioneer-DEH-S4250BT-Car-Radio-With-Bluetooth-003.png', NULL, '2019-04-30 16:01:08', '2019-04-30 16:01:08'),
(5, 'Pioneer DVH-345UB car DVD Player.', 'pioneer-dvh-345ub-car-dvd-player', '0', NULL, 0, 'In Stock', 'Car Stereo with DVD/CD Player & front USB', '13500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DVH-345UB', 'Pioneer', '1', NULL, '<p>Pioneer <strong>DVH-345UB</strong> Is built to produce quality audio &amp; Video Output.<br />\r\nThis Car Stereo is a smart solution for playing<strong> DVDs </strong>in your car.<br />\r\nTo view them, install a screen in the seat headrests or a dashboard Monitor.</p>\r\n\r\n<p><br />\r\nAlso, you can play music through Front USB &amp; AUX Input.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Maximum Power Output MOSFET 50W x 4</li>\r\n	<li>Tuner AM/FM Tuner (18 pre-set stations)</li>\r\n	<li>Front Panel Removable front panel</li>\r\n	<li>Button Illumination Blue</li>\r\n	<li>DVD / CD&nbsp; Player</li>\r\n	<li>Front USB &amp; AUX Input</li>\r\n	<li>2 RCA Pre-outs</li>\r\n	<li>Equalizer Bass/Mid/Treble</li>\r\n	<li>1 Rear video output</li>\r\n	<li>24 Stations/ 6 Presets</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer DVH-345UB</li>\r\n	<li>Face Case</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>Remote control</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-DVH-345UB-car-DVD-Player.-fb_pixels.png', 505766, 'Pioneer-DVH-345UB-Car-Radio-with-Fm-&-DVD-player-thumbnail.png', 'Pioneer-DVH-345UB-Car-Radio-with-Fm-&-DVD-player-001.png', NULL, 'PI0NEER-DVH-345UB-Car-Radio-with-Fm-and-DVD-player-002.jpg', 'Pioneer-DVH-345UB-Car-Radio-with-Fm-&-DVD-player-003.png', NULL, '2019-04-30 16:02:57', '2019-04-30 16:02:57'),
(6, 'Pioneer DEH-X7850BT Car Radio', 'pioneer-deh-x7850bt-car-radio', '4', NULL, 0, 'Out of Stock', 'Car Stereo with Dual Bluetooth, Dual USB, Spotify, Smartphone connectivity & Siri Eyes Free', '13000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DEH-X7850BT', 'Pioneer', '0', NULL, 'The DEH-X7850BT will directly connect and control your music directly from a Smartphone, 2 x USB inputs, CD, or Auxiliary-in.<br><br>Equipped with<b> Dual Bluetooth</b>, two smartphones can be simultaneously connected to the DEH-X7850BT, allowing you to stream your music or make hands-free phone calls from both phones.<br>Alternatively, you can directly connect your iPhone or Android Smartphone via USB for music playback and charging.<br><br><div>Love Spotify?<b> Spotify </b>is a dedicated audio source on the DEH-X7850BT, giving you the ability to control content from the Spotify app on an iPhone (via USB) or Android smartphones (via Bluetooth), directly from the head unit.</div><div><br></div><b>Key features<br></b><ul><li>FM Radio</li><li>CD Player</li><li>Bluetooth Dual Connectivity</li><li>Two Front USB ports</li><li>USB Direct Control</li><li>Spotify</li><li>Siri Eyes Free</li><li>AUX input</li><li>13 Band Equalizer</li><li>3 Pre-outs</li><li>Detachable Face Panel </li><li>Steering wheel control ready</li><li>Maximum Power Output 50W*4</li></ul><b>What\'s in The Box?<br></b><ul><li>Pioneer Deh-x7850bt</li><li>Power Cable</li><li>Microphone</li><li>Remote Control</li><li>User Manual&nbsp;</li></ul><b>One Year Warranty</b><br>', NULL, 505766, 'Pioneer-DEH-X7850BT-In-Dash-Car-Radio-with-Bluetooth-thumbnail.png', 'Pioneer-DEH-X7850BT-In-Dash-Car-Radio-with-Bluetooth-001.png', NULL, 'PIONEER-DEH-X7850BT-In-Dash-Car-Radio-with-Bluetooth-002.jpg', 'Pioneer-DEH-X7850BT-In-Dash-Car-Radio-with-Bluetooth-003.png', NULL, '2019-04-30 16:04:59', '2019-04-30 16:04:59'),
(7, 'Pioneer MVH-S305BT Car Stereo', 'pioneer-mvh-s305bt-car-stereo', '7', NULL, 0, 'Out of Stock', 'Car stereo with Bluetooth, Spotify and Siri eyes free', '8500', 500, '1', NULL, NULL, 0, 0, 0, 1, 'MVH-S305BT', 'Pioneer', '0', NULL, 'The Pioneer <b>MVH-S325BT</b> Is a Modern Car stereo that allows you to connect two smartphones simultaneously through Bluetooth.<br><br>In addition to<b> Bluetooth</b>, you get to connect your iPhone or Android phone through USB for music playback or charging.<br><br>For iPhone, you get to enjoy voice control through Siri. You can ask questions or give commands!<br><br><u>This Digital Stereo does not play CD\'S</u><br><br><b>KEY FEATURES<br></b><ul><li>FM/AM Radio&nbsp;</li><li>Dual USB Rear &amp; back</li><li>Bluetooth with dual connectivity</li><li>1 RCA Pre-out</li><li>Spotify</li><li>Siri Eyes Free</li><li>USB Direct Control for iPhone/iPod&nbsp;</li><li>Power Output 55W*4</li></ul><b>What\'s in The Box?<br></b><ul><li>Pioneer MVH-S325BT</li><li>Microphone</li><li>Power Cable</li><li>Remote Control</li><li>User Manual</li></ul><b>One year Warranty</b><br>', NULL, 505766, 'Pioneer-MVH-S305BT-Car-Stereo-with-Bluetooth-hands-free-Calling-thumbnail.png', 'Pioneer-MVH-S305BT-Car-Stereo-with-Bluetooth-hands-free-Calling-001.png', NULL, 'PIONEER-MVH-S305BT-Car-Stereo-with-Bluetooth-hands-free-Calling-002.jpg', 'Pioneer-MVH-S305BT-Car-Stereo-with-Bluetooth-hands-free-Calling-003.png', NULL, '2019-04-30 16:06:53', '2019-04-30 16:06:53'),
(8, 'Pioneer FH-S525BT Car Audio Receiver', 'pioneer-fh-s525bt-car-audio-receiver', '0', NULL, 0, 'In Stock', 'Double-DIN Audio Receiver with MIXTRAX, Built-in Bluetooth, USB Direct Control for iPod/iPhone and Certain Android Phones', '13500', 500, '1', NULL, NULL, 1, 0, 0, 0, 'FH-S525BT', 'Pioneer', '1', NULL, '<p>Pioneer <strong>FH-S525BT</strong> is the latest release in the pioneer S series car Stereos.&nbsp;<br />\r\nIt is a Double Din Radio with a <strong>non-touch screen</strong> display. This radio gives various options from which to play music: CD player, USB, AUX Input &amp; Bluetooth.<br />\r\n<strong>Smart Sync</strong> feature brings your Messages, Maps &amp; Music in one place.&nbsp;<br />\r\nWith Spotify, you have all the entertainment you need!&nbsp; &nbsp;<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Double Din Radio</li>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>Bluetooth</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>CD Player</li>\r\n	<li>13 band Equalizer</li>\r\n	<li>Extra Bass</li>\r\n	<li>Multicolor Display</li>\r\n	<li>2 Pre-out</li>\r\n	<li>Spotify&nbsp;</li>\r\n	<li>Pioneer Smart sync</li>\r\n	<li>Power Output 50W*4</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer FH-S525BT</li>\r\n	<li>Power Cable</li>\r\n	<li>Remote Control</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>', 'Pioneer-FH-S525BT-Car-Audio-Receiver-fb_pixels.png', 505766, 'Pioneer-FH-S525BT-Car-Audio-Receiver-thumbnail.png', 'Pioneer-FH-S525BT-Car-Audio-Receiver-001.png', NULL, 'PIONEER-FH-S525BT-Car-Audio-Receiver-002.jpg', 'Pioneer-FH-S525BT-Car-Audio-Receiver-003.png', NULL, '2019-04-30 16:09:31', '2019-04-30 16:09:31'),
(9, 'Pioneer AVH-A105DVD Car Radio DVD player', 'pioneer-avh-a105dvd-car-radio-dvd-player', '10', NULL, 0, 'Out of Stock', 'in-Dash Double-DIN DVD Multimedia AV Receiver with 6.2‚Ä≥ WVGA Touchscreen Display and Direct Control for iPod/iPhone', '17500', 500, '1', NULL, NULL, 0, 0, 0, 1, 'AVH-A105DVD', 'Pioneer', '0', NULL, 'Pioneer <b>AVH-A105DVD</b> Is a 6.2-inch Display DVD Receiver. This Radio features a responsive, powerful, and intuitive interface that is user-friendly.<br>It supports all Local FM Stations without requiring an FM expander and plays media files through <b>DVD</b>, USB Port &amp; Auxiliary input.<br><br>You can Connect a <b>backup camera</b> for safety and comfortable reversing.<br><br><b>Key Features<br></b><ul><li>6.2 inch Touch Screen Display</li><li>FM/AM Radio</li><li>DVD/CD Player</li><li>USB &amp; AUX Input</li><li>13 band Internal Equalizer</li><li>Max Power Output 55W by 4</li><li>Backup Camera Ready</li><li>3(2V) RCA Pre-out</li><li>Steering Wheel Control Compatible</li><li>Power output 50W*4</li></ul><b>What\'s in the Box?<br></b><ul><li>Pioneer AVH-A215BT Stereo</li><li>Power Cable</li><li>Remote Control</li><li>User Manual</li></ul><b>One Year Warranty</b><br><b><br></b>', NULL, 505766, 'Pioneer-AVH-A105DVD-Car-Radio-DVD-player-thumbnail.png', 'Pioneer-AVH-A105DVD-Car-Radio-DVD-player-001.png', NULL, 'PIONEER-AVH-A105DVD-Car-Radio-DVD-player-002.jpg', 'Pioneer-AVH-A105DVD-Car-Radio-DVD-player-003.png', NULL, '2019-04-30 16:11:01', '2019-04-30 16:11:01'),
(10, 'Pioneer 2-Din Car Stereo AVH-A215BT', 'pioneer-2-din-car-stereo-avh-a215bt', '0', NULL, 0, 'In Stock', 'Pioneer AVH-A215BT Car radio with DVD CD Player, USB, Bluetooth, android Mirroring', '25000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-A215BT', 'Pioneer', '0', 'QDl5MKybM0Y', '<p>Who wouldn&#39;t love to make &amp; answer calls hands-free? Well, Pioneer AVH-A215BT allows you to do handsfree calling! Besides, you can pair up to two devices simultaneously through <strong>Bluetooth.</strong><br />\r\n<br />\r\nThis radio also has a Unique feature known as <strong>Android Mirrorlink </strong>that allows you to mirror cast your android phone to the radio &amp; use applications such as Calls, Maps, and Messages.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.2&quot; Touch Screen Display</li>\r\n	<li>FM/AM Radio</li>\r\n	<li>DVD Player</li>\r\n	<li>Bluetooth</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>Mirrorlink for Android ( not all phones are supported)</li>\r\n	<li>Steering wheel Control compatible</li>\r\n	<li>Color Customisation</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>Manual Time Alignment</li>\r\n	<li>Bass Boost</li>\r\n	<li>3 (2V) RCA Pre-out</li>\r\n	<li>Playback DVD/CD/USB</li>\r\n	<li>Audio format MP3/WMA/ACC/WAV</li>\r\n	<li>Crossover Setting (High &amp; Low pass filter)</li>\r\n	<li>Power Output 50W*4</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer AVH-A215BT Radio</li>\r\n	<li>Power Socket</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Pioneer-2-Din-Car-Stereo-AVH-A215BT-fb_pixels.png', 505766, 'Pioneer-Car-Stereo-AVH-A215BT-with-Bluetooth,-USB,DVD-Player-.-thumbnail.png', 'Pioneer-Car-Stereo-AVH-A215BT-with-Bluetooth,-USB,DVD-Player-.-001.png', NULL, 'Pioneer-Car-Stereo-AVH-A215BT-with-Bluetooth,-USB,DVD-Player-.-002.jpg', 'Pioneer-Car-Stereo-AVH-A215BT-with-Bluetooth,-USB,DVD-Player-.-003.png', NULL, '2019-04-30 16:12:56', '2019-04-30 16:12:56'),
(11, 'Pioneer AVH-X395BT DVD Player Radio', 'pioneer-avh-x395bt-dvd-player-radio', '12', NULL, 0, 'Out of Stock', 'Stereo With app Radio Mode, built in Bluetooth, DVD & direct control for iphone/ipod', '23000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-X395BT', 'Pioneer', '0', NULL, 'The pioneer <b>AVH-X395BT</b> is a double din car radio with a 6.2-inch touch screen display that allows you to enjoy great features while on the road such as Bluetooth hands-free calling, DVD Player, app radio mode &amp; direct control for iPod / iPhone.<br><br><b>Key Features<br><br></b><ul><li>&nbsp;6.2 inch Touch screen Display</li></ul><ul><li>AM/FM radio</li></ul><ul><li>Dual Inbuilt Bluetooth</li></ul><ul><li>DVD Player</li></ul><ul><li>USB &amp; AUX input</li></ul><ul><li>13 band Equalizer</li></ul><ul><li>App Radio Mode</li></ul><ul><li>Color Customization</li></ul><ul><li>Android Control via</li></ul><ul><li>USB</li></ul><ul><li>Compatible with Spotify</li></ul><ul><li>Mosfet 50w x 4</li></ul><ul><li>3 RCA output (4v)</li></ul><ul><li>Siri eyes-free</li></ul><b>What\'s in the Box?</b><br><br><ul><li>Pioneer AVH-X395BT radio head unit</li><li>Power Cables</li><li>Microphone</li><li>User Manual</li><li>Remote Control</li></ul><b>One Year Warranty</b><br>', NULL, 505766, 'Pioneer-AVH-X395BT-Car-Radio-With-Bluetooth-USB-DVD-Player.-thumbnail.png', 'Pioneer-AVH-X395BT-Car-Radio-With-Bluetooth-USB-DVD-Player.-001.png', NULL, 'PIONEER-AVH-X395BT-Car-Radio-With-Bluetooth-USB-DVD-Player.-002.jpg', 'Pioneer-AVH-X395BT-Car-Radio-With-Bluetooth-USB-DVD-Player.-003.png', NULL, '2019-04-30 16:15:05', '2019-04-30 16:15:05'),
(12, 'Pioneer AVH-Z2250BT', 'pioneer-avh-z2250bt', '0', NULL, 0, 'In Stock', 'Car Radio stereo With Spotify, apple car play, Siri eyes free & Dual Bluetooth', '36000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-Z2250BT', 'Pioneer', '0', NULL, '<p>The Pioneer <strong>AVH-Z2250BT</strong> is a Car stereo system that offers excellent features such as<strong> Apple Car Play</strong>, Bluetooth,<strong> Spotify</strong> at a Pocket-Friendly Cost.<br />\r\nThis radio even allows you to connect two Bluetooth devices simultaneously for hands-free calling. Also, it supports two-car cameras; front &amp; back.<br />\r\n&nbsp;</p>\r\n\r\n<p>You get to choose from a host of extra entertainment options such as USB/CD/DVD/FM/AM that can be accessed directly from a <strong>6.2&quot;</strong> touch screen Display.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>6.2&quot; Touch Screen Display</li>\r\n	<li>DVD/CD Player</li>\r\n	<li>FM/AM Radio</li>\r\n	<li>Bluetooth</li>\r\n	<li>Dual Backup Camera Support</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Spotify</li>\r\n	<li>Siri eyes Free</li>\r\n	<li>Weblink</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>Steering wheel Control Compatible</li>\r\n	<li>Mixtrax</li>\r\n	<li>3 (4v) High volt pre-out</li>\r\n	<li>Auto time alignment</li>\r\n	<li>Advanced sound Retriever</li>\r\n	<li>Power output 55W*4</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer AVH-Z2250BT&nbsp;</li>\r\n	<li>Power Socket</li>\r\n	<li>Microphone</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-AVH-Z2250BT-fb_pixels.png', 505766, 'Pioneer-AVH-Z2250BT--Car-Radio-with-Bluetooth-thumbnail.png', 'Pioneer-AVH-Z2250BT--Car-Radio-with-Bluetooth-001.png', NULL, 'PIONEER-AVH-Z2250BT-Car-Radio-with-Bluetooth-002.jp