(13, 'Pioneer AVH-Z7250BT Retractable radio', 'pioneer-avh-z7250bt-retractable-radio', '0', NULL, 0, 'In Stock', 'One Din Radio Touch-screen Multimedia player with Apple CarPlay, Android Auto & Bluetooth', '38000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-Z7250BT', 'Pioneer', '0', NULL, '<p>The <strong>AVH-Z7250</strong> is a one Din Radio with a large <strong>fold-out 7-inch</strong> touch screen Display. It is suitable for vehicles with One Din sized Radio slot, but whose owners would like to connect a <strong>backup camera</strong> &amp; enjoy various entertainment options on the screen.<br />\r\n<br />\r\nThis pioneer retractable radio has incredible<strong> features </strong>such as Bluetooth, DVD player, USB, Apple Car Play, Android Auto, &amp; Weblink.<br />\r\n<br />\r\nSuitable but not limited to Toyota 100, Harrier Old Model, Landrover Free lander.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>7&quot; Retractable Touch Screen Display</li>\r\n	<li>One Din Size</li>\r\n	<li>DVD player</li>\r\n	<li>FM Radio&nbsp;</li>\r\n	<li>Power Output 55W*4</li>\r\n	<li>Spotify</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Android Auto</li>\r\n	<li>Navigation with Apple Car Play &amp; Android Auto</li>\r\n	<li>Bluetooth</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>3 (4v) RCA Pre-out</li>\r\n	<li>Auto time Alignment</li>\r\n	<li>Advanced sound Retriever</li>\r\n	<li>Backup Camera Ready ( Dual Support)</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer AVH-Z7250BT&nbsp;</li>\r\n	<li>Power Cables</li>\r\n	<li>Remote control</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>', 'Pioneer-AVH-Z7250BT-Retractable-radio-fb_pixels.png', 505766, 'Pioneer-AVH-Z7250BT-pioneer-Car-radio-system-with-Android-Auto-thumbnail.png', 'Pioneer-AVH-Z7250BT-