(14, 'Pioneer AVH-Z5250BT Stereo', 'pioneer-avh-z5250bt-stereo', '0', NULL, 0, 'Out of Stock', 'Touch-screen Multimedia player with Apple CarPlay, Android Auto & Bluetooth', '37000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-Z5250BT', 'Pioneer', '0', NULL, '<p>The<strong> AVH-Z5250BT</strong> is a 6.8&quot; touch screen Radio that features the very best in automotive smartphone technology, including Apple Car Play, Android Auto, Bluetooth, Spotify, Reverse camera input.<br />\r\n<br />\r\n<strong>Android Auto</strong> &amp;<strong> Apple Car Play</strong>, Give you control of your smartphone in the car enabling you to make phone calls, navigate with google maps, listen to music &amp; send and receive messages.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.8&quot; Touch Screen Display</li>\r\n	<li>FM/Radio</li>\r\n	<li>DVD Player</li>\r\n	<li>Bluetooth</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Android Auto</li>\r\n	<li>Spotify</li>\r\n	<li>Waze</li>\r\n	<li>Weblink</li>\r\n	<li>13 band Equalizer</li>\r\n	<li>Auto Equalizer</li>\r\n	<li>Siri&#39;s eyes</li>\r\n	<li>Steering wheel control compatible</li>\r\n	<li>Backup Camera input</li>\r\n	<li>Auto time alignment</li>\r\n	<li>Advanced Sound Retriever</li>\r\n	<li>Power output 50W*4</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer Avh-z5250bt&nbsp;</li>\r\n	<li>Power cable</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n	<li>Microphone</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Pioneer-AVH-Z5250BT-Stereo-fb_pixels.png', 505766, 'Pioneer-AVH-Z5250BT-Stereo-with-Navigation-thumbnail.png', 'Pioneer-AVH-Z5250BT-Stereo-with-Navigation-001.png', NULL, 'PIONEER-AVH-Z5250BT-Stereo-with-Navigation-002.jpg', 'Pioneer-AVH-Z5250BT-Stereo-with-Navigation-003.png', NULL, '2019-04-30 16:19:55', '2019-04-30 16:19:55'),
(15, 'Pioneer AVH-ZL5150BT TOYOTA Car Stere', 'pioneer-avh-zl5150bt-toyota-car-stere', '0', NULL, 0, 'In Stock', '200mm Touch-screen Multimedia player with Apple CarPlay, Android Auto & Bluetooth.', '47000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-ZL5150BT', 'Pioneer', '0', NULL, '<p>Since not all Vehicles Fit the standard <strong>6.2&quot;</strong> head units, the AVH-<strong>ZL5150BT i</strong>s built to fit vehicles with <strong>8&quot;</strong> dash size (A majority of Toyota Cars)&nbsp;without requiring side spacers during installations.<br />\r\n<br />\r\nThis Car Radio offers the best in smartphone connectivity with <strong>Apple Car Play</strong>, <strong>Android Auto</strong>, Bluetooth &amp; USB.</p>\r\n\r\n<p>The AVH-ZL5150BT car stereo system features an intuitive 8 inch Touch Screen display, which is easy to use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>8&quot; Touch Screen Display</li>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>Bluetooth</li>\r\n	<li>USB/AUX In</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Android Auto</li>\r\n	<li>Spotify</li>\r\n	<li>Waze</li>\r\n	<li>Power Output 55W*4</li>\r\n	<li>Dual Camera input</li>\r\n	<li>13 band Equalizer</li>\r\n	<li>Steering Wheel control compatible</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer AVH-ZL5150BT</li>\r\n	<li>Microphone</li>\r\n	<li>Power cable</li>\r\n	<li>Use Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Pioneer-AVH-ZL5150BT-TOYOTA-Car-Stere-fb_pixels.png', 505766, 'Pioneer-AVH-ZL5150BT-TOYOTA-Car-Stereo-thumbnail.png', 'Pioneer-AVH-ZL5150BT-TOYOTA-Car-Stereo-001.png', NULL, 'PIONEER-AVH-ZL5150BT-TOYOTA-Car-Stereo-002.jpg', 'Pioneer-AVH-ZL5150BT-TOYOTA-Car-Stereo-003.png', NULL, '2019-04-30 16:21:15', '2019-04-30 16:21:15'),
(16, 'Pioneer Car Stereo with Navigation', 'pioneer-car-stereo-with-navigation', '0', NULL, 0, 'Out of Stock', 'AVH-X8850BT Touch-screen Multimedia player with Apple Carplay, Android Auto & Bluetooth, Detachable face panel.', '48000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'AVH-X8850BT', 'Pioneer', '0', NULL, '<p>The Pioneer <strong>AVH-X8850BT</strong> car stereo system features a 7-inch resistive touch Screen Display with a detachable face panel.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>It supports numerous useful features such as Apple Car Play, Android Auto, Dual backup Camera Input, Bluetooth, and much more. Besides, this stereo has <strong>inbuilt Navigation</strong> maps providing you with routes to where you want to drive.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>7&quot; Touch Screen Display</li>\r\n	<li>Detachable Face Panel</li>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>Bluetooth</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Android Auto</li>\r\n	<li>Dual Camera Input</li>\r\n	<li>Dual USB port</li>\r\n	<li>3(4V) Pre-out</li>\r\n	<li>App Radio Mode</li>\r\n	<li>SD Memory Card Slot</li>\r\n	<li>Mixtrax</li>\r\n	<li>DVC/CD playback</li>\r\n	<li>Power output 50W*4&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer AVH-X8850BT</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>Microphone</li>\r\n	<li>Remote&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Pioneer-Car-Stereo-with-Navigation-fb_pixels.png', 505766, 'Pioneer-AVH-X8850BT-Car-Stereo-with-Inbuilt-Navigation-Maps-thumbnail.png', 'Pioneer-AVH-X8850BT-Car-Stereo-with-Inbuilt-Navigation-Maps-001.png', NULL, 'Pioneer-AVH-X8850BT-Car-Stereo-with-Inbuilt-Navigation-Maps-002.jpg', 'Pioneer-AVH-X8850BT-Car-Stereo-with-Inbuilt-Navigation-Maps-003.png', NULL, '2019-04-30 16:22:39', '2019-04-30 16:22:39'),
