(18, 'Pioneer TS-R1051S 4\" car speakers', 'pioneer-ts-r1051s-4-car-speakers', '0', NULL, 0, 'In Stock', '210w 10cm 3-way Coaxial Vehicle Car Audio Speakers System', '2500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-R1051S', 'Pioneer', '0', NULL, '<p>The <strong>TS-R1051S</strong> Car&nbsp;speakers tap the full potential of your in-car audio setup.<br />\r\n<br />\r\nAimed at providing loud and <strong>clear output</strong> for any type of music, their sound quality results from a multilayer mica matrix woofer cone which ensures punching bass and improved midrange frequency response.<br />\r\n<br />\r\nYou&rsquo;ll enjoy a sound that is more accurate, with a full-bodied bass.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Size10 cm / 4.5 Inches</li>\r\n	<li>Maximum Music Power 210W</li>\r\n	<li>Nominal Music Power 30W</li>\r\n	<li>Frequency Response 34 Hz to 27 kHz</li>\r\n	<li>Impedance 4 &Omega;</li>\r\n	<li>Mounting Depth 42.8 mm</li>\r\n	<li>Cut-Out Dimensions &oslash;106 mm</li>\r\n	<li>Sensitivity 88dB</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>2 * PIONEER TS-R1051S Speakers</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-R1051S-4\"-car-speakers-fb_pixels.png', 895, 'Pioneer-TS-R1051S-4\"-car-speakers-thumbnail.png', 'Pioneer-TS-R1051S-4\"-car-speakers-001.png', NULL, 'PIONEER-TS-R1051S-4\"-car-speakers-002.jpg', 'Pioneer-TS-R1051S-4\"-car-speakers-003.png', NULL, '2019-04-30 16:29:00', '2019-04-30 16:29:00'),
