(20, 'Pioneer TS-G1615R car door speakers', 'pioneer-ts-g1615r-car-door-speakers', '277', NULL, 0, 'Out of Stock', '16 cm Dual cone Car speaker 230 Watts', '2800', 500, '2', NULL, NULL, 0, 0, 0, 1, 'TS-G1615R', 'Pioneer', '0', NULL, '<div>Pioneer&nbsp;<b>TS-G1615R</b> dual-cone speakers are water-resistant injection-molded polypropylene cones with a heat-resistant voice coil. <br><br>Switch your default car speaker with the Pioneer TS-G1615R and enjoy impressive<b> peak power</b> handling of 230W,<b> nominal power</b> of 40W, and impedance of 4 ohms.</div><div><br></div><b>Key features</b><ul><li>6.5\" Size</li><li>Max Music Power: 230W</li><li>Nominal Power: 40W</li><li>Speaker Size: 160mm</li><li>Impedance: 4ohms</li><li>Sensitivity: 90 dB (¬±1.5 dB, 1m , 1W)</li><li>Frequency Response: 30Hz to 25kHz</li></ul><div><br></div><b>What‚Äôs in the Box?</b><br><ul><li>A pair of TS-G1615R Speakers</li><li>Power Cable</li><li>User Manual</li></ul>', NULL, 895, 'Pioneer-TS-G1615R-car-door-speakers-thumbnail.png', 'Pioneer-TS-G1615R-car-door-speakers-001.png', NULL, 'PIONEER-TS-G1615R-CAR-DOOR-SPEAKERS-002.jpg', 'Pioneer-TS-G1615R-car-door-speakers-003.png', NULL, '2019-04-30 16:32:01', '2019-04-30 16:32:01'),
