(22, 'Pioneer TS-R6951S Oval Car Speakers', 'pioneer-ts-r6951s-oval-car-speakers', '0', NULL, 0, 'In Stock', '6‚Ä≥ x 9‚Ä≥ 3-Way Speaker 400Watts Car Speakers', '4700', 500, '2', NULL, NULL, 1, 0, 0, 0, 'TS-R6951S', 'Pioneer', '0', NULL, '<p>Pioneer <strong>TS-R6951S</strong> are <strong>Oval</strong>, 3- way Speakers with a maximum power output of <strong>400</strong> Watts &amp; nominal power of <strong>50</strong> Watts.<br />\r\n<br />\r\nThe Speakers built with a multilayer layer Mica Matrix Cone to ensure excellent sound performance &amp; durability.<br />\r\n<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Size 6&quot; x 9&quot;</li>\r\n	<li>Maximum Music Power 400 W</li>\r\n	<li>Nominal Music Power 50 W</li>\r\n	<li>Frequency Response 31 Hz to 35 kHz</li>\r\n	<li>Impedance 4 &Omega;</li>\r\n	<li>Mounting Depth 68 mm</li>\r\n	<li>Cut-Out Dimensions 153 mm x 222 mm</li>\r\n	<li>Sensitivity 92 dB</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pair of Pioneer TS-R6951S Speakers</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-R6951S-Oval-Car-Speakers-fb_pixels.png', 895, 'Pioneer-TS-R6951S-Oval-Car-Speakers-thumbnail.png', 'Pioneer-TS-R6951S-Oval-Car-Speakers-001.jpg', NULL, 'Pioneer-TS-R6951S-Oval-Car-Speakers-002.jpg', 'Pioneer-TS-R6951S-Oval-Car-Speakers-003.png', NULL, '2019-04-30 16:34:47', '2019-04-30 16:34:47'),
(23, 'Pioneer TS-A6966S Car Midrange', 'pioneer-ts-a6966s-car-midrange', '0', NULL, 0, 'In Stock', '3 Way Speakers 6x9 inch Black', '5000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-A6966S', 'Pioneer', '0', NULL, '<ul>\r\n	<li>\r\n	<p>This Pioneer TS-A6966S speaker is an excellent choice for your car. The<strong> 3-way</strong> design handles <strong>420 watts max</strong>. Power (60 watts nominal) and feature Pioneer&rsquo;s extremely strong and lightweight Injected Molded Polypropylene (IMPP) with MICA composite cone woofer, for improved sensitivity and reduced distortion.<br />\r\n	<br />\r\n	&nbsp;These speakers offer improved bass and dynamic range, higher power.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>Oval Speakers</li>\r\n		<li>Max input: 420 W</li>\r\n		<li>Nominal Input: 60 W</li>\r\n		<li>Frequency Response: 28 Hz to 36 kHz</li>\r\n		<li>Sensitivity: 92dB</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Pair of Pioneer TS-A6966S 6x9 Speaker (Black)</li>\r\n		<li>Power Cable</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-A6966S-Car-Midrange-fb_pixels.png', 895, 'Pioneer-TS-A6966S-Car-Midrange-thumbnail.png', 'Pioneer-TS-A6966S-Car-Midrange-001.png', NULL, 'Pioneer-TS-A6966S-Car-Midrange-Speakers-002.png', 'Pioneer-TS-A6966S-Car-Midrange-003.png', NULL, '2019-04-30 16:36:11', '2019-04-30 16:36:11'),
(24, 'PIONEER TS-A6976S Car Speakers - Oval', 'pioneer-ts-a6976s-car-speakers-oval', '0', NULL, 0, 'In Stock', '6‚Ä≥ x 9‚Ä≥ 3-way Car Speaker System 550 Watts.', '6000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-A6976S', 'Pioneer', '0', NULL, '<p>The Pioneer TS-A6976S Mid-range Speaker begins its impressive features with a Max power <strong>Output of 550 Watts </strong>and a nominal power of <strong>90 Watts.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These speakers&nbsp;comprise of a 3-way Speaker System built for excellent performance &amp; quality audio.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Size 6&quot; x 9&quot;</li>\r\n	<li>Frequency Response 27 Hz to 24 kHz</li>\r\n	<li>Impedance 4‚Ñ¶</li>\r\n	<li>Max output 550 W</li>\r\n	<li>Nominal output 90 W</li>\r\n	<li>Sensitivity 92dB</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-A6976S Speaker (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'PIONEER-TS-A6976S-Car-Speakers---Oval-fb_pixels.png', 895, 'PIONEER-TS-A6976S-Car-Speakers---Oval-thumbnail.png', 'PIONEER-TS-A6976S-Car-Speakers---Oval-001.png', NULL, 'PIONEER-TS-A6976S-Car-Speakers---Oval-002.png', 'PIONEER-TS-A6976S-Car-Speakers---Oval-003.png', NULL, '2019-04-30 16:37:46', '2019-04-30 16:37:46'),
(25, 'PIONEER TS-7150F 7\" * 10\" Midrange', 'pioneer-ts-7150f-7-10-midrange', '0', NULL, 0, 'In Stock', '500 Watts Champion Series car Speakers', '10499', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-7150F', 'Pioneer', '0', NULL, '<p>The TS-7150F introduces the new sized 7&quot; x 10&quot;, 5-Way Champion Series Speaker, includes a 6&quot;x9&quot; bracket for easy installation.<br />\r\nIt also has Dual Spiders and Motor Assembly is the driving force of massive dynamic sound that&rsquo;s true to the Champion Series name. It&rsquo;s Tougher at handling more high power input at higher volume without compromising higher quality. High-Power Handling:<br />\r\nDual Spiders supporting the voice coil effectively dampen large cone vibration and enhance linearity of sound reproduction. Large-Sized Mid-Range using Heat-Resistant PEI Cone, High-frequency sensitivity is increased with the use of a<br />\r\nn Large-Sized Mid-Range using Heat-Resistant PEI Cone, High-frequency sensitivity is increased with the use of a newly designed 66 mm mid-range speaker.<br />\r\n&nbsp;</p>\r\n\r\n<p>Pioneer&#39;s Dust Protection design reliably prevents dust from interfering with uncompromising speaker performance and durability.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Size 7&quot;x10&quot;<br />\r\n&bull; Maximum Music Power&nbsp; 500W<br />\r\n&bull; Nominal Music Power80W<br />\r\n&bull; Frequency Response27Hz to 25kHz<br />\r\n&bull; Impedance4 &Omega;<br />\r\n&bull; Mounting Depth85 mm<br />\r\n&bull; Cut-Out Dimensions166.5 x 237.5 mm<br />\r\n&bull; Sensitivity89.8dB<br />\r\n<br />\r\n<strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Pioneer TS-7150F Speaker (pair)<br />\r\n&bull; Power Cable<br />\r\n&bull; Manual</p>', '833-fb_pixels.png', 895, 'PIONEER-TS-7150F-7\"-*-10\"-Midrange-thumbnail.png', 'PIONEER-TS-7150F-7\"-*-10\"-Midrange-001.png', NULL, 'PIONEER-TS-7150F-7\"-*-10\"-Midrange-Speakers-002.png', 'PIONEER-TS-7150F-7\"-*-10\"-Midrange-003.png', NULL, '2019-04-30 16:39:11', '2019-04-30 16:39:11'),
(26, 'PIONEER TS-A2503i 10 Inch Car Speaker', 'pioneer-ts-a2503i-10-inch-car-speaker', '0', NULL, 0, 'In Stock', '25 cm 3-way car  speaker 420 Watts', '12000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-A2503i', 'Pioneer', '0', NULL, '<p>It&rsquo;s a Rock solid, full-bodied performance Speaker.<br />\r\nThe TS-A2503i speakers tap the full potential of your in car audio setup.<br />\r\nTheir signature IMPP woofer cone is synonymous with durability and is designed for superior performance. Reinforced with long Aramid fibers, the cone ensures a punching bass and improved midrange frequency response.<br />\r\n<br />\r\nAdditionally, the speakers utilize Open &amp; Smooth design concept which means that what you hear has an open, wider sound staging, with a smoother transition between the mid-bass and tweeter.<br />\r\n&nbsp;</p>\r\n\r\n<p>You&rsquo;ll enjoy a sound that is more accurate, with a full-bodied bass.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Size 25 cm<br />\r\n&bull; Tweeter size 18 mm<br />\r\n&bull; Maximum Music Power 420 W<br />\r\n&bull; Frequency Response 20 Hz to 31 KHz<br />\r\n&bull; Impedance 4&Omega;<br />\r\n&bull; Mounting Depth 115 mm<br />\r\n&bull; Cut-Out Dimensions &oslash;236 mm<br />\r\n&bull; Max output 420 W<br />\r\n&bull; Nominal output 80 W</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Sensitivity 92dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER TS-A2503i Speakers (pair)<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'PIONEER-TS-A2503i-10-Inch-Car-Speaker-fb_pixels.png', 895, 'PIONEER-TS-A2503i-10-Inch-Car-Speaker-thumbnail.png', 'PIONEER-TS-A2503i-10-Inch-Car-Speaker-001.png', NULL, 'PIONEER-TS-A2503i-10-Inch-Car-Speakers-002.png', 'PIONEER-TS-A2503i-10-Inch-Car-Speaker-003.png', NULL, '2019-04-30 16:40:19', '2019-04-30 16:40:19'),
(27, 'Pioneer TS-A250D4 Double coil Speaker', 'pioneer-ts-a250d4-double-coil-speaker', '0', NULL, 0, 'In Stock', '10 \" 1300 Watts 4 ohms car Bass Speaker.', '6000', 500, '4', NULL, NULL, 0, 1, 0, 0, 'TS-A250D4', 'Pioneer', '0', NULL, '<p>Pioneer&#39;s <strong>TS-A250D4 10&quot; sub woofer</strong> is built to take it as well as dishing it out.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Pioneer&nbsp; sub features a ribbed cone that&#39;s injection-molded for exceptional precision and strength.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A double-layered elastic polymer surround supports the woofer during cone excursion, so you&#39;ll get accurate, hard-hitting bass notes even when the music&#39;s turned up loud.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>10&quot; 4-ohm sub woofer</li>\r\n	<li>IMPP composite seamless cone</li>\r\n	<li>2-layer fiber-reinforced elastic polymer surround</li>\r\n	<li>stamped steel basket</li>\r\n	<li>power handling: 400 watts RMS</li>\r\n	<li>peak power handling: 1,300 watts</li>\r\n	<li>frequency response: 20Hz-2 KHz</li>\r\n	<li>sensitivity: 94 dB</li>\r\n	<li>top-mount depth: 5-1/2&quot;</li>\r\n	<li>Double Coil Speaker.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-A250D4&nbsp; Bass Speaker</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'PIONEER-TS-A250D4-fb_pixels.png', 2833, 'PIONEER-TS-A250D4-thumbnail.png', 'PIONEER-TS-A250D4-001.png', NULL, 'PIONEER-TS-A250D4-10-\"-Car-Bass-Speaker-1300W-002.jpg', 'PIONEER-TS-A250D4-003.png', NULL, '2019-04-30 16:42:06', '2019-04-30 16:42:06'),
(28, 'Pioneers TS-Z10LS2 Shallow Mount Subw', 'pioneers-ts-z10ls2-shallow-mount-subw', '0', NULL, 0, 'In Stock', '10\" Single 2 ohms Voice Coil shallow mount Sub woofer', '16000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-Z10LS2', 'Pioneer', '0', NULL, '<p>The Z subwoofer is based on the same highly advanced technology as the Z full range loudspeakers to create seamlessly integrated musical perfection &ndash; fast, detailed and extended bass with tremendous impact and clarity. Combining high fidelity and high output in a compact, shallow design, the Z subwoofer offers virtually unlimited installation flexibility. As a result, the placement of the Z subwoofer can be optimized for sound quality and bass reinforcement, unlike conventional subwoofers that must be installed simply where they physically fit. Balance, speed, power and bass extension &ndash; the ultimate combination for low-frequency nirvana.<br />\r\n<br />\r\n<strong>Key features</strong><br />\r\n&bull; Twaron&reg; Aramid Fiber + Cellulose Fiber Dual Layer Cone Construction<br />\r\n&bull; Extended Voice Coil, Dual Spider Design for Increased Linearity and High Excursion<br />\r\n&bull; Shallow Basket, Small Enclosure Design for Sound Optimization and Installation Flexibility<br />\r\n&bull; Designed for Hi-Res Audio<br />\r\n&bull; Frequency Range<br />\r\n&bull; 20 Hz to 3.8 kHz<br />\r\n&bull; Continuous Power Handling (RMS)<br />\r\n400 Watts<br />\r\n&bull; Maximum Peak Power Handling<br />\r\n1300 Watts<br />\r\n&bull; Nominal Impedance</p>\r\n\r\n<p>2 ohms</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER TS-Z10LS2 Bass Speaker<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneers-TS-Z10LS2-Shallow-Mount-Subw-fb_pixels.png', 2833, 'Pioneers-TS-Z10LS2-Shallow-Mount-Subw-thumbnail.png', 'Pioneers-TS-Z10LS2-Shallow-Mount-Subw-001.png', NULL, 'PIONEER-TS-Z10LS2-SHALLO-MOUNT-SUBWOOFER-002.jpg', 'Pioneers-TS-Z10LS2-Shallow-Mount-Subw-003.png', NULL, '2019-04-30 16:43:51', '2019-04-30 16:43:51'),
(29, 'pioneer TS-W306R Car Bass Speaker', 'pioneer-ts-w306r-car-bass-speaker', '0', NULL, 0, 'Out of Stock', '350 Watts RMS Car Sub woofer with Powerful Bass', '5499', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-W306R', 'Pioneer', '0', NULL, 'The Pioneer TS-W306R gets you powerful, punchy bass in your car ‚Äì from the pedigree of world record-breaking subs. This subwoofer features an IMPP composite seamless cone, which delivers superior durability and rock solid bass, from it‚Äôs ultra-rigid, yet lightweight structure. All of these combined gives you low distortion and powerful bass at high sound pressure levels.<br>Voice Coil Cooling System<br>Heat radiation is the key point to improve durability and sound. Aluminum Cap &amp; Aluminum Bobbin allow heat to be removed from the center of the subwoofer for improved frequency response and high power handling.<br>A: Heat is also radiated from aluminum cap along aluminum bobbin.<br>B: Heat is radiated from iron of the magnetic circuit<br><br><b>Key features</b><br>‚Ä¢ 1300 Watts Max Power <br>‚Ä¢ Nominal Power 350 Watts<br>‚Ä¢ New Voice Coil Cooling System (VCCS)<br>‚Ä¢ IMPP cone produces tight and accurate bass<br>‚Ä¢ Specially designed Voice coil offers higher power handling<br>‚Ä¢ Size 12\"<br>‚Ä¢ Impedance&nbsp; 4 Ohms<br>‚Ä¢ Frequency Response&nbsp; 20 Hz to 125 Hz<br><div>‚Ä¢ Sensitivity (IN CAR, INPUT: 1W)&nbsp; 96 dB</div><div><br></div><div><br></div><b>What‚Äôs in the Box?</b><br><br>‚Ä¢ PIONEER TS-W306R Bass Speaker<br>‚Ä¢ Fittings as per Manufacturer<br>‚Ä¢ User Manual<br>', NULL, 2833, 'pioneer-TS-W306R-Car-Bass-Speaker-thumbnail.png', 'pioneer-TS-W306R-Car-Bass-Speaker-001.png', NULL, 'PIONEER-TS-W306R-CAR-BASS-SPEAKER-002.jpg', 'pioneer-TS-W306R-Car-Bass-Speaker-003.png', NULL, '2019-04-30 16:45:33', '2019-04-30 16:45:33');
INSERT INTO `product` (`id`, `name`, `slung`, `replaced`, `price_raw`, `offer`, `stock`, `meta`, `price`, `shipping`, `cat`, `tag`, `sub_cat`, `featured`, `trending`, `banner`, `slider`, `code`, `brand`, `full`, `iframe`, `content`, `fb_pixels`, `google_product_category`, `thumbnail`, `image_one`, `offer_banner`, `image_two`, `image_three`, `image_four`, `created_at`, `updated_at`) VALUES
(30, 'Pioneer TS-300S4 Bass Speaker', 'pioneer-ts-300s4-bass-speaker', '0', NULL, 0, 'In Stock', '30cm, Champion Series Car Subwoofer 1400 Watts.', '6000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-300S4', 'Pioneer', '0', NULL, '<p>Pioneer Champion Series subwoofers are strong, tough and can handle high power at high volume levels without compromising sound quality.<br />\r\nWith Dual Spiders and Motor Assembly as the driving force, they can produce deep dynamic sounds that are true to the Champion Series name. These models also have a unique Pioneer Dust Protection design, to prevent dust from interfering and compromising the subwoofer performance and reliability. Pioneer Champion Series subwoofers ensure accurate, deep punchy and rhythmical bass by using advanced technologies, such as a Pioneer patented IMPP composite cone material, a rigid 3D-shaped cone design and large double stacked magnets. Upgrade your sound with the Pioneer TS-300S4. This single voice coil 30cm subwoofer delivers 1400 W Maximum power and 400 W Nominal power. It can be used both in an enclosure or free air use.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n<br />\r\n&bull; Size 30 cm<br />\r\n&bull; Maximum power 1400 W<br />\r\n&bull; Nominal input power 400 W<br />\r\n&bull; Sensitivity&nbsp; 93 dB<br />\r\n&bull; Impedance&nbsp; 4 &Omega;<br />\r\n&bull; Mounting Depth&nbsp; 147 mm<br />\r\n&bull; Cut-out Hole 281 mm<br />\r\n&bull; Woofer material IMPP<br />\r\n&bull; Voice Coil type Copper Round Wire 4-Layer<br />\r\n&bull; Voice Coil bobbin type Polyimide<br />\r\n&bull; Lowest resonance frequency 27 Hz<br />\r\n&bull; Magnet&nbsp; Ferrite (double)<br />\r\n<br />\r\n<strong>What&rsquo;s in the box?</strong><br />\r\n&bull; PIONEER TS-300S4 Bass Speaker<br />\r\n&bull; Fittings per manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-300S4-Bass-Speaker-fb_pixels.png', 2833, 'Pioneer-TS-300S4-Bass-Speaker-thumbnail.png', 'Pioneer-TS-300S4-Bass-Speaker-001.png', NULL, 'Pioneer-TS-300S4-Bass-Speaker-002.png', 'Pioneer-TS-300S4-Bass-Speaker-003.png', NULL, '2019-04-30 16:46:48', '2019-04-30 16:46:48'),
(31, 'Pioneer TS-W311D4 double coil Speaker', 'pioneer-ts-w311d4-double-coil-speaker', '0', NULL, 0, 'Out of Stock', 'Champion Series 12\" subwoofer with dual 4-ohm voice coils', '8000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-W311D4', 'Pioneer', '0', NULL, '<p>Pioneer&#39;s TS-W311D4 12&quot; subwoofer is built to take it as well as dishing it out. This Pioneer Champion Series sub features a ribbed cone that&#39;s injection-molded for exceptional precision and strength. A double-layered elastic polymer surround supports the woofer during cone excursion so you&#39;ll get accurate, hard-hitting bass notes even when the music&#39;s turned up loud. The dual 4-ohm voice coils allow you to wire the sub for 2- or 8-ohm impedance, so you get the flexibility you need to add more Champion Series subs in the future. &nbsp;<br />\r\n<br />\r\nAdd some boom to your daily drive<br />\r\nIf your vehicle&#39;s audio system sounding a little thin,&nbsp; this Pioneer sub can remedy that situation, bringing out all the punch and power in your music by filling in the lowest frequencies of the sound spectrum. Throw one or two of these subs in your daily ride, power them up with a nice amp, and you&#39;ll understand what the fuss is all about &mdash; whatever you listen to, great bass will make it sound much, much better.<br />\r\n<br />\r\n<strong>Key features</strong><br />\r\n&bull; 12&quot; subwoofer with dual 4-ohm voice coils<br />\r\n&bull; IMPP composite seamless cone<br />\r\n&bull; 2-layer fiber-reinforced elastic polymer surround<br />\r\n&bull; stamped steel basket<br />\r\n&bull; max power handling: 400 watts RMS (200 watts RMS per coil)<br />\r\n&bull; peak power handling: 1,400 watts<br />\r\n&bull; frequency response: 20-125 Hz<br />\r\n&bull; sensitivity: 95 dB</p>\r\n\r\n<p>&bull; top-mount depth: 6&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER TS-W311D4 Double coil Bass Speaker<br />\r\n&bull; Fittings per manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-W311D4-double-coil-Speaker-fb_pixels.png', 2833, 'Pioneer-TS-W311D4-double-coil-Speaker-thumbnail.png', 'Pioneer-TS-W311D4-double-coil-Speaker-001.png', NULL, 'PIONEER-TS-W311D4-DOUBLE-COIL-SUBWOOFER-002.jpg', 'Pioneer-TS-W311D4-double-coil-Speaker-003.png', NULL, '2019-04-30 16:48:43', '2019-04-30 16:48:43'),
(32, 'Pioneer Shallow mount Subwoofer', 'pioneer-shallow-mount-subwoofer', '0', NULL, 0, 'In Stock', '12\" Shallow-Mount Subwoofer with 1,500 Watts Max. Power', '14000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-SW3002S4', 'Pioneer', '0', NULL, '<p>Shallow subwoofers are designed to provide wider installation options for a broad range of vehicles. These shallow-mount subwoofers feature multiple patent-pending features to deliver the big bass performance of a full-size subwoofer, but in a compact design that can be installed either behind or under seats depending on the type of vehicle. The mounting depth is just 3-3/8&quot; - less than half a typical subwoofer in this class.</p>\r\n\r\n<p>This 12&quot; shallow subwoofer handles 1,500 watts max., 400 watts nominal power, and delivers deep bass with top-notch sound quality thanks to features like Pioneer&#39;s MICA injection-molded resin which gives it the ability to produce accurate bass.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Size 12&quot;<br />\r\n&bull; Max. Music Power (Nominal) 1,500W (400W)<br />\r\n&bull; Frequency Response 20 Hz - 125 Hz<br />\r\n&bull; Sensitivity (IN CAR, INPUT: 1W) 93 dB<br />\r\n&bull; Impedance Single 4 Ohms<br />\r\n&bull; Mounting Depth 3-3/8&quot;<br />\r\n&bull; Cut-Out Dimensions&nbsp;&nbsp; 11-3/4&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Recommended&nbsp; Enclosure&nbsp; 0.50 - 1.00 cu. ft.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; 12 Inch PIONEER TS-SW3002S4 1500Watts Shallow Mount Subwoofer<br />\r\n&bull; Fittings per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-Shallow-mount-Subwoofer-fb_pixels.png', 2833, 'Pioneer-Shallow-mount-Subwoofer-thumbnail.png', 'Pioneer-Shallow-mount-Subwoofer-001.png', NULL, 'PIONEER-TS-SW3002S4-SHALLOWMOUNT-SUBWOOFER-002.jpg', 'Pioneer-Shallow-mount-Subwoofer-003.png', NULL, '2019-04-30 16:51:16', '2019-04-30 16:51:16'),
(33, 'Pioneer TS-W3003D4 Dual Coil Speaker', 'pioneer-ts-w3003d4-dual-coil-speaker', '0', NULL, 0, 'In Stock', 'Champion Series PRO Subwoofer with Dual 4 Œ© Voice Coils and 2,000 Watts Max Power. (600 Watts Nominal)', '12500', 500, '4', NULL, NULL, 1, 0, 0, 0, 'TS-W3003D4', 'Pioneer', '0', NULL, '<p>Pioneer TS-W3003D4 12&quot; 2,000-Watt Champion Series Pro Sbwoofer ,Improving on conventional designs, this model features a dual spider design for improved linearity, a larger pole with thicker wire for more accurate bass, a larger magnet for louder bass and a reinforced basket for more durability. This Pioneer subwoofer produces a steady, loud and powerful bass that is capable of withstanding up to 2,000 watts of maximum power while carrying 600 watts of continuous musical power. That means that not only is there more bass, but the overall sound quality is improved compared to typical car stereo speakers. Those with smaller vehicles will appreciate the compact 12&quot; design that can fit&nbsp; behind back seats, beneath the dash or even in the trunk compartment. It has everything you would expect from a 2000w subwoofer and more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Size 12&quot;<br />\r\n&bull; Max. Music Power (Nominal)&nbsp;&nbsp; 2,000W (600 W)<br />\r\n&bull; Frequency Response 20Hz - 80 Hz<br />\r\n&bull; Sensitivity (IN CAR, INPUT: 1W)&nbsp;&nbsp; 96 dB<br />\r\n&bull; Impedance 4 &amp; x 2<br />\r\n&bull; Mounting Depth&nbsp; 6.9&quot;<br />\r\n&bull; Cut-Out Dimensions 11.1&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Recommended Enclosure 1.25 cu. ft.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; 12 Inch TS-W3003D4 Double Coil Car Subwoofer<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-W3003D4-Dual-Coil-Speaker-fb_pixels.png', 2833, 'Pioneer-TS-W3003D4-Dual-Coil-Speaker-thumbnail.png', 'Pioneer-TS-W3003D4-Dual-Coil-Speaker-001.png', NULL, 'Pioneer-TS-W3003D4-Dual-Coil-Speaker-002.png', 'Pioneer-TS-W3003D4-Dual-Coil-Speaker-003.png', NULL, '2019-04-30 16:54:57', '2019-04-30 16:54:57'),
(34, 'Pioneer TS-D12D4 Double Coil', 'pioneer-ts-d12d4-double-coil', '0', NULL, 0, 'In Stock', '12\" subwoofer with dual 4-ohm voice coils speaker', '10000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-D12D4', 'Pioneer', '0', NULL, '<p>Great bass is all about power, and Pioneer created their D-Series subs with that thought in mind. They built the TS-D12D4 12&quot; subwoofer to handle up to 600 watts RMS, while it dishes out impressive low-frequency punch. This sub features an injection-molded polypropylene cone that&#39;s impregnated with Aramid fibers for exceptional precision and strength. A butyl rubber surround supports the woofer during cone excursion so you&#39;ll get accurate, hard-hitting bass notes even when the music&#39;s turned up loud. The sub&#39;s dual 4-ohm voice coils give you more wiring options when setting up your system</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features </strong><br />\r\n&bull; 12&quot; subwoofer with dual 4-ohm voice coils<br />\r\n&bull; injection-molded polypropylene/aramid fiber cone<br />\r\n&bull; butyl rubber surround<br />\r\n&bull; power handling: 600 watts RMS (300 watts per coil)<br />\r\n&bull; 2000 watts peak power handling<br />\r\n&bull; frequency response: 20-4700 Hz</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; sensitivity: 78 dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer Car TS-D12D4 Bass Speaker<br />\r\n&bull; Fittings per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-D12D4-Double-Coil-fb_pixels.png', 2833, 'Pioneer-TS-D12D4-Double-Coil-thumbnail.png', 'Pioneer-TS-D12D4-Double-Coil-001.png', NULL, 'Pioneer-TS-D12D4-DOUBLE-COIL-BASS-SPEAKER-002.jpg', 'Pioneer-TS-D12D4-Double-Coil-003.png', NULL, '2019-04-30 16:56:40', '2019-04-30 16:56:40'),
(35, 'Pioneer TS-WX306B preloaded Subwoofer', 'pioneer-ts-wx306b-preloaded-subwoofer', '0', NULL, 0, 'In Stock', '30cm (12\") 1300 watt Bass-Reflex Box with Subwoofer', '15000', 500, '4', NULL, NULL, 1, 0, 0, 0, 'TS-WX306B', 'Pioneer', '0', NULL, '<p>Constructed with thick MDF board for assured strength and stability, the TS-WX306B sealed enclosure system is well tuned to reproduce powerful rhythmical bass.<br />\r\nThe TS-WX306B enclosure houses a durable woofer that is built with a Voice Coil Cooling System (VCCS), improving heat removal from the center of the subwoofer, thus increasing frequency response and high power handling. Pioneer&rsquo;s patented lightweight IMPP composite seamless cone maintains reliable power handling up to 1300 Watt.</p>\r\n\r\n<p>Requiring only a minimum of space, the shallow box easily fits behind a rear car seat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Reproduction system: Bass-Reflex Subwoofer<br />\r\n&bull; Speaker size (mm): 300<br />\r\n&bull; 4-ohm voice coil: Single<br />\r\n&bull; Maximum input power -1300 W<br />\r\n&bull; Nominal input power - 350 W<br />\r\n&bull; Frequency response 20 - 125 Hz<br />\r\n&bull; Lowest resonance frequency 29 Hz<br />\r\n&bull; Woofer size - 30cm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Woofer material -IMPP Composite Seamless Cone</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER TS-WX306B Enclosed Subwoofer<br />\r\n&bull; Fittings per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-WX306B-preloaded-Subwoofer-fb_pixels.png', 2833, 'Pioneer-TS-WX306B-preloaded-Subwoofer-thumbnail.png', 'Pioneer-TS-WX306B-preloaded-Subwoofer-001.png', NULL, 'PIONEER-TS-WX306B-ENCLOSED-CAR-SUBWOOFER-002.jpg', 'Pioneer-TS-WX306B-preloaded-Subwoofer-003.png', NULL, '2019-04-30 16:58:57', '2019-04-30 16:58:57'),
(36, 'Pioneer TS-WX306T Bass Tube Subwoofer', 'pioneer-ts-wx306t-bass-tube-subwoofer', '0', NULL, 0, 'Out of Stock', '1300 watts 12\" Car bass tube', '12500', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-WX306T', 'Pioneer', '0', NULL, '<div>It produces Solid, punchy and powerful bass. Constructed with thick MDF board for assured strength and stability, the TS-WX306T bass-reflex tube system is well tuned to reproduce punchy and powerful bass. The TS-WX306T tube houses a durable woofer that is built with a Voice Coil Cooling System (VCCS), improving heat removal from the Centre of the subwoofer, thus increasing frequency response and high power handling. Pioneer‚Äôs patented lightweight IMPP composite seamless cone maintains reliable power handling up to 1300 Watt. The subwoofer comes in a cylindrical design to get rid of standing waves inside the enclosure, in order to avoid deterioration of the bass performance.</div><div><br></div><b>Key features</b><br>‚Ä¢ Type: Powered Subwoofer system<br>‚Ä¢ Sound pressure level: 114dBÔºà¬±1.5ÔΩÑBÔºâ<br>‚Ä¢ Frequency range: 20 ÔΩû 130 Hz ÔºàÔºç20ÔΩÑBÔºâ<br>‚Ä¢ Maximum power: 1300W<br>‚Ä¢ Nominal power: ( 350W )<br>‚Ä¢ Cone size: 12 \" ( 30 cm) Cone<br>‚Ä¢ Impedance: 0.5 OHM<br>‚Ä¢ Surround material: Urethane<br>‚Ä¢ Diaphragm material: Pulp<br>‚Ä¢ Magnet material: Ferrite<br><div>‚Ä¢ Voice coil: Copper round wire 4-layers</div><div><br></div><b>What‚Äôs in the box?</b><br>‚Ä¢ PIONEER TS-WX306T 12\" BASS TUBE Subwoofer<br>‚Ä¢ Fittings per Manufacturer<br>‚Ä¢ User Manual<br>', NULL, 2833, 'Pioneer-TS-WX306T-Bass-Tube-Subwoofer-thumbnail.png', 'Pioneer-TS-WX306T-Bass-Tube-Subwoofer-001.png', NULL, 'Pioneer-TS-WX306T-Bass-Tube-Subwoofer-002.png', NULL, NULL, '2019-04-30 17:00:46', '2019-04-30 17:00:46'),
(37, 'Pioneer TS-WX300TA Powered Subwoofer', 'pioneer-ts-wx300ta-powered-subwoofer', '0', NULL, 0, 'In Stock', '12‚Ä≥ 1300w Sub & Amp Bass tube Car Amplified Subwoofer', '24000', 500, '23', NULL, NULL, 1, 0, 0, 0, 'TS-WX300TA', 'Pioneer', '0', NULL, '<p>The Pioneer<strong> TS-WX300TA 12&quot; 1300 </strong>watt Active Tube Bass Reflex System is built for high quality and amazing volume of the bass sound.</p>\r\n\r\n<p>Installed in a bass reflex tube, this active subwoofer is powerful enough to create the low frequencies that can&#39;t be produced from an OEM solution.</p>\r\n\r\n<p>This<strong> powered Subwoofer</strong> saves you the hustle of having to install a bass speaker, Amplifier &amp; Equalizer. With this Subwoofer, all you need is power it and connect to a source of sound (car stereo) and your good to go.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Type Active Bass Tube</li>\r\n	<li>Size 12&quot;</li>\r\n	<li>Max Power Output 1300W</li>\r\n	<li>Nominal Power Output 350W RMS</li>\r\n	<li>Frequency Response 20 Hz to 130 Hz</li>\r\n	<li>Impedance 0.5 ohm</li>\r\n	<li>Sensitivity 114 dB</li>\r\n	<li>Cone Material IMPP Composite Cone</li>\r\n	<li>Surround Composition Urethane Surround</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>PIONEER TS-WX300TA Enclosed Subwoofer</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-WX300TA-Powered-Subwoofer-fb_pixels.png', 895, 'Pioneer-TS-WX300TA-Powered-Subwoofer-thumbnail.png', 'Pioneer-TS-WX300TA-Powered-Subwoofer-001.png', NULL, 'Pioneer-TS-WX300TA-Powered-Subwoofer-002.png', NULL, NULL, '2019-04-30 17:02:21', '2019-04-30 17:02:21'),
(38, 'Pioneer TS-SWX2502 Enclosed Subwoofer', 'pioneer-ts-swx2502-enclosed-subwoofer', '0', NULL, 0, 'Out of Stock', '10 inch shallow mount pre-loaded subwoofer enclosure 1200w', '18500', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-SWX2502', 'Pioneer', '0', NULL, '<p>Want hard-hitting bass but don&#39;t want some bulky, space eating enclosure? Pioneer&#39;s TS-SWX2502 slim line pre-loaded subwoofer enclosure suits a wide range of applications and will fit into a variety of car trunk, under seat, utility and truck applications, delivering powerful performance without taking up a lot of space.<br />\r\nAt only 6&quot; deep, the TS-SWX2502 is an ideal sub option for use in most standards, extended, or crew cab pickups.<br />\r\nOversized Cone Surface with Tight Bass<br />\r\nThe shallow-mount subwoofer that comes preloaded in the TS-SWX2502 utilizes an oversized cone structure that provides greater cone and gasket surface without changing its standard external dimension. This cone surface allows the subwoofer to produce louder deeper bass by moving more air. It is made of highly rigid cone made of MICA injection-molded resin which creates a rigid and durable cone, giving it the ability to produce accurate bass. The subwoofer includes a dual spider to provide more cone motion control for optimized stiffness stabilizing the excursion of the cone and support the subwoofer&#39;s linear movement for accurate bass response. &nbsp;<br />\r\nAngled Push Terminals<br />\r\nTraditional subwoofer terminals are mounted horizontally or vertically. These mounts force wires to be bent to fit which can be difficult if low gauge high performance wires are used. The Pioneer shallow subwoofer&rsquo;s patent-pending, angled push terminals make it easy to connect speaker wires. The straighter connection saves space and makes installation easier.<br />\r\nNew Design Enclosure</p>\r\n\r\n<p>Thanks to its innovative enclosure design, the TS-SWX2502 enclosure can be installed freely in the cabin or luggage area for optimal utilization of space. Compact space-saving dimensions make it easy to install the subwoofer in a variety of trucks- standard-cab, extended-cab, or crew-cab. The enclosure is fully carpeted, creating a non-slip and scratch resistant surface.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Size: 25cm<br />\r\n&bull; Max Music Power 1,200W &nbsp;<br />\r\n&bull; Nominal&nbsp; power 300W<br />\r\n&bull; Frequency Response: 20Hz to 200Hz<br />\r\n&bull; Sensitivity (In Car/ 1W): 89dB<br />\r\n&bull; Impedance: 4&Omega;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Dimensions: 18-3/4&quot;W X 5-7/8&quot;H X 12&quot;Dditional subwoofer terminals are mounted horizontally or vertically.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER TS-SWX2502 Shallow mount Subwoofer<br />\r\n&bull; Fittings as&nbsp; per Manufacturer<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-SWX2502-Enclosed-Subwoofer-fb_pixels.png', 2833, 'Pioneer-TS-SWX2502-Enclosed-Subwoofer-thumbnail.png', 'Pioneer-TS-SWX2502-Enclosed-Subwoofer-001.png', NULL, 'PIONEER-TS-SWX2502-ENCLOSED-SUBWOOFER-002.jpg', 'Pioneer-TS-SWX2502-Enclosed-Subwoofer-003.png', NULL, '2019-04-30 17:04:46', '2019-04-30 17:04:46'),
(39, 'Pioneer TS-WX1210A Powered Subwoofer', 'pioneer-ts-wx1210a-powered-subwoofer', '0', NULL, 0, 'In Stock', '12\" amplified active subwoofer with enclosure 1300w', '20000', 500, '23', NULL, NULL, 1, 0, 0, 0, 'TS-WX1210A', 'Pioneer', '0', NULL, 'TS-WX1210A subwoofer is built with high bandwidth, high output and low distortion 300-watt class d amplifier mated to high sensitivity woofers specifically optimized for use in small, sealed enclosures. user adjustable controls include a variable low pass filter (50hz to 125hz), phase control (normal/reverse) and variable bass boost (0 to +12 db gain with 40hz to 100hz center frequency) providing enhanced control of subwoofer output. to expand system flexibility and user control, input gain can be adjusted using the included wired remote bass control knob or via the input gain control mounted on the enclosure side panel.<br>Powered amplified subwoofer<br>Built with high bandwidth, high output and low distortion 300-watt class d amplifier mated to high sensitivity woofers specifically optimized for use in small, sealed enclosures.<br>Flexible sound adjustment<br>User adjustable controls include an lpf, phase control and variable bass boost (0 to +12 db, 40hz to 100hz) providing enhanced control. To expand system flexibility and user control, input gain can be adjusted using the included wired remote bass control knob or via the input gain control mounted on the enclosure side panel.<br>Install flexibility<br><div>The innovative trapezoid shape of the enclosure is designed for high rigidity and to reduce internal standing waves, while also increasing installation flexibility. Can be installed freely in the cabin or under seats and re-positioned with the subwoofer firing rear, front or upwards for optimal bass tuning. The enclosure is fully carpeted, creating a non-slip, durable and scratch resistant surface.</div><div><br></div><b>Key Features</b><br>o 1,300 watts max power. <br>o Nominal Power 350W<br>o Built-in 300 watts output class-d amplifier<br>o Variable bass boost (0 to +12 db, 40hz to 100hz)<br><div>o wired remote bass control &amp; gain control on side panel</div><div><br></div><b>What‚Äôs In the Box?</b><br>‚Ä¢ TS-WX1210A Amplified Subwoofer<br>‚Ä¢ Fittings as per Manufacturer<br>‚Ä¢ User Manual<br>', NULL, 895, 'Pioneer-TS-WX1210A-Powered-Subwoofer-thumbnail.png', 'Pioneer-TS-WX1210A-Powered-Subwoofer-001.png', NULL, 'Pioneer-TS-WX1210A-Powered-Subwoofer-002.png', NULL, NULL, '2019-04-30 17:06:00', '2019-04-30 17:06:00'),
(40, 'Pioneer TS-WX70DA Slim Subwoofer', 'pioneer-ts-wx70da-slim-subwoofer', '0', NULL, 0, 'Out of Stock', 'Slim Design 200 watts compact powered subwoofer with remote for Bass Control', '32000', 500, '23', NULL, NULL, 0, 0, 0, 0, 'TS-WX70DA', 'Pioneer', '0', NULL, '<p>With <strong>Class-D amplifier technology</strong>, the TS-WX70DA&nbsp;subwoofer generates 200W maximum power, consuming power at levels lower than conventional amplifier designs and reducing the need for a large, traditional heat sink. The result is a compact, easy to install amplifier which in some vehicles requires no direct battery connection.<br />\r\n<br />\r\n<strong>Selectable&nbsp;&ldquo;Bass Mode&rdquo;</strong><br />\r\nTS-WX70DA features two selectable Bass Modes: DEEP and DYNAMIC, producing strong, rich, deep bass you can feel. You can easily control and customize the bass output from the supplied wired remote control.<br />\r\n<strong>DEEP Mode:</strong> Achieve rich, deep bass sound quality in the car. Suitable for Classic, Jazz, Country Music, etc.<br />\r\n<strong>DYNAMIC Mode</strong>: Emphasize powerful, strong and dynamic bass sound in the car. Suitable for EDM, Hip-Hop, Rock Music, etc.<br />\r\n<br />\r\n<strong>Back-loaded Horn structure</strong><br />\r\nThe rear-loaded horn-type structure passively amplifies sound for deeper, more natural bass reproduction.<br />\r\n<br />\r\n<strong>Install Flexibility</strong></p>\r\n\r\n<p>With its solid body and build, the TS-WX70DA can be installed wherever space is available in a car&rsquo;s luggage area.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Maximum power input (100W x 2) 200 W</li>\r\n	<li>Nominal input power (50W x 2) 100 W</li>\r\n	<li>Built-in variable LPF (50-125 Hz, -12dB/oct.) Yes (variable)</li>\r\n	<li>Amplified Subwoofer</li>\r\n	<li>Space Saving</li>\r\n	<li>Impedance 4 &Omega;</li>\r\n	<li>Frequency response DEEP Bass Mode: 20 - 250 Hz DYNAMIC Bass Mode: 40 - 250 Hz</li>\r\n	<li>Sensitivity DEEP Bass Mode: 104 dB DYNAMIC Bass Mode: 110 dB</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>PIONEER TS-WX70DA Space-saving sub woofer</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-WX70DA-Slim-Subwoofer-fb_pixels.png', 895, 'Pioneer-TS-WX70DA-Slim-Subwoofer-thumbnail.png', 'Pioneer-TS-WX70DA-Slim-Subwoofer-001.png', NULL, 'Pioneer-TS-WX70DA-Slim-Design-Compact-Subwoofer-002.png', NULL, NULL, '2019-04-30 17:07:36', '2019-04-30 17:07:36'),
(41, 'Pioneer Car Underseat Subwoofer', 'pioneer-car-underseat-subwoofer', '0', NULL, 0, 'In Stock', 'TS-WX130DA Space Saving Car Under-seat Subwoofer 160W', '19000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-WX130DA', 'Pioneer', '0', NULL, '<p>Space Saving Active Subwoofer with built-in Class-D Amplifier utilizing DIGITAL BASS CONTROL for DEEP and DYNAMIC controlled bass. It&rsquo;s Easy to install thanks to its small footprint. (160 W)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Size 20 cm<br />\r\n&bull; Maximum power 160 W<br />\r\n&bull; Nominal input power 50 W<br />\r\n&bull; Frequency response DEEP Bass Mode: 20 - 200 Hz<br />\r\n&bull; DYNAMIC Bass Mode:&nbsp; 40 - 160<br />\r\n&bull; Sensitivity DEEP Bass Mode: 95 dB<br />\r\n&bull; DYNAMIC Bass Mode: 100 dB<br />\r\n&bull; Woofer material Aluminum<br />\r\n&bull; Voice Coil type Copper Round Wire 4-Layer<br />\r\n&bull; Voice Coil bobbin type Glass Imide<br />\r\n&bull; Lowest resonance frequency 32 Hz</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Magnets Strontium</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer TS-WX130DA car Underseat Subwoofer<br />\r\n&bull; Power Cable<br />\r\n&bull; Wired Remote Control<br />\r\n&bull; User Manual</p>', 'Pioneer-Car-Underseat-Subwoofer-fb_pixels.png', 2833, 'Pioneer-Car-Underseat-Subwoofer-thumbnail.png', 'Pioneer-Car-Underseat-Subwoofer-001.png', NULL, 'Pioneer-Car-Underseat-Subwoofer-002.png', NULL, NULL, '2019-04-30 17:11:42', '2019-04-30 17:11:42'),
(42, 'pioneer GM-D8701 Monoblock Amplifier', 'pioneer-gm-d8701-monoblock-amplifier', '0', NULL, 0, 'In Stock', 'Mono 1600W Class-D Car Amp, with Bass Boost Remote', '17000', 500, '5', NULL, NULL, 1, 0, 0, 0, 'GM-D8701', 'Pioneer', '0', NULL, '<p>An amplifier shouldn&rsquo;t take up too much space, especially in your car. This Class-D amp might just be what you&rsquo;re looking for. It combines a 1-Ohm stable circuit, installation flexibility and a superior high-power output.<br />\r\n<strong>BIG POWER, SMALL SIZE</strong><br />\r\nPioneer&rsquo;s new extra-efficient Class-D digital amplifiers mark a dramatic improvement in power output capability, yet are 50% smaller than the current GM-Series Class-AB amplifiers. That makes them more versatile in terms of installation as well as performance.<br />\r\n<br />\r\n<strong>IMPROVED CIRCUIT DESIGN</strong><br />\r\nTo prevent circuit shutdown, Pioneer&rsquo;s new digital amplifier circuit &ldquo;Protection Control System&rdquo; senses its internal temperature and automatically moderates input level accordingly. Stable, durable circuitry lessens the risk of high input power for the unit to achieve 1 &Omega; connection. This design enhances the flexibility to connect multiple subwoofers to a system.<br />\r\n<br />\r\n<br />\r\n<strong>VARIABLE LOW PASS FILTER</strong><br />\r\nFor extra flexibility, variable LPF make audio frequency more adjustable according to subwoofer characteristics and personal listening preferences. The GM-D8701 LPF is adjustable from 40 Hz to 240 Hz.<br />\r\n<br />\r\n<br />\r\n<strong>TURN UP THE BASS</strong><br />\r\nEvery new Pioneer Class-D amplifier has a wired bass boost remote control for optimal bass level adjustment according to listening preferences and music characteristics.<br />\r\n<br />\r\n<strong>SPEAKER LEVEL INPUTS</strong><br />\r\nWhat, you DON&rsquo;T own a Pioneer head unit? Well, we won&rsquo;t hold it against you. In fact we&rsquo;ll even help you build onto your system. The GM-D8701&rsquo;s speaker level inputs allow you to connect your OEM unit (or any unit that doesn&rsquo;t have the typical RCA-type inputs) without having to buy add-on adapters. So, the install goes faster, you save money, and you&rsquo;ve got a Pioneer amp in your vehicle.<br />\r\n<br />\r\n<br />\r\n<strong>Key features</strong><br />\r\n&bull; Number of channels Mono<br />\r\nMaximum power 1600 watts<br />\r\n&bull; Max. Wattage (4&Omega;) 600W x 1<br />\r\n&bull; Max. Wattage (2&Omega;) 1,000W x 1<br />\r\n&bull; Max. Wattage Bridged (4&Omega;)<br />\r\n&bull; Frequency Response 10Hz to 240kHz<br />\r\n&bull; Wattage RMS (4&Omega; &lt;=1% THD+N) 300W x 1<br />\r\n&bull; Wattage RMS (2&Omega; &lt;=1% THD+N) 500W x 1<br />\r\n&bull; Wattage RMS Bridged(4&Omega;)<br />\r\n&bull; Total Harmonic Distortion (1 kHz, 4&Omega;) &lt;0.05% (100Hz)<br />\r\n&bull; Signal-to-Noise ration (IHF-A Weighted) &gt;100 dB<br />\r\n&bull; RCA Outputs (Pass-Through)<br />\r\n&bull; Speaker Level Input<br />\r\n&bull; Automatic Signal Sensing &amp; Turn On Yes<br />\r\n&bull; Crossover Type Variable LPF</p>\r\n\r\n<p>&bull; Crossover Frequency 40hZ to 240Hz</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer GM-D8701 monoblock Amplifier<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual<br />\r\nOne Year Warranty</p>', 'pioneer-GM-D8701-Monoblock-Amplifier-fb_pixels.png', 891, 'pioneer-GM-D8701-Monoblock-Amplifier-thumbnail.png', 'pioneer-GM-D8701-Monoblock-Amplifier-001.png', NULL, 'pioneer-GM-D8701-Monoblock-Amplifier-002.png', NULL, NULL, '2019-04-30 17:14:42', '2019-04-30 17:14:42'),
(43, 'Pioneer GM-D9701 Monoblock Amplifier', 'pioneer-gm-d9701-monoblock-amplifier', '0', NULL, 0, 'In Stock', 'Class D Mono Amplifier with Wired Bass Boost Remote', '24000', 500, '5', NULL, NULL, 1, 0, 0, 0, 'GM-D9701', 'Pioneer', '0', NULL, '<p><em><strong>Big Power, Small Size</strong></em><br />\r\nPioneer&rsquo;s new extra-efficient Class-D digital amplifiers mark a dramatic improvement in power output capability, yet are 50% smaller than the current GM-Series Class-AB amplifiers. That makes them more versatile in terms of installation as well as performance.<br />\r\n<br />\r\n<em><strong>Improved Circuit Design</strong></em><br />\r\nTo prevent circuit shutdown, Pioneer&#39;s new digital amplifier circuit &quot;Protection Control System&quot; senses its internal temperature and automatically moderates input level accordingly. Stable, durable circuitry lessens the risk of high input power for the unit <strong>to achieve 1 &Omega; connection. This design enhances the flexibility to connect multiple subwoofers to a system.</strong><br />\r\n<br />\r\n<em><strong>Variable Low Pass Filter</strong></em><br />\r\nFor extra flexibility, a variable LPF makes audio frequency more adjustable according to subwoofer characteristics and personal listening preferences. The GM-D9701 LPF is adjustable from 40 Hz to 240 Hz.<br />\r\n<br />\r\n<em><strong>Turn Up the Bass</strong></em><br />\r\nEvery new Pioneer Class-D amplifier has a wired bass boost remote control for optimal bass level adjustment according to listening preferences and music characteristics.<br />\r\n<br />\r\n<em><strong>Speaker Level Inputs</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What, you DON&#39;T own a Pioneer head unit? Well, we won&#39;t hold it against you. In fact we&#39;ll even help you build onto your system. The GM-D9701&#39;s speaker level inputs allow you to connect your OEM unit (or any unit that doesn&#39;t have the typical RCA-type inputs) without having to buy add-on adapters. So, the install goes faster, you save money, and you&#39;ve got a Pioneer amp in your vehicle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Number of Channel&nbsp;&nbsp; Mono<br />\r\n&bull; Maximum Power Output&nbsp;&nbsp; 2,400 W<br />\r\n&bull; Continuous Power Output (1‚Ñ¶, &le; 1% THD+N)&nbsp;&nbsp; 1,200 W x 1<br />\r\n&bull; Continuous Power Output (2‚Ñ¶, &le; 1% THD+N)&nbsp;&nbsp; 800 W x 1<br />\r\n&bull; Continuous Power Output (4‚Ñ¶, &le; 1% THD+N)&nbsp;&nbsp; 500 W x 1<br />\r\n&bull; Continuous Power Output&nbsp;&nbsp; Bridged (4‚Ñ¶)<br />\r\n&bull; Frequency Response 10 Hz to 240 Hz<br />\r\n&bull; Total Harmonic Distortion (4‚Ñ¶)&nbsp; &lt; 0.5% (100 Hz)<br />\r\n&bull; Signal-to-Noise Ratio (IHF-A Weighted, at 1 kHz)&nbsp;&nbsp;&nbsp; &gt; 100 dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Dimensions (WxHxD)&nbsp; 12-3/8&quot; x 2-3/8&quot; x 7-7/8</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer GM-D9701 monoblock<br />\r\n&bull; Fittings as per Manufacturer</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; User Manual</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>One year Warranty</strong></p>', 'Pioneer-GM-D9701-Monoblock-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-D9701-Monoblock-Amplifier-thumbnail.png', 'Pioneer-GM-D9701-Monoblock-Amplifier-001.png', NULL, 'Pioneer-GM-D9701-Monoblock-Amplifier-002.png', 'Pioneer-GM-D9701-Monoblock-Amplifier-003.png', NULL, '2019-04-30 17:16:33', '2019-04-30 17:16:33'),
(44, 'Pioneer GM-A3702 2 Channel Amplifier', 'pioneer-gm-a3702-2-channel-amplifier', '0', NULL, 0, 'Out of Stock', '2-Channel Bridgeable Car Amplifier', '5999', 500, '5', NULL, NULL, 0, 0, 0, 0, 'GM-A3702', 'Pioneer', '0', NULL, '<p>Technology of the GM Series<br />\r\nFrom dramatic distinction to dramatic design, Pioneer&#39;s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br />\r\n<br />\r\nGrowing Power, Shrinking Size<br />\r\nNew Pioneer amps brilliantly integrate high-power performance superior to that of previous models in space-efficient size for flexibility of installation in various car cabins.<br />\r\n<br />\r\nAutomatic Signal Sensing and Turn-On<br />\r\nPioneer amplifiers automatically select the proper input signal mode, either RCA or speaker level. When the receiver is turned on, the amplifier automatically turns on. When connected to an OEM receiver or a receiver without RCA output and utilizing speaker level output, the amp automatically senses the input mode and powers up in sync with the receiver.<br />\r\n&nbsp;</p>\r\n\r\n<p>When connected to an OEM receiver or a receiver without RCA output using speaker wire, the amplifier is turned on at the same time as the receiver. Pioneer&#39;s amplifiers automatically detect the input signal and select RCA level or speaker level.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Number of Channels 2<br />\r\n&bull; Amplifier Class&nbsp; AB<br />\r\n&bull; Maximum Power Output&nbsp; 500W<br />\r\n&bull; Maximum Power Output at 2 ‚Ñ¶&nbsp; 250W x 2<br />\r\n&bull; Maximum Power Output at 4 ‚Ñ¶&nbsp; 170W x 2<br />\r\n&bull; Maximum Power Output - Bridged at 4 ‚Ñ¶&nbsp; 500W<br />\r\n&bull; Nominal Power (RMS) Output at 2 ‚Ñ¶&nbsp; 95W x 2<br />\r\n&bull; Nominal Power (RMS) Output at 4 ‚Ñ¶&nbsp; 60W x 2<br />\r\n&bull; Nominal Power (RMS) Output - Bridged at 4 ‚Ñ¶&nbsp; 190W x 1<br />\r\n&bull; Frequency Response&nbsp; 10Hz ~ 70kHz<br />\r\n&bull; Total Harmonic Distortion (THD) &lt;0.05 %<br />\r\n&bull; Signal-to-Noise (SN) Ratio&nbsp; &gt;95 dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Fuse Rating&nbsp; 25A</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer GM-A3702 500 watts Car Amplifier<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual<br />\r\nOne year Warranty</p>', 'Pioneer-GM-A3702-2-Channel-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-A3702-2-Channel-Amplifier-thumbnail.png', 'Pioneer-GM-A3702-2-Channel-Amplifier-001.png', NULL, 'Pioneer-GM-A3702-2-Channel-Amplifier-002.png', 'Pioneer-GM-A3702-2-Channel-Amplifier-003.png', NULL, '2019-04-30 17:18:36', '2019-04-30 17:18:36'),
(45, 'Pioneer GM-A4704 4 Channel Amplifier', 'pioneer-gm-a4704-4-channel-amplifier', '0', NULL, 0, 'In Stock', '520w 4 channels Bridgeable amplifier', '6999', 500, '5', NULL, NULL, 0, 0, 0, 0, 'GM-A4704', 'Pioneer', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<p>A combination of <strong>great design</strong> and <strong>massive power</strong>, the GM-A4704 amplifier gives you total installation freedom and no distortion. With a one-body heat sink and gain adjustment of up to 6.5V, you can turn your in-car audio experience into the sound staging environment that you&rsquo;re looking for.&nbsp;&nbsp; This<strong> 4-channel </strong>amp allows you to drive multiple speakers and sub woofers; it&rsquo;s also bridgeable to power a single sub.<br />\r\n<br />\r\n<strong>The technology of the GM Series</strong><br />\r\nFrom dramatic distinction to dramatic design, Pioneer&#39;s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br />\r\n<br />\r\n<strong>Variable HPF</strong><br />\r\nVariable HPF (high pass filter) allows for adjustable frequency from 40 Hz to 500 Hz* and greater car audio system flexibility according to sub woofer characteristics and personal listening preference.<br />\r\n<br />\r\n<strong>Growing Power, Shrinking Size</strong><br />\r\nNew Pioneer amps brilliantly integrate high-power performance superior to that of previous models in space-efficient sizes for flexibility of installation in various car cabins.<br />\r\n<br />\r\n<strong>Automatic Signal Sensing and Turn-On</strong><br />\r\nPioneer amplifiers automatically select the proper input signal mode, either RCA or speaker level. When the receiver is turned on, the amplifier automatically turns on. When connected to an OEM receiver or a receiver without RCA output and utilizing speaker level output, the amp automatically senses the input mode and powers up in sync with the receiver.</p>\r\n\r\n<p>When connected to an OEM receiver or a receiver without RCA output using speaker wire, the amplifier is turned on at the same time as the receiver. Pioneer&#39;s amplifiers automatically detect the input signal and select the RCA level or speaker level.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>Number of Channels 4</li>\r\n	<li>Amplifier Class AB</li>\r\n	<li>Maximum Power Output 520W</li>\r\n	<li>Maximum Power Output at 2 ‚Ñ¶ 130W x 4</li>\r\n	<li>Maximum Power Output at 4 ‚Ñ¶ 80W x 4</li>\r\n	<li>Maximum Power Output - Bridged at 4 ‚Ñ¶ 520W</li>\r\n	<li>Nominal Power (RMS) Output at 2 ‚Ñ¶ 65W x 4</li>\r\n	<li>Nominal Power (RMS) Output at 4 ‚Ñ¶ 40W x 4</li>\r\n	<li>Nominal Power (RMS) Output - Bridged at 4 ‚Ñ¶ 130W x 2</li>\r\n	<li>Frequency Response 10Hz ~ 70kHz (+0dB , -3dB)</li>\r\n	<li>Total Harmonic Distortion (THD) &lt;0.05% ( 10W, 1kHz)</li>\r\n	<li>Signal-to-Noise (SN) Ratio &gt; 94dB</li>\r\n	<li>Fuse Rating 30A</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Pioneer GM-A4704 520W Amplifier</li>\r\n	<li>Fittings as per manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-GM-A4704-4-Channel-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-A4704-4-Channel-Amplifier-thumbnail.png', 'Pioneer-GM-A4704-4-Channel-Amplifier-001.png', NULL, 'Pioneer-GM-A4704-4-Channel-Car-Amplifier-002.png', 'Pioneer-GM-A4704-4-Channel-Amplifier-003.png', NULL, '2019-04-30 17:20:23', '2019-04-30 17:20:23'),
(46, 'Pioneer GM-A6704 4 Channel Amplifier', 'pioneer-gm-a6704-4-channel-amplifier', '0', NULL, 0, 'In Stock', '1000w 4-Channel Bridgeable Amplifier with Bass Boost', '10000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'GM-A6704', 'Pioneer', '0', NULL, '<p><strong>The technology of the GM Series</strong><br />\r\nFrom dramatic distinction to dramatic design, Pioneer&#39;s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br />\r\n<br />\r\n<strong>Variable HPF</strong><br />\r\nVariable HPF (High Pass Filter) allows for an adjustable frequency between 40 Hz to 500 Hz* and greater car audio system flexibility according to subwoofer characteristics and personal listening preference.<br />\r\n<br />\r\n<strong>Bass Boost</strong><br />\r\nBass Boost featured in the GM-A6704 can be set to levels variably from 0 to 12 dB for optimal bass. This precise control can enhance the overall balance and impact of all sounds according to listening preference and music style.<br />\r\n<br />\r\n<strong>Growing Power, Shrinking Size</strong><br />\r\nNew Pioneer amps brilliantly integrate high-power performance superior to that of previous models in space-efficient sizes for flexibility of installation in various car cabins.<br />\r\n<br />\r\n<strong>Automatic Signal Sensing and Turn-On</strong><br />\r\nPioneer amplifiers automatically select the proper input signal mode, either RCA or speaker level. When the receiver is turned on, the amplifier automatically turns on. When connected to an OEM receiver or a receiver without RCA output and utilizing speaker level output, the amp automatically senses the input mode and powers up in sync with the receiver.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When connected to an OEM receiver or a receiver without RCA output using speaker wire the amplifier is turned on at the same time as the receiver. Pioneer&#39;s amplifiers automatically detect the input signal and select the RCA level or speaker level.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Number of Channels 4</li>\r\n	<li>Amplifier Class AB</li>\r\n	<li>Maximum Power Output 1000W</li>\r\n	<li>Maximum Power Output at 2 ‚Ñ¶ 250W x 4</li>\r\n	<li>Maximum Power Output at 4 ‚Ñ¶ 170W x 4</li>\r\n	<li>Nominal Power (RMS) Output at 2 ‚Ñ¶ 95W x 4</li>\r\n	<li>Nominal Power (RMS) Output at 4 ‚Ñ¶ 60W x 4</li>\r\n	<li>Nominal Power (RMS) Output - Bridged at 4 ‚Ñ¶ 190W x 2</li>\r\n	<li>Frequency Response 10Hz ~ 70 kHz (+0dB, -3dB)</li>\r\n	<li>Total Harmonic Distortion (THD) &lt;0.05% (10W, 1 kHz)</li>\r\n	<li>Signal-to-Noise (SN) Ratio&gt; 95dB</li>\r\n	<li>Fuse Rating 25Ax2</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>PIONEER GM-A6704 1000W 4 channel</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-GM-A6704-4-Channel-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-A6704-4-Channel-Amplifier-thumbnail.png', 'Pioneer-GM-A6704-4-Channel-Amplifier-001.png', NULL, 'Pioneer-GM-A6704-4-Channel-Amplifier-002.png', 'Pioneer-GM-A6704-4-Channel-Amplifier-003.png', NULL, '2019-04-30 17:21:52', '2019-04-30 17:21:52'),
(47, 'Pioneer GM-D8704 4 Channel Amplifier', 'pioneer-gm-d8704-4-channel-amplifier', '0', NULL, 0, 'In Stock', '1200 watts Class FD 4-Channel Bridgeable Amplifier', '16500', 500, '5', NULL, NULL, 1, 0, 0, 0, 'GM-D8704', 'Pioneer', '0', NULL, '<p>Big Power, Small Size<br />\r\nPioneer&rsquo;s new extra-efficient Class-D digital amplifiers mark a dramatic improvement in power output capability, yet are 50% smaller than the current GM-Series Class-AB amplifiers. That makes them more versatile in terms of installation as well as performance.<br />\r\n<br />\r\nImproved Circuit Design<br />\r\nTo prevent circuit shutdown, Pioneer&#39;s new digital amplifier circuit &quot;Protection Control System&quot; senses its internal temperature and automatically moderates input level accordingly. Stable, durable circuitry lessens the risk of high input power for the unit to achieve 1 &Omega; connection. This design enhances the flexibility to connect multiple subwoofers to a system.<br />\r\n<br />\r\nVariable Low Pass and High Pass Filter<br />\r\nFor extra flexibility, variable LPF and HPF make audio frequency more adjustable according to subwoofer characteristics and personal listening preferences. The GM-D8704 LPF and HPF are adjustable from 40 Hz to 500 Hz.<br />\r\n<br />\r\nSpeaker Level Inputs</p>\r\n\r\n<p>What, you DON&#39;T own a Pioneer headunit? Well, we won&#39;t hold it against you. In fact we&#39;ll even help you build onto your system. The GM-D8704&#39;s speaker level inputs allow you to connect your OEM unit (or any unit that doesn&#39;t have the typical RCA-type inputs) without having to buy add-on adapters. So, the install goes faster, you save money, and you&#39;ve got a Pioneer amp in your vehicle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong><br />\r\n&bull; Number of Channels 4/3/2<br />\r\n&bull; Maximum Power Output 1,200 W<br />\r\n&bull; Continuous Power Output (1‚Ñ¶, &le; 1% THD+N) 125 W x 4<br />\r\n&bull; Continuous Power Output (2‚Ñ¶, &le; 1% THD+N) 150 W x 4<br />\r\n&bull; Continuous Power Output (4‚Ñ¶, &le; 1% THD+N) 100 W x 4<br />\r\n&bull; Continuous Power Output Bridged (4‚Ñ¶) 300 W x 2<br />\r\n&bull; Frequency Response 10 Hz to 35 kHz<br />\r\n&bull; Total Harmonic Distortion (4‚Ñ¶) &lt; 0.05% (1 kHz)<br />\r\n&bull; Signal-to-Noise Ratio (IHF-A Weighted, at 1 kHz) &gt; 95 dB<br />\r\n&bull; Dimensions (WxHxD) 10-3/8&quot; x 2-3/8&quot; x 7-7/8&quot;<br />\r\n<br />\r\n<strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; PIONEER GM-A8704 Amplifier<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual<br />\r\n<br />\r\nOne Year Warranty</p>', 'Pioneer-GM-D8704-4-Channel-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-D8704-4-Channel-Amplifier-thumbnail.png', 'Pioneer-GM-D8704-4-Channel-Amplifier-001.png', NULL, 'Pioneer-GM-D8704-4-Channel-Amplifier-002.png', NULL, NULL, '2019-04-30 17:23:31', '2019-04-30 17:23:31');
INSERT INTO `product` (`id`, `name`, `slung`, `replaced`, `price_raw`, `offer`, `stock`, `meta`, `price`, `shipping`, `cat`, `tag`, `sub_cat`, `featured`, `trending`, `banner`, `slider`, `code`, `brand`, `full`, `iframe`, `content`, `fb_pixels`, `google_product_category`, `thumbnail`, `image_one`, `offer_banner`, `image_two`, `image_three`, `image_four`, `created_at`, `updated_at`) VALUES
(48, 'Pioneer GM-D9705 5 Channel Amplifier', 'pioneer-gm-d9705-5-channel-amplifier', '0', NULL, 0, 'In Stock', 'Class D 5-Channel Amplifier with Wired Bass Boost Remote', '25000', 500, '5', NULL, NULL, 1, 0, 0, 0, 'GM-D9705', 'Pioneer', '0', NULL, '<p><strong>The Complete Package</strong><br />\r\nPioneer&rsquo;s 5-channel amplifier produces impressive power in an all-in-one solution designed to deliver big sound without sacrificing space. Ideal for any vehicle including compact vehicles and pick-up trucks with limited real estate, the GM-D9705 also offers installation flexibility for a variety of other applications including boats and ATVs/UTVs.<br />\r\n<br />\r\n<strong>Packs a Punch</strong><br />\r\nThe 5-channel amplifier is rated at 2000 watts max with the A and B channels rated at 75 watts x 4 (RMS) and the subwoofer output rated at 600 watts at 2 (RMS). Compared to similarly priced multichannel amplifiers, the variable crossover networks on the GM-D9705 offer increased flexibility and give listeners more control. Block terminals for a cleaner installation and direct wire contact minimizing resistance.<br />\r\n<br />\r\n<strong>Variable Low Pass Filter</strong><br />\r\nFor extra flexibility, a variable LPF makes audio frequency more adjustable according to subwoofer characteristics and personal listening preferences. The GM-D9705 LPF is adjustable from 40 Hz to 240 Hz.<br />\r\n<br />\r\n<strong>Turn Up the Bass</strong><br />\r\nThe GM-D9705 also features a Bass Boost Remote for optimal bass level adjustment according to listening preferences and music characteristics.<br />\r\n<br />\r\n<strong>Speaker Level Inputs</strong><br />\r\nWhat, you DON&#39;T own a Pioneer headunit? Well, we won&#39;t hold it against you. In fact we&#39;ll even help you build onto your system. The GM-D9705&#39;s speaker level inputs allow simplify integration into existing aftermarket or factory installed (OEM) integrated entertainment systems so you can connect your OEM unit (or any unit that doesn&#39;t have the typical RCA-type inputs) without having to buy add-on adapters. So, the install goes faster, you save money, and you&#39;ve got a Pioneer amp in your vehicle.<br />\r\n<br />\r\n<strong>Variable Low Pass Filter</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For extra flexibility, a variable LPF makes audio frequency more adjustable according to subwoofer characteristics and personal listening preferences.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Number of Channels<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5<br />\r\n&bull; Amplifier Class<br />\r\nClass FD<br />\r\n&bull; Maximum Power Output<br />\r\n2000W<br />\r\n&bull; Maximum Power Output at 1 ‚Ñ¶<br />\r\n-<br />\r\n&bull; Maximum Power Output at 2 ‚Ñ¶<br />\r\n200W x 4 (A/B), 1200W (SUB)<br />\r\n&bull; Maximum Power Output at 4 ‚Ñ¶<br />\r\n150W x 4 (A/B), 700W (SUB)<br />\r\n&bull; Maximum Power Output - Bridged at 4 ‚Ñ¶<br />\r\n400W x 2 (A/B)<br />\r\n&bull; Nominal Power (RMS) Output at 1 ‚Ñ¶<br />\r\n-<br />\r\n&bull; Nominal Power (RMS) Output at 2 ‚Ñ¶<br />\r\n100W x4 (A/B), 600W (SUB)<br />\r\n&bull; Nominal Power (RMS) Output at 4 ‚Ñ¶<br />\r\n75W x 4 (A/B), 350W (SUB)<br />\r\n&bull; Nominal Power (RMS) Output - Bridged at 4 ‚Ñ¶<br />\r\n200W x 2 (A/B)<br />\r\n&bull; Frequency Response<br />\r\nA/B CH: 10Hz ~ 50 kHz (+0dB, -3dB) / SUB CH: 10Hz ~ 500Hz (+0dB, -3dB)<br />\r\n&bull; Total Harmonic Distortion (THD)<br />\r\nA/B CH: &lt;0.05% (1 kHz) / SUB CH: &lt;0.05% (100Hz)<br />\r\n&bull; Signal-to-Noise (SN) Ratio<br />\r\nÔÉò 94dB<br />\r\n&bull; Fuse Rating<br />\r\n30A x 3<br />\r\n<br />\r\n<strong>What&rsquo;s in the Box?</strong><br />\r\n<br />\r\n&bull; Pioneer GM-D96705 Amplifier<br />\r\n&bull; Fittings as per Manufacturer<br />\r\n&bull; User Manual<br />\r\n<strong>One year Warranty</strong></p>', 'Pioneer-GM-D9705-5-Channel-Amplifier-fb_pixels.png', 891, 'Pioneer-GM-D9705-5-Channel-Amplifier-thumbnail.png', 'Pioneer-GM-D9705-5-Channel-Amplifier-001.png', NULL, 'Pioneer-GM-D9605-5-Channel-Amplifier-002.png', 'Pioneer-GM-D9705-5-Channel-Amplifier-003.png', NULL, '2019-04-30 17:25:31', '2019-04-30 17:25:31'),
(49, 'Pioneer TS-S20 Car Tweeters', 'pioneer-ts-s20-car-tweeters', '0', NULL, 0, 'In Stock', '¬æ inch car audio high power component dome tweeters (pair)', '4500', 500, '3', NULL, NULL, 1, 0, 0, 0, 'TS-S20', 'Pioneer', '0', NULL, '<p><strong>Key features</strong><br />\r\n<br />\r\n&bull; Car Audio 3/4-inch Component Tweeter with Crossover<br />\r\n&bull; Peak Power Handling: 400 watts per pair / 200 watts each<br />\r\n&bull; RMS Power Handling: 100 watts per pair / 50 watts each<br />\r\n&bull; Frequency Response:&nbsp;&nbsp; 3 kHz a 26 kHz<br />\r\n&bull; Impedance: 8-ohms<br />\r\n&bull; Sensitivity: 92 dB<br />\r\n&bull; PPS Film Dome Diaphragm<br />\r\n&bull; Neodymium Magnet</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Top Dash Holder</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Pioneer TS-S20 Tweeters (pair)<br />\r\n&bull; User Manual<br />\r\n&bull; Two capacitors<br />\r\n&bull; Mounting Holders</p>', '816-fb_pixels.png', 895, 'Pioneer-¬†TS-S20-Car-Tweeters-thumbnail.png', 'Pioneer-¬†TS-S20-Car-Tweeters-001.png', NULL, 'PIONEER--TS-S20-CAR-TWEETERS-002.jpg', NULL, NULL, '2019-04-30 17:27:19', '2019-04-30 17:27:19'),
(50, 'Pioneer TS-B350PRO Car Bullet Tweeter', 'pioneer-ts-b350pro-car-bullet-tweeter', '0', NULL, 0, 'In Stock', '3-1/2\" High Efficiency PRO Series Bullet Car Tweeters', '5500', 500, '3', NULL, NULL, 0, 0, 0, 0, 'TS-B350PRO', 'Pioneer', '0', NULL, '<p><strong>Key features</strong><br />\r\n&bull; Size 8.7 cm<br />\r\n&bull; Maximum Music Power 250 W<br />\r\n&bull; Nominal Music Power 100 W<br />\r\n&bull; Frequency Response 3,500 Hz to 27 kHz<br />\r\n&bull; Impedance 4 &Omega;<br />\r\n&bull; Mounting Depth 44 mm<br />\r\n&bull; Cut-Out Dimensions &oslash;75 mm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Sensitivity 100 dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Pioneer TS-B350PRO TWEETERS (PAIR)<br />\r\n&bull; User Manual</p>', 'Pioneer-TS-B350PRO-Car-Bullet-Tweeter-fb_pixels.png', 895, 'Pioneer-TS-B350PRO-Car-Bullet-Tweeter-thumbnail.png', 'Pioneer-TS-B350PRO-Car-Bullet-Tweeter-001.png', NULL, 'PIONEER-TS-B350PRO-CAR-BULLET-TWEETERS-002.jpg', 'Pioneer-TS-B350PRO-Car-Bullet-Tweeter-003.png', NULL, '2019-04-30 17:30:53', '2019-04-30 17:30:53'),
(51, 'Pioneer TS-B400PRO Car Audio Tweeters', 'pioneer-ts-b400pro-car-audio-tweeters', '0', NULL, 0, 'In Stock', 'Pro Series Car Tweeter 4\" 500W Bullet Tweeter', '6000', 500, '3', NULL, NULL, 0, 0, 0, 0, 'TS-B400PRO', 'Pioneer', '0', NULL, '<ul>\r\n	<li>\r\n	<p>The Pioneer P.R.O. series<strong>&nbsp;</strong>TS-B400PRO<strong>&nbsp;bullet tweeters </strong>feature aluminum die-cast chassis with titanium diaphragms backed by aggressive magnets and motor assemblies to produce a wide range of crisp, loud, and clear frequencies with up to <strong>500 watts </strong>of maximum power handling.<br />\r\n	&nbsp;</p>\r\n	<strong>Key Features</strong>\r\n\r\n	<ul>\r\n		<li>4&quot; PRO Series Car Tweeters</li>\r\n		<li>Power handling o Peak: 500 watts&nbsp;&nbsp;&nbsp;&nbsp; o RMS: 200 watts</li>\r\n		<li>Titanium tweeter construction</li>\r\n		<li>Aluminum die-cast chassis</li>\r\n		<li>4 ohms impedance</li>\r\n		<li>High-temperature voice coil</li>\r\n		<li>In-line crossover filter</li>\r\n		<li>Aggressive magnet structure</li>\r\n		<li>Surface mountable design</li>\r\n		<li>Sensitivity: 106dB</li>\r\n		<li>Frequency response: 3,500-27,000 Hz</li>\r\n		<li>Top-mount depth: 2-5/8&quot;</li>\r\n	</ul>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Pioneer Ts-B400Pro Tweeter</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-TS-B400PRO-Car-Audio-Tweeters-fb_pixels.png', 895, 'Pioneer-TS-B400PRO-Car-Audio-Tweeters-thumbnail.png', 'Pioneer-TS-B400PRO-Car-Audio-Tweeters-001.png', NULL, 'PIONEER-TS-B400PRO-CAR-AUDIO-TWEETERS-002.jpg', 'Pioneer-TS-B400PRO-Car-Audio-Tweeters-003.png', NULL, '2019-04-30 17:32:33', '2019-04-30 17:32:33'),
(52, 'Sony CDX-G1201U Car Stereo', 'sony-cdx-g1201u-car-stereo', '0', NULL, 0, 'In Stock', 'Car Radio with USB,AUX Input, CD Player, Blue key Illumination.', '7500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'CDX-G1201U', 'Sony', '0', NULL, '<p>Sony <strong>CDX-G1201U </strong>Car Stereo is an excellent choice for any car. Play your favorite tunes from CDs, Android Phone, MP3 Player, and even tune your preferred radio station.<br />\r\n&nbsp;</p>\r\n\r\n<p>It&#39;s Digital Clarity Tuner offers improved reception while the Dynamic Reality Amp and Mega Bass mean your music is always at top quality.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>2V 2 pre-out</li>\r\n	<li>10- band Equalizer</li>\r\n	<li>Extra Bass</li>\r\n	<li>Steering wheel control Compatible</li>\r\n	<li>Detachable face panel for Security purposes</li>\r\n	<li>Power output 55W*4</li>\r\n	<li>Blue Color Key Illumination</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony CDX-G1201U</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>Face case</li>\r\n	<li>Remote Control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>', 'Sony-CDX-G1201U-Car-Stereo-fb_pixels.png', 505766, 'Sony-CDX-G1201U-Car-Stereo-thumbnail.png', 'Sony-CDX-G1201U-Car-Stereo-001.png', NULL, 'Sony-CDX-G1201U-(Blue-key-illumination)-Car-Stereo-002.png', 'Sony-CDX-G1201U-Car-Stereo-003.png', NULL, '2019-04-30 18:04:15', '2019-04-30 18:04:15'),
(53, 'Sony Car Radio CDX-G1200U', 'sony-car-radio-cdx-g1200u', '0', NULL, 0, 'In Stock', 'Car stereo with CD Player, USB , AUX Input, FM radio & red key illumination', '7500', 500, '1', NULL, NULL, 1, 0, 0, 0, 'CDX-G1200U', 'Sony', '0', NULL, '<p>The Sony <strong>CDX-G1200U</strong> is a universal one din Radio that fits in most vehicles.</p>\r\n\r\n<p>This radio lets you enjoy <strong>powerful sound</strong> on the road due to its 55W*4 Inbuilt amplifier.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The <strong>EXTRA BASS</strong> Feature enhances the beats in your music while the 10- band equalizer makes it easy for you to customize the sound to your liking.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>2V 2 pre-out</li>\r\n	<li>10- band Equalizer</li>\r\n	<li>Extra Bass</li>\r\n	<li>Steering wheel control Compatible</li>\r\n	<li>Detachable face panel for Security purposes</li>\r\n	<li>Power output 55W*4</li>\r\n	<li>Red Color Key Illumination</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the box? </strong></p>\r\n\r\n<ul>\r\n	<li>Sony CDX-G1200U</li>\r\n	<li>Face Case</li>\r\n	<li>Power Cable</li>\r\n	<li>User manual</li>\r\n	<li>Remote control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Sony-Car-Radio-CDX-G1200U-fb_pixels.png', 505766, 'Sony-Car-Radio-CDX-G1200U-thumbnail.png', 'Sony-Car-Radio-CDX-G1200U-001.png', NULL, 'SONY-CAR-RADIO-CDX-G1200U-(Red-key-illumination)-Car-Stereo-002.jpg', 'Sony-Car-Radio-CDX-G1200U-003.png', NULL, '2019-04-30 19:55:42', '2019-04-30 19:55:42'),
(54, 'Sony  Car Stereo with Bluetooth.', 'sony-car-stereo-with-bluetooth', '0', NULL, 0, 'In Stock', 'MEX-N4300BT radio with FM Radio receiver with Bluetooth, CD  player, USB, AUX IN.', '11000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'MEX-N4300BT', 'Sony', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<p>The Sony<strong> MEX-N4300BT</strong> Media receiver &amp; CD player with Bluetooth helps you keep in touch while on the road with its countless features.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This car radio supports&nbsp;<strong>dual Bluetooth</strong> connectivity allowing you to wirelessly connect your first phone to play music, get directions, and communicate with contacts. You also have the bonus of being able to add a second phone allowing you to make hands free calls while on the move.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM</li>\r\n	<li>CD Player</li>\r\n	<li>Dual Bluetooth ( Pair 2 phones Simultaneously)</li>\r\n	<li>Front USB &amp; AUX Input</li>\r\n	<li>10 Band Equalizer</li>\r\n	<li>Bluetooth hands-free calling and Audio Streaming</li>\r\n	<li>High and Low pass Filter</li>\r\n	<li>Mega Bass Boost</li>\r\n	<li>Siri Eyes Free for iPhone</li>\r\n	<li>Power output 55W*4</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the box? </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony MEX-N4300BT</li>\r\n	<li>Power Cables</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Sony--Car-Stereo-with-Bluetooth.-fb_pixels.png', 505766, 'Sony--Car-Stereo-with-Bluetooth.-thumbnail.png', 'Sony--Car-Stereo-with-Bluetooth.-001.png', NULL, 'Sony--Car-Stereo-with-Bluetooth.-002.png', 'Sony--Car-Stereo-with-Bluetooth.-003.png', NULL, '2019-04-30 19:57:30', '2019-04-30 19:57:30'),
(55, 'Sony WX-810UI Double din Car Radio', 'sony-wx-810ui-double-din-car-radio', '56', NULL, 0, 'Out of Stock', 'Car Stereo with USB,CD Player, AUX IN', '12000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'WX-810UI', 'Sony', '0', NULL, 'Sony&nbsp;<b>WX-810UI</b> Is a double din non-touch screen car stereo that fits most dashboard openings.<br><br>This radio gives you various options for entertainment; you can choose to tune in to your favorite radio station, Play music through CD, USB, or Auxilliary Input, keeping you entertained on the road.<br><br><b>Key Features<br></b><ul><li><b></b>Double din Radio</li><li>FM Radio</li><li>CD Player</li><li>Front USB &amp; AUX Input</li><li>Extra Bass</li><li>10- band Equalizer</li><li>3 Pre-out</li><li>Power Output 55W*4</li></ul><b>What\'s in the Box?<br></b><ul><li>Sony WX-810UI</li><li>Power Cable</li><li>User Manual</li><li>Remote Control<b></b></li></ul><b>One Year Warranty</b><br><br><br>', NULL, 505766, 'Sony-WX-810UI-Double-din-Car-Radio-thumbnail.png', 'Sony-WX-810UI-Double-din-Car-Radio-001.png', NULL, 'SONY-WX-810UI-Double-din-Car-Radio-002.jpg', 'Sony-WX-810UI-Double-din-Car-Radio-003.png', NULL, '2019-04-30 19:59:46', '2019-04-30 19:59:46'),
(56, 'Sony WX-920BT Radio Receiver with BT', 'sony-wx-920bt-radio-receiver-with-bt', '0', NULL, 0, 'In Stock', 'Double-DIN CD Receiver Bluetooth USB AUX IN', '13500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'WX-920BT', 'Sony', '0', NULL, '<p>Sony&#39;s<strong> WX-920BT </strong>CD car Stereo has an impressive list of features, with Bluetooth topping the list. You can pair up to two mobile phones Simultaneously to make &amp; receive calls or play music.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Do you have a <strong>Siri-compatible</strong> iPhone&reg;? You can make calls or play music by making commands, this adds a great level of convenience and capability to your car&#39;s audio system.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM Radio</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX Input</li>\r\n	<li>Dual Bluetooth</li>\r\n	<li>Multicolor display</li>\r\n	<li>10 Band Equalizer</li>\r\n	<li>Power output 55W*4</li>\r\n	<li>Siri Eyes for iPhone</li>\r\n	<li>Voice control for Android</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony WX-920BT</li>\r\n	<li>Power Cable</li>\r\n	<li>Remote Control&nbsp;</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Sony-WX-920BT-Radio-Receiver-with-BT-fb_pixels.png', 505766, 'Sony-WX-920BT-Radio-Receiver-with-BT-thumbnail.png', 'Sony-WX-920BT-Radio-Receiver-with-BT-001.png', NULL, 'SONY-WX-920BT-Radio-Receiver-with-Bluetooth-002.jpg', 'Sony-WX-920BT-Radio-Receiver-with-BT-003.png', NULL, '2019-04-30 20:01:32', '2019-04-30 20:01:32'),
(57, 'SONY XAV-W651BT Car Stereo front USB', 'sony-xav-w651bt-car-stereo-front-usb', '293', NULL, 0, 'Out of Stock', 'Receiver with Bluetooth DVD USB Reverse camera input', '19500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XAV-W651BT', 'Sony', '0', NULL, 'Sony<b> XAV-W651BT </b>is a car radio with a 6.2-inch resistive touch screen display. This Radio has modern features such as Bluetooth, DVD player,<b> Reverse Camera Input</b> &amp; front USB.<br><br>The <b>Dual Bluetooth</b> Connectivity feature allows pairing up two mobile phones making it easy to stream music &amp; make and receive calls at the same time.<br><br>Also, you don\'t have to reach out to your manual to operate this radio; the interface is <b>user-friendly.<br><br>Key Features<br></b><ul><li>6.2\" Touch Screen Display</li><li>FM/AM</li><li>DVD player</li><li>Front USB &amp; AUX</li><li>Bluetooth with hands free calling and Audio streaming.<br></li><li>EQ5 Advanced Internal Equalizer</li><li>Siri Eyes for iPhone</li><li>Songpal App Control for iPhone and Android</li><li>Extra Bass</li><li>Reverse camera input</li><li>3 Pre-out</li><li>Steering Wheel Control Compatible ( Adapter Required)</li><li>Siri Eyes for iPhone</li><li>Power output 55W*4</li></ul><b>What\'s in the Box?</b><br><ul><li>Sony XAV-W651BT</li><li>Power Cable</li><li>Microphone</li><li>User Manual</li><li>Remote</li></ul><b>One year Warranty</b><br><b><br><br></b>', NULL, 505766, 'SONY-XAV-W651BT-Car-Stereo-front-USB-thumbnail.png', 'SONY-XAV-W651BT-Car-Stereo-front-USB-001.png', NULL, 'SONY-XAV-W651BT-Car-Stereo-front-USB-002.jpg', 'SONY-XAV-W651BT-Car-Stereo-front-USB-003.png', NULL, '2019-04-30 20:04:15', '2019-04-30 20:04:15'),
(58, 'SONY XAV-AX100  Car Radio Receiver', 'sony-xav-ax100-car-radio-receiver', '59', NULL, 0, 'Out of Stock', '6.4 inch Car Radio with apple car play android auto', '32000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XAV-AX100', 'Sony', '0', NULL, 'The Sony<b> XAV-AX100 </b>Is a car radio system that features Apple car Play &amp; Android Auto that enables you to control most of your smartphone Applications on the go.<br><br>Control your favorite features by voice commands courtesy of Siri\'s<b> eyes</b>&nbsp;(works with apple car play)&amp; <b>Voice Control(</b>works with Android Auto).<br><br>You don\'t need to worry about missing directions, thanks to<b> Navigation </b>with Apple car Play or Android Auto.<br><b>Note: This stereo doesn\'t play CDs.<br></b><br><b>Key Features<br></b><ul><li>6.4\" Touch Screen Display</li><li>FM/AM</li><li>Bluetooth with hands Free calling &amp; Audio Streaming.<br></li><li>Apple Car Play</li><li>Android Auto</li><li>Navigate with Apple car Play and Android Auto</li><li>Siri eyes &amp; Voice Control</li><li>10 Band Equalizer</li><li>3 Pre-out</li><li>Rear view camera ready</li><li>Bluetooth</li><li>Power output 55W*4</li><li>Steering wheel control compatible (Adapter required)<br></li></ul><b>What\'s in the Box?<br></b><ul><li>Sony XAV-AX100</li><li>Power Cable</li><li>User manual</li><li>Microphone</li></ul><b>One Year Warranty</b><br><br>', NULL, 505766, 'SONY-XAV-AX100--Car-Radio-Receiver-thumbnail.png', 'SONY-XAV-AX100--Car-Radio-Receiver-001.png', NULL, 'SONY-XAV-AX100--Car-Radio-Receiver-002.png', 'SONY-XAV-AX100--Car-Radio-Receiver-003.png', NULL, '2019-05-01 04:26:42', '2019-05-01 04:26:42'),
(59, 'SONY XAV-AX200 Car Radio with 3 camer', 'sony-xav-ax200-car-radio-with-3-camer', '0', NULL, 0, 'In Stock', 'Car Stereo with Apple Car Play and Android Auto & DVD Player.', '38000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XAV-AX200', 'Sony', '0', NULL, '<p>Enjoy your drives<strong>&nbsp;</strong>with Sonys<strong> XAV-AX200 </strong>Car Stereo with Apple Car Play and Android Auto. Connect your mobile phone to the Stereo to enjoy an endless list of compatible features.<br />\r\n<br />\r\n<strong>Apple Car Play</strong> and <strong>Android Auto</strong>&nbsp;Enable you to play music, access your messages, and use navigation maps just by connecting your phone through USB or Bluetooth.&nbsp;<br />\r\n<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.4 &quot; Touch Screen Display</li>\r\n	<li>FM/AM</li>\r\n	<li>DVD/ CD Player</li>\r\n	<li>Apple car Play</li>\r\n	<li>Android Auto</li>\r\n	<li>Bluetooth with hands free calling &amp; Audio streaming</li>\r\n	<li>Navigation with apple car Play &amp; Android Auto</li>\r\n	<li>3 Camera input</li>\r\n	<li>10 Band Equalizer</li>\r\n	<li>3 pre-out</li>\r\n	<li>Extra Bass&nbsp;</li>\r\n	<li>Power Output 55W*4</li>\r\n	<li>Steering wheel control compatible. (Adapter required)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony XAV-AX200</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>Remote control</li>\r\n	<li>Microphone</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty&nbsp;</strong><br />\r\n<br />\r\n&nbsp;</p>', 'SONY-XAV-AX200-Car-Radio-with-3-camer-fb_pixels.png', 505766, 'SONY-XAV-AX200-Car-Radio-with-3-camer-thumbnail.png', 'SONY-XAV-AX200-Car-Radio-with-3-camer-001.png', NULL, 'SONY-XAV-AX200-Car-Radio-with-Bluetooth-002.jpg', 'SONY-XAV-AX200-Car-Radio-with-3-camer-003.png', NULL, '2019-05-01 04:28:14', '2019-05-01 04:28:14'),
(60, 'SONY XAV-AX5000 Car Stereo system', 'sony-xav-ax5000-car-stereo-system', '0', NULL, 0, 'In Stock', '6.95\" Car Play /Android Auto Media Receiver with BLUETOOTH', '35000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XAV-AX5000', 'Sony', '0', NULL, '<p>Sony <strong>XAV-AX5000</strong> is a car stereo system with a 6.95&quot; Touch screen display.<br />\r\nThis Radio enables you to access music, messages &amp; maps without getting your hands off the wheel using apple <strong>car Play</strong> or <strong>Android Auto</strong>.<br />\r\n<br />\r\nBuilt-in Dual Bluetooth means you can connect up to 2 devices simultaneously to Make or receive calls hands-Free.<br />\r\n<br />\r\nThe Built-in 55W*4 Amplifier Delivers quality sound, which you can customize using the 10- bands internal Equalizer.<br />\r\n<br />\r\nKey Features</p>\r\n\r\n<ul>\r\n	<li>6.95&quot; Touch Screen Display</li>\r\n	<li>FM/AM</li>\r\n	<li>Bluetooth with hands Free Calling and Audio Streaming.</li>\r\n	<li>Dual USB ports</li>\r\n	<li>Backup camera ready</li>\r\n	<li>10 Band Equalizer</li>\r\n	<li>Android AUTO</li>\r\n	<li>Apple Car Play</li>\r\n	<li>Navigate with Android Auto and Apple car Play</li>\r\n	<li>Power output 55W*4</li>\r\n	<li>Steering wheel Controls compatible (Adapter required)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony XAV-AX5000</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>Microphone</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong><br />\r\n<br />\r\n<br />\r\n&nbsp;</p>', 'SONY-XAV-AX5000-Car-Stereo-system-fb_pixels.png', 505766, 'SONY-XAV-AX5000-Car-Stereo-system-thumbnail.png', 'SONY-XAV-AX5000-Car-Stereo-system-001.png', NULL, 'SONY-XAV-AX5000-Car-Stereo-system-002.png', 'SONY-XAV-AX5000-Car-Stereo-system-003.png', NULL, '2019-05-01 04:29:47', '2019-05-01 04:29:47'),
