(62, 'SONY XS-FB161E Door Speakers', 'sony-xs-fb161e-door-speakers', '0', NULL, 0, 'In Stock', '16cm (6.5‚Äù) 2 way 260watts Dual Cone Speaker', '2800', 500, '2', NULL, NULL, 0, 0, 0, 0, 'XS-FB161E', 'Sony', '0', NULL, '<p>Step up to bigger, better on-road sound with these 16cm dual cone speakers, featuring a carbon fibre matrix woofer for punchy, dynamic bass. Simple yet efficient, the dual cone speaker design produces rich, full range audio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features </strong><br />\r\n&bull; Size 6.5 Inches<br />\r\n&bull; Max power output 260 watts<br />\r\n&bull; Nominal power output 45 watts<br />\r\n&bull; HOP aramid carbon fibre matrix woofer for rich bass and clear vocals<br />\r\n&bull; Dual cone speaker design<br />\r\n&bull; Distortion free audio with high power handling<br />\r\n&bull; Frequency range of 45&ndash;20,000Hz</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Easy installation for a wide variety of vehicles</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Sony XS-FB161E speakers (pair)<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'SONY-XS-FB161E-Door-Speakers-fb_pixels.png', 895, 'SONY-XS-FB161E-Door-Speakers-thumbnail.png', 'SONY-XS-FB161E-Door-Speakers-001.png', NULL, 'SONY-XS-FB161E-DOOR-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 04:33:55', '2019-05-01 04:33:55'),
(63, 'SONY XS-FB163E Door Speakers', 'sony-xs-fb163e-door-speakers', '0', NULL, 0, 'In Stock', '6inch 260watts 3 way car speakers', '2800', 500, '2', NULL, NULL, 0, 0, 0, 0, 'XS-FB163E', 'Sony', '0', NULL, '<p>Take Your On-Road Audio Further With These 3-Way Speakers. A Woofer, Tweeter, and Super Tweeter All Work Together For Full-Frequency Audio That Fills The Whole Car, And Sound Stays Clear Even At Loud Volumes With Distortion Free Audio With High Power Handling</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Size16cm or 6&quot; &frac12;<br />\r\n<br />\r\n&bull; Peak Power 260w<br />\r\n<br />\r\n&bull; Rms Power 45w<br />\r\n<br />\r\n&bull; Rated Power 40w<br />\r\n<br />\r\n&bull; Woofer Magnet Material Ferrite<br />\r\n<br />\r\n&bull; Woofer Diaphragm Material Rubber Coated Cloth Surround<br />\r\n<br />\r\n<strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Sony XS-FB163E speaker(pair)<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'SONY-XS-FB163E-Door-Speakers-fb_pixels.png', 895, 'SONY-XS-FB163E-Door-Speakers-thumbnail.png', 'SONY-XS-FB163E-Door-Speakers-001.png', NULL, 'SONY-XS-FB163E-DOOR-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 04:35:30', '2019-05-01 04:35:30'),
(64, 'SONY XS-XB1651 6 Inch Door Speakers', 'sony-xs-xb1651-6-inch-door-speakers', '0', NULL, 0, 'In Stock', '350 Watts 16 cm (6‚Äù 1/2) 5-Way Coaxial Car Speakers', '7000', 500, '2', NULL, NULL, 1, 0, 0, 0, 'XS-XB1651', 'Sony', '0', NULL, '<ul>\r\n	<li>\r\n	<p>Make your system roar with the<strong> powerful</strong> XS-XB1651<strong> 5-way</strong> coaxial speakers. Experience clear highs with two super tweeters and <strong>deep bass</strong> with the 2nd generation HOP aramid carbon fiber matrix woofer.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features </strong>\r\n\r\n	<ul>\r\n		<li>2nd generation HOP aramid carbon fiber matrix woofer</li>\r\n		<li>PEI Tweeter and Mid Range diaphragm for clear highs</li>\r\n		<li>Two super tweeters for high-frequency extension</li>\r\n		<li>350W peak, 60W rated power handling</li>\r\n		<li>Distortion is minimized by a rubber surround with stroke stabilizer</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the box?</strong>\r\n\r\n	<ul>\r\n		<li>Sony XS-XB1651 speakers (pair)</li>\r\n		<li>Power Cables</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'SONY-XS-XB1651-6-Inch-Door-Speakers-fb_pixels.png', 895, 'SONY-XS-XB1651-6-Inch-Door-Speakers-thumbnail.png', 'SONY-XS-XB1651-6-Inch-Door-Speakers-001.png', NULL, 'SONY-XS-XB1651-6-Inch-Door-Speakers-002.png', 'SONY-XS-XB1651-6-Inch-Door-Speakers-003.png', NULL, '2019-05-01 04:36:42', '2019-05-01 04:36:42'),
(65, 'SONY XS-XB1621C Component Speakers', 'sony-xs-xb1621c-component-speakers', '0', NULL, 0, 'In Stock', '16cm (6‚Äù 1/2) 2-Way Sony Component Speakers', '8000', 500, '2', NULL, NULL, 1, 0, 0, 0, 'XS-XB1621C', 'Sony', '0', NULL, '<p>Enjoy dynamic music and enhanced stereo imaging with the XS-XB1621C component speakers. The 2nd generation HOP ACFM woofer gives deep, punchy bass and the silk soft dome tweeter offers smooth highs. Experience clear, dynamic sound with high power handling.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; 2nd gen HOP ACFM woofer optimized for Sony EXTRABASS&trade; car receiver<br />\r\n&bull; Silk soft dome tweeter<br />\r\n&bull; 350W peak, 60W rated power handling<br />\r\n&bull; Crossover network box for clear mid-to-high frequency sound</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Distortion is minimized by a rubber surround with stroke stabilizer</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Sony XS-XB1621C Component Speakers ( pair)<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'SONY-XS-XB1621C-Component-Speakers-fb_pixels.png', 895, 'SONY-XS-XB1621C-Component-Speakers-thumbnail.png', 'SONY-XS-XB1621C-Component-Speakers-001.png', NULL, 'SONY-XS-XB1621C-COMPONENT-SPEAKERS-002.jpg', 'SONY-XS-XB1621C-Component-Speakers-003.png', NULL, '2019-05-01 04:37:55', '2019-05-01 04:37:55'),
(66, 'SONY XS-GTF6939 Oval Speakers', 'sony-xs-gtf6939-oval-speakers', '0', NULL, 0, 'In Stock', '420watts 6*9 inch Oval Car Speakers', '4500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'XS-GTF6939', 'Sony', '0', NULL, '<p>Blast out your favorite songs with the <strong>XS-GTF6939</strong> 420 Watts 3-way speakers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Designed to produce <strong>punchy bass,</strong> and high-power handling to pump up the volume without affecting sound quality.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>6&quot; by 9 &quot;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Max power output of 420 Watts</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>RMS Power 60 Watts</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>3 -Way Speakers</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>With Extra Bass</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<ul>\r\n	<li>SONY XS-GTF6939 Oval Speakers</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Power Cable</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>User Manual</li>\r\n</ul>', 'SONY-XS-GTF6939-Oval-Speakers-fb_pixels.png', 895, 'SONY-XS-GTF6939-Oval-Speakers-thumbnail.png', 'SONY-XS-GTF6939-Oval-Speakers-001.png', NULL, 'SONY-XS-GTF6939-Oval-Speakers-002.png', NULL, NULL, '2019-05-01 04:39:22', '2019-05-01 04:39:22'),
(67, 'SONY XS-NW1200 Car Subwoofer', 'sony-xs-nw1200-car-subwoofer', '0', NULL, 0, 'In Stock', '30 cm (12) Sony Subwoofer 1800 Watts.', '5500', 500, '4', NULL, NULL, 1, 0, 0, 0, 'XS-NW1200', 'Sony', '0', NULL, '<p>Setting out on a drive is now more convenient that ever. Thanks to the amazing capabilities of high-end speakers and subwoofers that bring every frequency to life. The Sony Xplod XS NW1200 Car Subwoofer can be a great addition to your car. With a powerful sound output you can now play thumping bass music and impress everyone seated in your car. Now, get a party wherever you are with this amazing woofer. It is available at an incredibly affordable price .The Sony Xplod XS NW1200 Car Subwoofer measures 30 cm.<br />\r\n<br />\r\nThis is just the appropriate size to fit into your car audio setup without compromising space or quality of the output. The body is built magnetic ferrite and a rubber edge. The black color of the subwoofer makes it absolutely compatible with your car interiors and retains that sleek and modern styling of your in-car entertainment system. Installation and use is as convenient as it gets, thanks to the compact size. The cone of the speaker is beautifully designed. Even if your car has interiors in a lighter shade, the speakers can fit right in with a contrast effect.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Maximum power Output 1800 watts<br />\r\n&bull; 12 inches Bass&nbsp; Speaker size<br />\r\n&bull; PP + mica cone for crisp and powerful bass<br />\r\n&bull; Enjoy high power-handling capabilities<br />\r\n&bull; Durable heat-resistant voice coil</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Acoustic distortion is minimized by a rubber surround</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; SONY XS-NW1200 Bass Speaker<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'SONY-XS-NW1200-Car-Subwoofer-fb_pixels.png', 2833, 'SONY-XS-NW1200-Car-Subwoofer-thumbnail.png', 'SONY-XS-NW1200-Car-Subwoofer-001.png', NULL, 'SONY-XS-NW1200-Car-Subwoofer-002.png', 'SONY-XS-NW1200-Car-Subwoofer-003.png', NULL, '2019-05-01 04:41:13', '2019-05-01 04:41:13'),
(68, 'SONY XS-GTR121LD Car Subwoofer', 'sony-xs-gtr121ld-car-subwoofer', '0', NULL, 0, 'In Stock', '2000 watts 12 inch Car Bass Speaker', '8500', 500, '4', NULL, NULL, 0, 0, 0, 0, 'XS-GTR121LD', 'Sony', '0', NULL, '<p>Experience more intense and deep bass with polypropylene cone 30 cm (12 &ldquo;). Enjoy high maximum output power of 2000W and double coil. A cone woofer with depressions adds additional rigidity for low bass and accurate. Listen punchy bass with a frequency range of 30-1000 Hz. High quality materials ensure a clear and powerful sound</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Experience louder, deeper bass with a 30cm (12&rdquo;) polypropylene cone<br />\r\n&bull; Enjoy high 2000W maximum output power and double coil<br />\r\n&bull; A dimpled woofer cone adds extra rigidity for low and accurate bass tones<br />\r\n&bull; Hear resounding lows with a 30&ndash;1000Hz frequency range</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Premium materials ensure clear, powerful sound</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; SONY XS-GTR121LD Car Subwoofer<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'SONY-XS-GTR121LD-Car-Subwoofer-fb_pixels.png', 2833, 'SONY-XS-GTR121LD-Car-Subwoofer-thumbnail.png', 'SONY-XS-GTR121LD-Car-Subwoofer-001.png', NULL, 'SONY-XS-GTR121LD-CAR-SUBWOOFER-002.jpg', 'SONY-XS-GTR121LD-Car-Subwoofer-003.png', NULL, '2019-05-01 04:42:32', '2019-05-01 04:42:32'),
(69, 'SONY XM-GS100 Monoblock Amplifier', 'sony-xm-gs100-monoblock-amplifier', '0', NULL, 0, 'In Stock', 'Monoblock amplifier 1100watts Monoblock', '15000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'XM-GS100', 'Sony', '0', NULL, '<p>You&#39;ll get up to 600 watts RMS of bass power with Sony&#39;s XM-GS100 mono amplifier driving your sub. For maximum reliability, this compact amp sports a hefty heatsink that shunts off the heat that&#39;s generated when the amp&#39;s working hard. The XM-GS100 will also protect your subwoofer, with a Dynamic Distortion Suppressor circuit that rounds off the corners of dangerous square waves, minimizing the destructive effects of an overdriven signal</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; mono subwoofer amplifier<br />\r\n&bull; 330 watts RMS x 1 at 4 ohms (600 watts RMS x 1 at 2 ohms)<br />\r\n&bull; Dynamic Distortion Suppressor and Active Thermal Control<br />\r\n&bull; variable low-pass filter (50-300 Hz, 12 dB/octave)<br />\r\n&bull; variable subsonic filter (6-70 Hz, 12 dB/octave)<br />\r\n&bull; variable bass boost (0-10 dB at 40Hz)<br />\r\n&bull; Class-D amplifier design<br />\r\n&bull; frequency response: 10-300 Hz<br />\r\n&bull; preamp and speaker-level inputs<br />\r\n&bull; preamp outputs</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; fuse rating: 30A x 2</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Sony XS-GS100 Car amplifier<br />\r\n&bull; Fittings per manufacturer<br />\r\n&bull; User Manual<br />\r\nOne year warranty</p>', 'SONY-XM-GS100-Monoblock-Amplifier-fb_pixels.png', 891, 'SONY-XM-GS100-Monoblock-Amplifier-thumbnail.png', 'SONY-XM-GS100-Monoblock-Amplifier-001.png', NULL, 'SONY-XM-GS100-Monoblock-Amplifier-002.jpg', 'SONY-XM-GS100-Monoblock-Amplifier-003.png', NULL, '2019-05-01 04:44:24', '2019-05-01 04:44:24'),
(70, 'SONY XM-N502 2 Channel Amplifier', 'sony-xm-n502-2-channel-amplifier', '0', NULL, 0, 'In Stock', '2-channel Bridgeable car amplifier 500 Watts', '5500', 500, '5', NULL, NULL, 1, 0, 0, 0, 'XM-N502', 'Sony', '0', NULL, '<p><strong>Key features</strong><br />\r\n&bull; XM Series 2-Channel Class AB Car Amplifier<br />\r\n&bull; RMS Power Rating:<br />\r\n4 ohms: 65 watts x 2 chan.<br />\r\n2 ohms: 85 watts x 2 chan.<br />\r\nBridged, 4 ohms: 175 watts x 1 chan.<br />\r\n&bull; Max power output:<br />\r\n150 watts x 2 chan. @ 4 ohms<br />\r\n500 watts x 1 chan. Bridged @ 4 Ohms<br />\r\n&bull; 2-channel operation<br />\r\n&bull; Variable low-pass filter (80 Hz, 18 dB/octave)<br />\r\n&bull; 14 gauge power and ground wiring is required for installation<br />\r\n&bull; Sony&#39;s Automatic Thermal Control lowers the output when necessary to prevent sudden shutdowns<br />\r\n&bull; Single sided connections provide flexible installation and multiple mounting options<br />\r\n&bull; Frequency response: 50 Hz - 50,000 Hz</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Signal-to-noise ratio: 93dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Sony XM-N502 Car amplifier 500 watts<br />\r\n&bull; Fittings as per manufacturer<br />\r\n&bull; User Manual<br />\r\nOne year warranty</p>', 'SONY-XM-N502-2-Channel-Amplifier-fb_pixels.png', 891, 'SONY-XM-N502-2-Channel-Amplifier-thumbnail.png', 'SONY-XM-N502-2-Channel-Amplifier-001.png', NULL, 'SONY-XM-N502-2-CHANNEL-BRIDGEABLE-AMPLIFIER-002.jpg', 'SONY-XM-N502-2-Channel-Amplifier-003.png', NULL, '2019-05-01 04:45:40', '2019-05-01 04:45:40'),
(71, 'SONY XM-N1004 1000 Watts Amplifier.', 'sony-xm-n1004-1000-watts-amplifier', '0', NULL, 0, 'In Stock', '4-channel car amplifier with 70 watts RMS x 4', '9000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'XM-N1004', 'Sony', '0', NULL, '<p>Bored with your vehicle&#39;s sound system? Sony&#39;s XM-N1004 4-channel amplifier will add clarity and power to your system, delivering 70 watts RMS to each of your speakers, so you&#39;ll have more fun listening to music on the road. To add some low-frequency fun, you can bridge the MX-N1004 amp into 2-channel mode and drive a couple of subwoofers with 175 watts each.<br />\r\n&nbsp;</p>\r\n\r\n<p>High- and low-pass filters help all your speakers sound their best. Sony placed all of the MX-N1004&#39;s connections and controls on the front of the amp, for a cleaner installation with easier access to adjustments. To protect the amp from overheating and shutting down, an Auto Thermal Control lowers the power output slightly during those moments of extreme, hard driving play. Sony shows its commitment to high quality by gold-plating this amp&#39;s connectors for reliable conductivity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; 4-channel car amplifier<br />\r\n&bull; 70 watts RMS x 4 at 4 ohms (85 watts RMS x 4 at 2 ohms)<br />\r\n&bull; 175 watts RMS x 2 in bridged mode (4-ohm stable in bridged mode)<br />\r\n&bull; CEA-2006 compliant<br />\r\n&bull; Class AB amp technology<br />\r\n&bull; front channels: selectable high-pass (80 Hz, 12 dB/octave) and low-pass filter (80 Hz, 18 dB/octave)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; rear channels: selectable low-pass filter (80 Hz, 18 dB/octave)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Sony XM-N1004 1000 Watts Amplifier<br />\r\n&bull; Fittings as per manufacturer<br />\r\n&bull; User Manual<br />\r\nOne year warranty</p>', 'SONY-XM-N1004-1000-Watts-Amplifier.-fb_pixels.png', 891, 'SONY-XM-N1004-1000-Watts-Amplifier.-thumbnail.png', 'SONY-XM-N1004-1000-Watts-Amplifier.-001.png', NULL, 'SONY-XM-N1004-1000-WATTS-4-CHANNEL-AMPLIFIER-002.jpg', 'SONY-XM-N1004-1000-Watts-Amplifier.-003.png', NULL, '2019-05-01 04:46:49', '2019-05-01 04:46:49'),
(72, 'SONY XM-GS4 4 Channel Car Amplifier', 'sony-xm-gs4-4-channel-car-amplifier', '0', NULL, 0, 'In Stock', 'with high-resolution audio 4-channel car amplifier', '20000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'XM-GS4', 'Sony', '0', NULL, '<p>Enjoy the subtlest nuances of studio-quality sound in higher than CD quality with High-Resolution Audio. Passion for music unites every component from signal to speaker so it feels like the artist is performing right in front of you</p>\r\n\r\n<p>Sony&#39;s XM-GS4 4-channel amplifier will drive your whole system, sending 70 watts RMS to each of your front and rear speakers. Or you can switch the amp into 2-channel mode to power a couple of subs with 160 watts RMS each. This compact amp sports a hefty heatsink that gets rid of the heat that&#39;s generated when you&#39;re pushing your system hard. The XM-GS4 also uses a cooling fan, which automatically adjusts its speed for the heat it detects, ensuring this small amplifier will always produce the power that&#39;s expected.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n<br />\r\n&bull; 4-channel car amplifier<br />\r\n&bull; 70 watts RMS x 4 at 4 ohms (80 watts RMS x 4 at 2 ohms)<br />\r\n&bull; 160 watts RMS x 2 at 4 ohms in bridged mode (4-ohm stable in bridged mode)<br />\r\n&bull; frequency response: 10-100,000 Hz<br />\r\n&bull; separate variable high- and low-pass filters for front and rear channels (50-300 Hz, 12 dB per octave)<br />\r\n&bull; separate variable subsonic filters for front and rear channels (6-70 Hz, 12 dB/octave)<br />\r\n&bull; separate bass boosts for front and rear channels (0-10 dB at 40 Hz)<br />\r\n&bull; preamp and speaker-level inputs<br />\r\n&bull; cooling fan<br />\r\n&bull; fuse rating: 30A x 2</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; 8-gauge power and ground leads recommended</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; SONY XM-GS4 700watts Amplifier<br />\r\n&bull; Fittings as per manufacturer<br />\r\n&bull; User Manual<br />\r\nOne year warranty</p>', 'SONY-XM-GS4-4-Channel-Car-Amplifier-fb_pixels.png', 891, 'SONY-XM-GS4-4-Channel-Car-Amplifier-thumbnail.png', 'SONY-XM-GS4-4-Channel-Car-Amplifier-001.png', NULL, 'SONY-XM-GS4-4-CHANNEL-CAR-AMPLIFIER-002.jpg', 'SONY-XM-GS4-4-Channel-Car-Amplifier-003.png', NULL, '2019-05-01 04:48:00', '2019-05-01 04:48:00'),
(73, 'SONY XS-H50S car Tweeters', 'sony-xs-h50s-car-tweeters', '0', NULL, 0, 'In Stock', '5cm (2‚Äù) Component Tweeter 650 watts', '4000', 500, '3', NULL, NULL, 0, 0, 0, 0, 'XS-H50S', 'Sony', '0', NULL, '<ul>\r\n	<li>\r\n	<p>Improve the mid and high-frequency sound in your car with this add-on <strong>650 Watts</strong> Sony tweeters.<br />\r\n	<br />\r\n	Notes reproduced above a 4 kHz crossover frequency improve stereo imaging at listening height, while a<strong> wide dispersion</strong> design and acoustic equalizer mean you can hear more detail in vocals and instruments than ever before.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>PEI cone tweeter</li>\r\n		<li>Wide dispersion design</li>\r\n		<li>650W peak, 65W rated power handling</li>\r\n		<li>Optimally designed acoustic equalizer</li>\r\n		<li>Detachable grills</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Sony XS-H50S car Tweeters-pair</li>\r\n		<li>Power Cable</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'SONY-XS-H50S-car-Tweeters-fb_pixels.png', 895, 'SONY-XS-H50S-car-Tweeters-thumbnail.png', 'SONY-XS-H50S-car-Tweeters-001.png', NULL, 'SONY-XS-H50S-car-Tweeters-002.png', 'SONY-XS-H50S-car-Tweeters-003.png', NULL, '2019-05-01 04:49:28', '2019-05-01 04:49:28'),
(74, 'Kenwood KDC-120U Car Radio receiver', 'kenwood-kdc-120u-car-radio-receiver', '0', NULL, 0, 'Out of Stock', 'Single Din Front USB& AUX Input CD Car Stereo Receiver Headunit', '7500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KDC-120U', 'Kenwood', '0', NULL, 'Kenwood<b> KDC-120U</b> is an entry-level car stereo that provides a variety of entertainment options; CD player, USB, AUX-In, FM Radio.<br><br>Its an ideal &amp;<b> cost-effective</b> option for replacing your dull, old stock radio.<br><br><b>Key Features</b><b><br></b><ul><li>FM/AM</li><li>CD Player</li><li>Front USB &amp; AUX in</li><li>3 Band Equalizer</li><li>2 Pre-out</li><li>Multicolor Illumination</li><li>Detachable face</li><li>Power output 50W*4</li></ul><b>What\'s in the Box?<br></b><ul><li>Kenwood KDC-120U</li><li>Power Cable</li><li>Remote control</li><li>User Manual</li></ul><b>One Year Warranty</b><br><br><b></b><br>', NULL, 505766, 'Kenwood-KDC-120U-Car-Radio-receiver-thumbnail.png', 'Kenwood-KDC-120U-Car-Radio-receiver-001.png', NULL, 'KENWOOD-KDC-120U-Car-Radio-receiver-002.jpg', 'Kenwood-KDC-120U-Car-Radio-receiver-003.png', NULL, '2019-05-01 04:51:12', '2019-05-01 04:51:12'),
(75, 'KENWOOD KDC-1030U Car Stereo system', 'kenwood-kdc-1030u-car-stereo-system', '0', NULL, 0, 'In Stock', 'Car radio with USB CD Player FM Radio', '7500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KDC-1030U', 'Kenwood', '0', NULL, '<p>Kenwood USB CD Receiver &ndash; <strong>KDC 1030U</strong> Lets you enjoy a variety of features on the road. You can playback from USB devices audio files compressed in various formats.<br />\r\n<br />\r\nThe direct audio control button allows you to access quickly to the sound tuning menu, and Vertical Alignment LCD secures higher visibility during the day-time drive.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>3 Band Equalizer&nbsp;</li>\r\n	<li>Power output 50W*4</li>\r\n	<li>2 Pre-out</li>\r\n	<li>Red Illumination</li>\r\n	<li>Non-Detachable face</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KDC-1030U</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KDC-1030U-Car-Stereo-system-fb_pixels.png', 505766, 'KENWOOD-KDC-1030U-Car-Stereo-system-thumbnail.png', 'KENWOOD-KDC-1030U-Car-Stereo-system-001.png', NULL, 'KENWOOD-KDC-1030U-Car-Stereo-system-002.jpg', NULL, NULL, '2019-05-01 04:52:23', '2019-05-01 04:52:23'),
(76, 'KENWOOD KDC-BT640U Bluetooth Radio', 'kenwood-kdc-bt640u-bluetooth-radio', '0', NULL, 0, 'In Stock', 'Kenwood car radio  with USB/CD Receiver High Voltage 4.0V / 3-preouts', '11500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KDC-BT640U', 'Kenwood', '0', NULL, '<p>Make and Receive calls handsfree on the<strong> Kenwood KDC-BT640U</strong>&nbsp;Car Radio by connecting your phone through <strong>Bluetooth.</strong><br />\r\n<br />\r\nPlay Music media through front USB, Auxilliary, and Bluetooth Streaming.<br />\r\n<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM</li>\r\n	<li>CD Player</li>\r\n	<li>Bluetooth</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>Spotify control</li>\r\n	<li>Kenwood Remote App</li>\r\n	<li>Kenwood Music Mix</li>\r\n	<li>Multicolor Illumination</li>\r\n	<li>Smartphone quick charge</li>\r\n	<li>Power Output 50W*4</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>4.0V 3 Pre-out</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KDC-BT640U</li>\r\n	<li>Power Cable</li>\r\n	<li>Microphone</li>\r\n	<li>Remote Control</li>\r\n	<li>User manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong><br />\r\n&nbsp;</p>', 'KENWOOD-KDC-BT640U-Bluetooth-Radio-fb_pixels.png', 505766, 'KENWOOD-KDC-BT640U-Bluetooth-Radio-thumbnail.png', 'KENWOOD-KDC-BT640U-Bluetooth-Radio-001.png', NULL, 'KENWOD-KDC-BT620U-Car-Stereo-with-Bluetooth-002.jpg', 'KENWOOD-KDC-BT640U-Bluetooth-Radio-003.png', NULL, '2019-05-01 04:53:52', '2019-05-01 04:53:52');
