(77, 'KENWOOD KMM-BT306 Car Radio', 'kenwood-kmm-bt306-car-radio', '0', NULL, 0, 'In Stock', 'Kenwood radio for car with USB Receiver with Bluetooth', '8500', 500, '1', NULL, NULL, 1, 0, 0, 0, 'KMM-BT306', 'Kenwood', '0', NULL, '<p><strong>The KMM-BT306</strong> car radio is a recent release from Kenwood. It has Advanced Bluetooth; helps you connect your smartphone &amp; receiver wirelessly, making your driving time easier, among other features.<br />\r\n&nbsp;</p>\r\n\r\n<p>This modern radio<strong>&nbsp;does not play CDS</strong>. Thus, you don&#39;t have to carry Cds around. All you need is to have your media files stored on your phone or a USB drive.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Built-in Bluetooth<br />\r\n&bull; Direct Bluetooth Control key<br />\r\n&bull; Multi-Color Illumination<br />\r\n&bull; Spotify Control<br />\r\n&bull; 3 Pre outs 4.0V<br />\r\n&bull; Made for iPhone &amp; iPod<br />\r\n&bull; AM/FM radio<br />\r\n&bull; Specialized USB Function</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Front AUX Input</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Kenwood KMM-BT306 Receiver<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual<br />\r\n&bull; Microphone<br />\r\n<br />\r\nOne year warranty</p>', 'KENWOOD-KMM-BT306-Car-Radio-fb_pixels.png', 505766, 'KENWOOD-KMM-BT306-Car-Radio-with-Bluetooth-thumbnail.png', 'KENWOOD-KMM-BT306-Car-Radio-with-Bluetooth-001.png', NULL, 'KENWOOD-KMM-BT305-Car-Radio-with-Bluetooth-002.jpg', 'KENWOOD-KMM-BT306-Car-Radio-with-Bluetooth-003.png', NULL, '2019-05-01 04:56:04', '2019-05-01 04:56:04'),
(78, 'KENWOOD KDC-1040U One din Car Radio', 'kenwood-kdc-1040u-one-din-car-radio', '0', NULL, 0, 'In Stock', 'Affordable Kenwood Car stereo with CD player, AUX Input, USB port, FM.', '7500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KDC-1040U', 'Kenwood', '0', NULL, '<p>Upgrade your Car Radio with this remarkable Kenwood <strong>KDC-1040U </strong>Receiver to be able to listen to all your favorite local stations, Play media files through <strong>CD</strong> Player<strong>, USB</strong>, or Auxiliary Input.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>One Din Radio</li>\r\n	<li>FM /AM</li>\r\n	<li>CD Player</li>\r\n	<li>1(2.5V) Pre-out</li>\r\n	<li>Front USB &amp; AUX In</li>\r\n	<li>Red/white illumination</li>\r\n	<li>Detachable Face panel</li>\r\n	<li>Power output 50w*4</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KDC-1040U</li>\r\n	<li>Power cable</li>\r\n	<li>User Manual</li>\r\n	<li>Remote Control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KDC-1040U-One-din-Car-Radio-fb_pixels.png', 505766, 'KENWOOD-KDC-1040U-One-din-Car-Radio-thumbnail.png', 'KENWOOD-KDC-1040U-One-din-Car-Radio-001.png', NULL, 'KENWOOD-KDC-1040U-One-din-Car-Radio-002.jpg', 'KENWOOD-KDC-1040U-One-din-Car-Radio-003.png', NULL, '2019-05-01 05:02:22', '2019-05-01 05:02:22'),
(80, 'DPX-5100BT In dash Car Stereo', 'dpx-5100bt-in-dash-car-stereo', '0', NULL, 0, 'In Stock', 'Kenwood Car Stereo with CD player, Bluetooth, USB & multicolor display.', '13500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DPX-5100BT', 'Kenwood', '0', NULL, '<p>Kenwood<strong> DPX-5100BT </strong>is a double Din In-dash Bluetooth Receiver with a non-touch screen LCD Display.<br />\r\n<br />\r\nEnjoy a variety of features from this stereo system; receive calls hands-free, play media files on <strong>CD</strong> &amp; <strong>USB</strong>&nbsp;as well as change the color of your stereo to match your Dashboard.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>Dual Bluetooth</li>\r\n	<li>Multicolor Illumination</li>\r\n	<li>High Voltage 4.0V 3 Pre-out</li>\r\n	<li>Kenwood Music Mix</li>\r\n	<li>Spotify Control</li>\r\n	<li>Kenwood Remote App</li>\r\n	<li>Direct OEM Steering Wheel Control</li>\r\n	<li>13 band Equalizer</li>\r\n	<li>Time Alignment</li>\r\n	<li>Power output 55W * 4</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood DPX-5100BT</li>\r\n	<li>Power Cable</li>\r\n	<li>Microphone</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>', 'DPX-5100BT-In-dash-Car-Stereo-fb_pixels.png', 505766, 'DPX-5100BT-In-dash-Car-Stereo-thumbnail.png', 'DPX-5100BT-In-dash-Car-Stereo-001.png', NULL, 'KENWOOD-DPX-5100BT-In-dash-Car-Stereo-with-Bluetooth-002.jpg', 'DPX-5100BT-In-dash-Car-Stereo-003.png', NULL, '2019-05-01 05:10:28', '2019-05-01 05:10:28'),
(81, 'KENWOOD DDX419BT Car Radio', 'kenwood-ddx419bt-car-radio', '0', NULL, 0, 'In Stock', 'This is a double din receiver with a 6.2inch touch display ,Bluetooth for hands free calls & audio streaming and reverse camera support.', '23000', 500, '1', NULL, NULL, 0, 1, 0, 0, 'DDX419BT', 'Kenwood', '0', NULL, '<p>The Kenwood&nbsp;<strong>DDX419BTM</strong>&nbsp;features a 6.2&quot; full Touch Screen display from which you can play media files through DVD Player, USB, AUX, &amp; Bluetooth.<br />\r\n<br />\r\nThis car radio system gives you full&nbsp;<strong>Spotify App Control&nbsp;</strong>through Bluetooth for android &amp; USB for iPhone.<br />\r\n<br />\r\nMake and Pick calls hands free using Bluetooth; this enhances safety on the road.<br />\r\n<br />\r\nConnect two Back up cameras for reversing or parking safety.<br />\r\n<br />\r\npair up to 5 Bluetooth devices at the same time to enjoy audio streaming by switching the devices at the touch of a button.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.2 inch Touch Screen display</li>\r\n	<li>FM/AM</li>\r\n	<li>DVD Player</li>\r\n	<li>Dual Bluetooth</li>\r\n	<li>Spotify full&nbsp;Control</li>\r\n	<li>Steering wheel compatible</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>3 Pre-outs 4.0V</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>Multicolor illumination</li>\r\n	<li>Kenwood Music Mix - pair up to 5 Bluetooth devices to enjoy audio streaming</li>\r\n	<li>Dual Back up Camera Support</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood DDX419BTM&nbsp;</li>\r\n	<li>Power Cable</li>\r\n	<li>Remote Control</li>\r\n	<li>Microphone</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'KENWOOD-DDX419BT-Car-Radio-fb_pixels.png', 505766, 'KENWOOD-DDX419BT-Car-Radio-thumbnail.png', 'KENWOOD-DDX419BT-Car-Radio-001.png', NULL, 'KENWOOD-DDX419BT-CAR-RADIO-WITH-DUAL-CAMERA-INPUT-002.jpg', 'KENWOOD-DDX419BT-Car-Radio-003.png', NULL, '2019-05-01 05:21:34', '2019-05-01 05:21:34'),
(82, 'KENWOOD DDX9019SM Car Android Radio.', 'kenwood-ddx9019sm-car-android-radio', '0', NULL, 0, 'In Stock', 'Kenwood Android radio with inbuilt wifi,3 camera Inputs, Wireless Apple CarPlay & wireless android Mirroring.', '60000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DDX9019SM', 'Kenwood', '0', NULL, '<p>Kenwood <strong>DDX9019SM</strong> Car system AV Receiver with a 6.8&quot; High Definition Display, is built to make your driving time more fun and Convenient.<br />\r\n<br />\r\nCompatibility with <strong>Apple car play</strong> &amp; <strong>Android Auto</strong> offers smart, safe &amp; comprehensive control for your iPhone &amp; Android, respectively.<br />\r\n<br />\r\nIf you are a sound quality Enthusiast, you will love&nbsp;the playback support of various types of music formats, including compatibility with FLAC files. Sound Customization is also available with the <strong>13 bands Equalizer </strong>&amp; Digital Time Alignment.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.8&quot; touch screen Display</li>\r\n	<li>FM Radio</li>\r\n	<li>Dual USB Port</li>\r\n	<li>Dual Bluetooth</li>\r\n	<li>Android Auto Via USB</li>\r\n	<li>Apple Car Play via USB /Bluetooth</li>\r\n	<li>Spotify Control</li>\r\n	<li>Kenwood Music Mix</li>\r\n	<li>Inbuilt wifi</li>\r\n	<li>Navigation</li>\r\n	<li>3 Camera Inputs</li>\r\n	<li>Multicolor Display</li>\r\n	<li>Smartphone Air Mirroring Over Wifi</li>\r\n	<li>Power output 50W*4</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>Steering Wheel Control Compatible</li>\r\n	<li>Digital Time Alignment</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood DDX9019SM</li>\r\n	<li>Power Cable</li>\r\n	<li>Microphone</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong><br />\r\n&nbsp;</p>', 'KENWOOD-DDX9019SM-Car-Android-Radio.-fb_pixels.png', 505766, 'KENWOOD-DDX9019SM-Car-Android-Radio.-thumbnail.png', 'KENWOOD-DDX9019SM-Car-Android-Radio.-001.png', NULL, 'KENWOOD-DDX9019SM-CAR-ANDROID-RADIO-002.jpg', 'KENWOOD-DDX9019SM-Car-Android-Radio.-003.png', NULL, '2019-05-01 05:23:01', '2019-05-01 05:23:01'),
(83, 'KENWOOD Navigation stereo', 'kenwood-navigation-stereo', '0', NULL, 0, 'Out of Stock', 'DNX5170SM Car Stereo with 6.2‚Ä≥ WVGA Clear-coated Resistive Touch Screen Display', '45000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DNX5170SM', 'Kenwood', '0', NULL, 'The Kenwood <b>DNX5170SM </b>car stereo system is your<b> navigation</b> partner on the road.<br>It features a Built-in Garmin Navigation Engine, which offers a variety of road viewing options such as junction view&nbsp;with lane assist, Traffic information, and 3D Building map for easier driving. <br><br><b>Key features</b><br><ul><li>6.2 \" Touch Screen Display</li><li>FM/AM</li><li>DVD Player</li><li>Bluetooth</li><li>Built-in Garmin Navigation system</li><li>Dual USB Ports</li><li>13 band Equalizer</li><li>Spotify control</li><li>High volt 4.0 3-pre-out&nbsp;</li><li>Dual camera input</li></ul><b>What\'s in the Box?</b><br><ul><li>Kenwood DNX5170SM</li><li>Power cable</li><li>Microphone</li><li>Remote Control</li><li>User manual</li></ul><b>One year Warranty</b><br>', NULL, 505766, 'KENWOOD-Navigation-stereo-thumbnail.png', 'KENWOOD-Navigation-stereo-001.png', NULL, 'KENWOOD-DNX5170SM-Car-Stereo-with-Navigation-002.jpg', 'KENWOOD-Navigation-stereo-003.png', NULL, '2019-05-01 05:24:30', '2019-05-01 05:24:30'),
(84, 'Kenwood 6.8\" Car Radio with USB', 'kenwood-68-car-radio-with-usb', '0', NULL, 0, 'In Stock', 'DMX120BT Car Radio with Bluetooth, backup camera input & USB Mirroring.', '15,000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DMX120BT', 'Kenwood', '0', NULL, '<p>Commonly referred to as the Short body due to its half chassis, the Ken-wood <strong>DMX120BT </strong>is a 6.8&quot; Digital Media Receiver with Built-in Bluetooth, MP3, USB.&nbsp;<br />\r\n&nbsp;<br />\r\nWith Android and iPhone <strong>compatibility,</strong> this radio is the perfect choice for any vehicle.<br />\r\n<br />\r\nNote; It does not play CDS.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>6.8&quot; Touch screen display</li>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>Bluetooth with hands free calling &amp; audio streaming.</li>\r\n	<li>7- band Equalizer</li>\r\n	<li>Backup camera ready</li>\r\n	<li>2.0V 2 Pre-out</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood DMX120BT</li>\r\n	<li>Power cable</li>\r\n	<li>Microphone</li>\r\n	<li>Remote control</li>\r\n	<li>User manual</li>\r\n</ul>\r\n\r\n<p><strong>One year Warranty</strong><br />\r\n<br />\r\n&nbsp;</p>', 'Kenwood-6.8\"-Car-Radio-with-USB-fb_pixels.png', 505766, 'Kenwood-6.8\"-Car-Radio-with-USB-thumbnail.png', 'Kenwood-6.8\"-Car-Radio-with-USB-001.png', NULL, 'Kenwood-6.8\"-Car-Radio-with-USB-002.png', 'Kenwood-6.8\"-Car-Radio-with-USB-003.png', NULL, '2019-05-01 05:25:57', '2019-05-01 05:25:57'),
(85, 'KENWOOD KFC-S1056 4 Inch Car Speaker', 'kenwood-kfc-s1056-4-inch-car-speaker', '0', NULL, 0, 'In Stock', 'Stage sound series, 10cm flush mount dual-cone speaker system', '2500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-S1056', 'Kenwood', '0', NULL, '<p>The Kenwood <strong>KFC-S1056</strong> is a pair of 10 cm dual cone speakers with a maximum power of 220 watts &amp; nominal power 21W.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These speakers produce high-quality sound over an extensive coverage; the kind referred to as Kenwood &quot;<strong>Stage Sounding</strong>.&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>4&quot; Speaker Size</li>\r\n	<li>Max power output of 220 Watts</li>\r\n	<li>RMS Power output 21 Watts</li>\r\n	<li>Frequency response 50Hz - 18000 kHz</li>\r\n	<li>Sensitivity 88db</li>\r\n	<li>Dual Cone Flush Mount Speakers</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-S1056 speakers (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KFC-S1056-4-Inch-Car-Speaker-fb_pixels.png', 895, 'KENWOOD-KFC-S1056-4-Inch-Car-Speaker-thumbnail.png', 'KENWOOD-KFC-S1056-4-Inch-Car-Speaker-001.png', NULL, 'KENWOOD-KFC-S1056-4-INCH-CAR-SPEAKERS-002.jpg', 'KENWOOD-KFC-S1056-4-Inch-Car-Speaker-003.png', NULL, '2019-05-01 05:27:32', '2019-05-01 05:27:32'),
(86, 'KENWOOD KFC-S1666 Car Door Speaker', 'kenwood-kfc-s1666-car-door-speaker', '0', NULL, 0, 'In Stock', '6.5\" 300W 2 Way Coaxial Stage Sound Series Speaker', '3000', 500, '2', NULL, NULL, 1, 0, 0, 0, 'KFC-S1666', 'Kenwood', '0', NULL, '<p>Are you tired of the crackly, crappy sound from your average stock speakers? Its time to<strong> upgrade</strong> your door speakers to Kenwood KFC-S1666 2 way <strong>300 Watts.</strong><br />\r\n<br />\r\nThese impressive Speakers, 6.5 inch Speakers, produce vastly improved <strong>audio clarity</strong> than any factory fitted speakers.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>6-1/2&quot; Speaker size</li>\r\n	<li>2-way speakers (pair)</li>\r\n	<li>Peak Input Power: 300W</li>\r\n	<li>RMS Input Power: 30W</li>\r\n	<li>frequency response: 40-22,000 Hz</li>\r\n	<li>sensitivity: 90 dB</li>\r\n	<li>Impedance 4 Ohms</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-S1666 car speaker (pair)</li>\r\n	<li>Power Cables</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KFC-S1666-Car-Door-Speaker-fb_pixels.png', 895, 'KENWOOD-KFC-S1666-Car-Door-Speaker-thumbnail.png', 'KENWOOD-KFC-S1666-Car-Door-Speaker-001.png', NULL, 'KENWOOD-KFC-S1666-CAR-DOOR-SPEAKERS-002.jpg', 'KENWOOD-KFC-S1666-Car-Door-Speaker-003.png', NULL, '2019-05-01 05:28:58', '2019-05-01 05:28:58'),
(87, 'KENWOOD KFC-M6934A Car Speakers', 'kenwood-kfc-m6934a-car-speakers', '0', NULL, 0, 'In Stock', '6x9\", 3-way Flush-Mount Speaker System', '4500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-M6934A', 'Kenwood', '0', NULL, '<p>These speakers are equipped with a &quot;5 degree slanted&quot; mid-range speaker and a tweeter which we call it as &quot;Angled Direct Sound&quot; (so we put &quot;A&quot; in the model name) to direct mid-high range frequencies towards passengers&rsquo; ears and deliver clearer, more directional sound with less loss.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; 3-way 3-speaker System<br />\r\n&bull; 6&quot;x9&quot; P.P. injection woofer cone with square array pattern<br />\r\n&bull; 5&deg; angled direct sound system<br />\r\n&bull; 360W maximum input power<br />\r\n&bull; 70mm midrange<br />\r\n&bull; 12mm tweeter</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; supplied with a pair of grills and speaker cable</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Kenwood KFC-M6934A Speaker (pair)<br />\r\n&bull; Power Cable</p>', 'KENWOOD-KFC-M6934A-Car-Speakers-fb_pixels.png', 895, 'KENWOOD-KFC-M6934A-Car-Speakers-thumbnail.png', 'KENWOOD-KFC-M6934A-Car-Speakers-001.png', NULL, 'KENWOOD-KFC-M6934A-Car-Speakers-002.png', 'KENWOOD-KFC-M6934A-Car-Speakers-003.png', NULL, '2019-05-01 05:30:11', '2019-05-01 05:30:11'),
(88, 'KENWOOD KFC-S6966 Oval Speakers', 'kenwood-kfc-s6966-oval-speakers', '0', NULL, 0, 'In Stock', '6\" x 9\" 3-Way 400W Peak 45W RMS Coaxial Car Audio Speakers', '4500', 500, '2', NULL, NULL, 1, 0, 0, 0, 'KFC-S6966', 'Kenwood', '0', NULL, '<p>The Kenwood KFC-S6966 <strong>Stage Sound Series </strong>Flushmount Speakers bring out the best in your favorite music with robust lows &amp; clear highs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These speakers work with your existing stereo to produce <strong>rich sound heard with clarity.</strong></p>\r\n\r\n<p>Grilles included for custom installation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>6&quot; by 9&quot; Speaker size</li>\r\n	<li>Maximum power output 400 Watts</li>\r\n	<li>RMS Power 45 Watts</li>\r\n	<li>3- way Speaker System.</li>\r\n	<li>50mm Tweeter &amp; 12mm Super Tweeter</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box? </strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-S6966 Speakers (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>', 'KENWOOD-KFC-S6966-Oval-Speakers-fb_pixels.png', 895, 'KENWOOD-KFC-S6966-Oval-Speakers-thumbnail.png', 'KENWOOD-KFC-S6966-Oval-Speakers-001.png', NULL, 'KENWOOD-KFC-S6966-OVAL-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 05:31:02', '2019-05-01 05:31:02'),
(89, 'KENWOOD KFC-S6976EX Stage Sound', 'kenwood-kfc-s6976ex-stage-sound', '0', NULL, 0, 'In Stock', '6\"x9\" Flush Mount 3-way 3-Speaker System', '5000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-S6976EX', 'Kenwood', '0', NULL, '<p>The Kenwood KFC-S6976EX are 3- way 6&quot; by 9&quot; <strong>Flush Mount Speakers </strong>with a maximum power of 500 Watts &amp; RMS Power of 80 Watts.<br />\r\n<br />\r\nThe Speakers are made of<strong> heavy-duty woofer magnet</strong> circuits to ensure excellent performance.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>6&quot; by 9&quot; Speaker size</li>\r\n	<li>Maximum power output 500 Watts</li>\r\n	<li>RMS Power 80 Watts</li>\r\n	<li>3 Way speaker system</li>\r\n	<li>Stage sound series.</li>\r\n	<li>Frequency Response - 44Hz - 18kHz</li>\r\n	<li>Sensitivity (dB/W at 1m) - 87dB</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-S6976EX car speakers (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KFC-S6976EX-Stage-Sound-fb_pixels.png', 895, 'KENWOOD-KFC-S6976EX-Stage-Sound-thumbnail.png', 'KENWOOD-KFC-S6976EX-Stage-Sound-001.png', NULL, 'KENWOOD-KFC-S6976EX-Stage-Sound-002.png', NULL, NULL, '2019-05-01 05:32:07', '2019-05-01 05:32:07'),
(90, 'Kenwood Flush Mount Speakers', 'kenwood-flush-mount-speakers', '0', NULL, 0, 'In Stock', 'KFC-PS6995EX Performance Series 6\" x 9\" 5 way speakers with Max power 700W & Rated Power 130W', '9500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-PS6995EX', 'Kenwood', '0', NULL, '<p>Kenwood&#39;s Performance Series KFC-PS6995EX 6&quot;x9&quot; speakers employ a <strong>5-way </strong>design to give you articulate lows, clean vocals, and startling highs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This arrangement allows these speakers to handle up to<strong> 130 watts RMS power</strong> which is high performance for speakers in that price range.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>6&quot; by 9&quot; Speaker size</li>\r\n	<li>Maximum Power Output 700 Watts</li>\r\n	<li>RMS Power Output 130 Watts</li>\r\n	<li>Woofer cone material paper cone</li>\r\n	<li>Spider basketball steel</li>\r\n	<li>Speaker surround urethane</li>\r\n	<li>Sensibility 88db/w/m</li>\r\n	<li>Frequency response 58hz ~ 20000hz</li>\r\n	<li>Speaker impedance 4&omega;</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>KENWOOD Flash mount Speaker KFC-PS6995EX (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Kenwood-Flush-Mount-Speakers-fb_pixels.png', 895, 'Kenwood-Flush-Mount-Speakers-thumbnail.png', 'Kenwood-Flush-Mount-Speakers-001.png', NULL, 'KENWOOD---KFC-PS6995EX-FLUSH-MOUNT-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 05:33:01', '2019-05-01 05:33:01'),
(91, 'KFC-PS6985 Performance  Speakers', 'kfc-ps6985-performance-speakers', '0', NULL, 0, 'In Stock', '6\"x9\" 4-way \"Performance Standard\" speaker system', '7500', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-PS6985', 'Kenwood', '0', NULL, '<p>The Kenwood <strong>KFC-PS6985</strong> 4-way &quot;Performance Standard&quot; Speaker system is one of a kind when it comes to delivering excellent sound quality.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As the name &quot;Performance Standard&quot; Suggests, these speakers are pacesetters of <strong>exceptional performance.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>6&quot; by 9&quot; Speaker&nbsp;</li>\r\n	<li>Power output 600 Watts</li>\r\n	<li>RMS Power handling 115 Watts</li>\r\n	<li>4 Way Speakers&nbsp;</li>\r\n	<li>Sensitivity 88db</li>\r\n	<li>Frequency Response 63Hz-22kHz</li>\r\n	<li>70mm water resistance cone midrange</li>\r\n	<li>20mm balanced dome tweeter</li>\r\n	<li>12mm &amp; 10mm Super Tweeter</li>\r\n	<li>Woofer Material Paper cone</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-PS6985 Speakers (pair)</li>\r\n	<li>Speaker Grilles</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>', 'KFC-PS6985-Performance--Speakers-fb_pixels.png', 895, 'KFC-PS6985-Performance--Speakers-thumbnail.png', 'KFC-PS6985-Performance--Speakers-001.png', NULL, 'KENWOOD-KFC-PS6985-PERFORMANCE-STANDARD-SPEAKERS-002.jpg', 'KFC-PS6985-Performance--Speakers-003.png', NULL, '2019-05-01 05:33:58', '2019-05-01 05:33:58'),
(92, 'KENWOOD ¬†KFC-PS170C Component Speaker', 'kenwood-kfc-ps170c-component-speaker', '0', NULL, 0, 'In Stock', '6.5\" component speaker system 80w RMS 400w peak car audio speakers', '8500', 500, '2', NULL, NULL, 0, 1, 0, 0, 'KFC-PS170C', 'Kenwood', '0', NULL, '<p>The Kenwood KFC-PS170C <strong>Component speaker system</strong> boasts a Maximum power output of 400 Watts &amp; RMS power of 80 watts.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These speakers come with a pair of <strong>dome tweeters</strong> to accessorize the bass produced by the speaker system &amp; thus creating a perfect balance of <strong>Sound performance &amp; clarity.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features </strong></p>\r\n\r\n<ul>\r\n	<li>6.5&quot; Speaker size</li>\r\n	<li>Maximum Power Output 400 Watts</li>\r\n	<li>RMS Power Output 80&nbsp;</li>\r\n	<li>Tweeter Design Soft Dome</li>\r\n	<li>Tweeter Magnet Composition Neodymium</li>\r\n	<li>Woofer Magnet Composition Ferrite</li>\r\n	<li>Nominal Impedance 4ohms</li>\r\n	<li>Frequency Response 58Hz &ndash; 22kHz</li>\r\n	<li>Sensitivity (dB/W at 1m) 86dB</li>\r\n	<li>Mounting Depth 56mm</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-PS170C component speakers (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n</ul>', '885-fb_pixels.png', 895, 'KENWOOD-¬†KFC-PS170C-Component-Speaker-thumbnail.png', 'KENWOOD-¬†KFC-PS170C-Component-Speaker-001.png', NULL, 'KENWOOD--KFC-PS170C-COMPONENT-SPEAKERS-002.jpg', 'KENWOOD-¬†KFC-PS170C-Component-Speaker-003.png', NULL, '2019-05-01 05:35:36', '2019-05-01 05:35:36'),
(93, 'KENWOOD KFC-W3010 Car Subwoofer Speak', 'kenwood-kfc-w3010-car-subwoofer-speak', '0', NULL, 0, 'In Stock', '12\" 4-ohm subwoofer 1000W', '6500', 500, '4', NULL, NULL, 1, 1, 0, 0, 'KFC-W3010', 'Kenwood', '0', NULL, '<p>Whip up the sound in your system with a blast from a Kenwood &ldquo;&rdquo;Typhoon&rdquo;&rdquo; subwoofer. The W3010 12&Prime;&rdquo; sub rolls out plenty of deep clean bass, thanks to its incredibly strong woofer cone. Distinctive swirl-design ribs reinforce the cone for extra stiffness, so the bass stays clean when the tones go low. The high-roll surround features a flat edge for added durability, and the overbuilt magnet structure and voice coil helps the sub handle plenty of power &mdash; this sub won&rsquo;t bottom out when you drive it hard. This efficient sub works in either sealed or ported enclosures.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Peak Input Power 1000W<br />\r\n&bull; Maximum Input Power 400W<br />\r\n&bull; Rated Input Power 200W<br />\r\n&bull; Woofer Cone material Pearl Mica P.P.cone<br />\r\n&bull; Center Cap Type Aluminum<br />\r\n&bull; Speaker Basket Steel<br />\r\n&bull; Speaker Surround Urethane<br />\r\n&bull; Sensitivity 93dB/W/m<br />\r\n&bull; Frequency Response 25Hz ~ 800Hz<br />\r\n&bull; Subwoofer Impedance 4‚Ñ¶ x 1</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Dimensions (W x H x D) 328 x 328 x 156mm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; KFC-W3010 300mm Component Subwoofer<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'KENWOOD-KFC-W3010-Car-Subwoofer-Speak-fb_pixels.png', 2833, 'KENWOOD-KFC-W3010-Car-Subwoofer-Speak-thumbnail.png', 'KENWOOD-KFC-W3010-Car-Subwoofer-Speak-001.png', NULL, 'CAR-SUBWOOFER-SPEAKER-KENWOOD-KFC-W3010-002.jpg', NULL, NULL, '2019-05-01 05:37:10', '2019-05-01 05:37:10'),
(94, 'KENWOOD KFC-MW3000 Car Subwoofer', 'kenwood-kfc-mw3000-car-subwoofer', '0', NULL, 0, 'In Stock', '12\" subwoofer 1200w', '6500', 500, '4', NULL, NULL, 1, 0, 0, 0, 'KFC-MW3000', 'Kenwood', '0', NULL, '<p>Designed to deliver tighter, more focused bass while requiring less power, Kenwood&#39;s KFC-MW3000 subwoofer produces strong, deep bass whilst still being flexible enough to keep up with the upper notes of a bass guitar while running on moderate power. In saying that though, this beast can handle up to 300 watts RMS, so it will definitely move some air when you want it to!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features </strong><br />\r\n&bull; Size - 12&quot; (300mm)<br />\r\n&bull; Peak Power Handling - 1200W<br />\r\n&bull; RMS Power handling - 300W<br />\r\n&bull; Frequency Response - 36Hz-300Hz<br />\r\n&bull; Impedance - 4ohm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Sensitivity - 85dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Kenwood KFC-MW3000 Bass speaker<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'KENWOOD-KFC-MW3000-Car-Subwoofer-fb_pixels.png', 2833, 'KENWOOD-KFC-MW3000-Car-Subwoofer-thumbnail.png', 'KENWOOD-KFC-MW3000-Car-Subwoofer-001.png', NULL, 'KENWOOD-KFC-MW3000-CAR-SUBWOOFER-002.jpg', NULL, NULL, '2019-05-01 05:38:14', '2019-05-01 05:38:14'),
(95, 'KENWOOD KFC-PS3016W Bass Speaker', 'kenwood-kfc-ps3016w-bass-speaker', '0', NULL, 0, 'In Stock', '2000W 400W RMS 12 inch Car subwoofer', '7500', 500, '4', NULL, NULL, 0, 0, 0, 0, 'KFC-PS3016W', 'Kenwood', '0', NULL, '<p>The Kenwood KFC-PS3016W 12&quot; sub is built to handle up to 400W RMS and features a heavy duty polypropylene cone reinforced by a tough rubber surround.</p>\r\n\r\n<p>The Square Array Pattern reinforces the cone so that it won&#39;t warp during heavy bass production. A dual ventilation system pulls heated air out of the motor structure through the back and the sides of the sub, so the inner works stay cooler during those long, loud jams. Put this Kenwood in a suitable enclosure, power it with a nice amp, and get ready to party.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Power Handling:<br />\r\nPeak: 2000 watts<br />\r\nRMS: 400 watts<br />\r\n&bull; Size: 12&quot; (30cm)<br />\r\n&bull; Coil: Single Voice Coil<br />\r\n&bull; Frequency Response: 34Hz to 300Hz<br />\r\n&bull; Sensitivity: 85dB<br />\r\n&bull; Impedance: 4&Omega;<br />\r\n&bull; Oversized Diaphragm<br />\r\n&bull; Square Array Pattern<br />\r\n&bull; Rubber Surround<br />\r\n&bull; Steel Basket</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Push-terminals for easy connection</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong><br />\r\n&bull; Kenwood KFC-PS3016W car bass speaker<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'KENWOOD-KFC-PS3016W-Bass-Speaker-fb_pixels.png', 2833, 'KENWOOD-KFC-PS3016W-Bass-Speaker-thumbnail.png', 'KENWOOD-KFC-PS3016W-Bass-Speaker-001.png', NULL, 'KENWOOD-KFC-PS3016W-BASS-SPEAKER-002.jpg', 'KENWOOD-KFC-PS3016W-Bass-Speaker-003.png', NULL, '2019-05-01 05:39:40', '2019-05-01 05:39:40'),
(96, 'KENWOOD KFC-HQR3000 HQ Reference Sub', 'kenwood-kfc-hqr3000-hq-reference-sub', '0', NULL, 0, 'In Stock', '12\" Subwoofer 1500W', '9500', 500, '4', NULL, NULL, 0, 1, 0, 0, 'KFC-HQR3000', 'Kenwood', '0', NULL, '<p>Create the perfect musical atmosphere in your car with the Kenwood Subwoofer; it&rsquo;s powered with 1500 watts and a two-layer voice coil design to give you the rich bass sound you desire.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Peak Input Power 1500W<br />\r\n&bull; RMS Input Power 500W<br />\r\n&bull; Size 30cm<br />\r\n&bull; Woofer Magnet Composition Ferrite<br />\r\n&bull; Nominal Impedance 4ohms<br />\r\n&bull; Frequency Response 32Hz &ndash; 300Hz<br />\r\n&bull; Sensitivity (dB/W at 1m) 82dB</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Mounting Depth 153mm</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; Kenwood HQR-3000 Reference Bass Speaker<br />\r\n&bull; Power Cable<br />\r\n&bull; User Manual</p>', 'KENWOOD-KFC-HQR3000-HQ-Reference-Sub-fb_pixels.png', 2833, 'KENWOOD-KFC-HQR3000-HQ-Reference-Subw-thumbnail.png', 'KENWOOD-KFC-HQR3000-HQ-Reference-Subw-001.png', NULL, 'KENWOOD-KFC-HQR3000-HQ-REFERENCE-SUBWOOFER-002.jpg', NULL, NULL, '2019-05-01 05:40:53', '2019-05-01 05:40:53'),
(97, 'KENWOOD KFC-HQR7100 Car Speakers', 'kenwood-kfc-hqr7100-car-speakers', '0', NULL, 0, 'In Stock', '7‚Äù*10‚Äù 600Watts Car Speakers', '13000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-HQR7100', 'Kenwood', '0', NULL, '<p>Kenwood <strong>KFC-HQR7100</strong> offers A perfect balance of performance and sound clarity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Peak Power 600 Watts</li>\r\n	<li>Rated power output 150 Watts</li>\r\n	<li>Frequency Response 63-20kHz</li>\r\n	<li>Sensitivity 83dB at 1m</li>\r\n	<li>Impedance: 3 Ohms</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-HQR7100 (pair)</li>\r\n	<li>Power Cable</li>\r\n	<li>User Manual</li>\r\n	<li>6&quot; x 9&quot; bracket</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KFC-HQR7100-Car-Speakers-fb_pixels.png', 895, 'KENWOOD-KFC-HQR7100-Car-Speakers-thumbnail.png', 'KENWOOD-KFC-HQR7100-Car-Speakers-001.png', NULL, 'KENWOOD-KFC-HQR7100-CAR-SPEAKERS-002.jpg', 'KENWOOD-KFC-HQR7100-Car-Speakers-003.png', NULL, '2019-05-01 05:42:54', '2019-05-01 05:42:54'),
(98, 'KENWOOD KFC-HQR710EX Car Speakers', 'kenwood-kfc-hqr710ex-car-speakers', '0', NULL, 0, 'In Stock', '7x10\" 700W Ultra Hi-Performance Speaker', '13500', 500, '2', NULL, NULL, 0, 1, 0, 0, 'KFC-HQR710EX', 'Kenwood', '0', NULL, '<p>Kenwood <strong>KFC-HQR710EX</strong> is a pair of 7x10&quot; ultra hi-performance speakers with a maximum power of <strong>700 watts</strong> at 3&Omega; power impedance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It has a <strong>horn tweeter</strong> with a Neodymium magnet that maximizes the efficiency of titanium diaphragm movement and reproduces ultra-wide range &quot;Life-like&quot; sound.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kenwood KFC-HQR710EX includes a <strong>6&quot; x 9&quot;</strong> inch bracket, and a &quot;slated&quot; bracket to improve installation capability.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>7&quot; by 10&quot; Speaker Size</li>\r\n	<li>Maximum power output 700 Watts</li>\r\n	<li>RMS Power Input 155 Watts</li>\r\n	<li>Horn Tweeter Design</li>\r\n	<li>Nominal Impedance 3 ohms</li>\r\n	<li>Frequency Response 63Hz - 23kHz</li>\r\n	<li>Sensitivity (dB/W at 1m) 97dB</li>\r\n	<li>Mounting Depth 88mm</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pair of Kenwood KFC-HQR710EX 7&quot; x 10&quot; Car Speakers</li>\r\n	<li>6&quot; x 9&quot; bracket</li>\r\n	<li>Slated bracket</li>\r\n	<li>User Manual</li>\r\n	<li>Power Cable</li>\r\n</ul>', 'KENWOOD-KFC-HQR710EX-Car-Speakers-fb_pixels.png', 895, 'KENWOOD-KFC-HQR710EX-Car-Speakers-thumbnail.png', 'KENWOOD-KFC-HQR710EX-Car-Speakers-001.png', NULL, 'KENWOOD-KFC-HQR710EX-CAR-SPEAKERS-002.jpg', 'KENWOOD-KFC-HQR710EX-Car-Speakers-003.png', NULL, '2019-05-01 05:44:24', '2019-05-01 05:44:24'),
(99, 'KENWOOD KSC-SW11 Under seat Subwoofer', 'kenwood-ksc-sw11-under-seat-subwoofer', '0', NULL, 0, 'Out of Stock', 'Compact powered enclosed subwoofer 150 watts.', '18500', 500, '23', NULL, NULL, 0, 0, 0, 0, 'KSC-SW11', 'Kenwood', '0', NULL, '<p>Kenwood&#39;s KSC-SW11 <strong>Powered subwoofer </strong>might look small, but it delivers impressive bass. This little powerhouse will fit <strong>under a seat</strong> in most vehicles, where it&#39;ll produce low-frequency response equal to that of a larger subwoofer in your trunk.<br />\r\n<br />\r\nIt offers a great solution for those who want to reinforce the<strong> bass </strong>in their system without taking up a lot of space <strong>(Space Saving).</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>compact powered subwoofer</li>\r\n	<li>aluminum enclosure with 8-1/4&quot; x 5-1/8&quot; sub</li>\r\n	<li>built-in amplifier: 75 watts RMS power (150 watts maximum)</li>\r\n	<li><strong>wired remote for control over</strong>:</li>\r\n	<li><em>volume level</em></li>\r\n	<li><em>variable low-pass crossover (50-125 Hz)</em></li>\r\n	<li><em>selectable phase control (0&deg;, 180&deg;)</em></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>power/ground wiring harness</li>\r\n	<li>preamp- (RCA) and speaker-level inputs</li>\r\n	<li>frequency response: 35-125 Hz</li>\r\n	<li>dimensions: 11&quot;W x 2-3/4&quot;H x 7-1/2&quot;D</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KSC-SW11 under seat subwoofer</li>\r\n	<li>Wiring Harness</li>\r\n	<li>Mounting Brackets</li>\r\n	<li>Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KSC-SW11-Under-seat-Subwoofer-fb_pixels.png', 895, 'KENWOOD-KSC-SW11-Under-seat-Subwoofer-thumbnail.png', 'KENWOOD-KSC-SW11-Under-seat-Subwoofer-001.png', NULL, 'KENWOOD-KSC-SW11-CAR-UNDERSEAT-SUBWOOFER-002.jpg', 'KENWOOD-KSC-SW11-Under-seat-Subwoofer-003.png', NULL, '2019-05-01 05:48:13', '2019-05-01 05:48:13'),
(100, 'KENWOOD KSC-PSW8 Under seat Subwoofer', 'kenwood-ksc-psw8-under-seat-subwoofer', '0', NULL, 0, 'Out of Stock', 'Compact powered 8\" subwoofer 250watts', '22000', 500, '23', NULL, NULL, 1, 0, 0, 0, 'KSC-PSW8', 'Kenwood', '0', NULL, '<p>The Kenwood <strong>KSC-PSW8</strong> 250 Watts <strong>powered subwoofer</strong> is made to&nbsp;deliver impressive bass in less space.<br />\r\n<br />\r\nThis <strong>compact powered </strong>enclosure fits under the seat in most vehicles, where it produces a bass response that&#39;s equal to that of a larger subwoofer in your trunk. It offers a great solution for those who want to reinforce their low-frequency punch while <strong>conserving Space.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>built-in amplifier: 150 watts RMS power (250 watts maximum)</li>\r\n	<li>wired remote for control over:</li>\r\n	<li>volume level</li>\r\n	<li>variable low-pass crossover (50-125 Hz)</li>\r\n	<li>selectable phase control (0&deg;, 180&deg;)</li>\r\n	<li>power/ground wiring harness</li>\r\n	<li>preamp- (RCA) and speaker-level inputs</li>\r\n	<li>frequency response: 35-150 Hz</li>\r\n	<li>sensitivity: 81 dB</li>\r\n	<li>dimensions: 13-3/4&quot;W x 2-15/16&quot;H x 9-7/16&quot;D</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KSC-PSW8 Underseat sub-woofer</li>\r\n	<li>Wiring Harness</li>\r\n	<li>Mounting Brackets</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KSC-PSW8-Under-seat-Subwoofer-fb_pixels.png', 895, 'KENWOOD-KSC-PSW8-Under-seat-Subwoofer-thumbnail.png', 'KENWOOD-KSC-PSW8-Under-seat-Subwoofer-001.png', NULL, 'KENWOOD-KSC-PSW8-CAR-UNDERSEAT-SUBWOOFER-002.jpg', 'KENWOOD-KSC-PSW8-Under-seat-Subwoofer-003.png', NULL, '2019-05-01 05:49:29', '2019-05-01 05:49:29'),
(101, 'KENWOOD KAC-8106D Monoblock Amplifier', 'kenwood-kac-8106d-monoblock-amplifier', '0', NULL, 0, 'In Stock', '1000W Max, 500W RMS 1-Channel Monoblock Class-D Car Amplifier', '14000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'KAC-8106D', 'Kenwood', '0', NULL, '<ul>\r\n	<li>As its name eludes, the Kenwood<strong> Performance Series</strong>&nbsp;KAC-8106D&nbsp;amplifier has been designed and manufactured with the <strong>power to perform </strong>in addition to its sleek look.\r\n	<p>&nbsp;</p>\r\n\r\n	<p>The KAC-8106D is a Powerful mono-block amplifier delivering <strong>1000 watts </strong>of power (<strong>500W RMS</strong>), equipped with an on-board low-pass &amp; subsonic filters allowing the user to adjust the signal so you&#39;ll get the best sound possible from your sub/speaker combo.</p>\r\n\r\n	<p>&nbsp;</p>\r\n\r\n	<p>Dial-in up to 18dB of bass boost if you want to add some serious bass.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>Rated power output:</li>\r\n	</ul>\r\n	&nbsp;&nbsp;&nbsp; o 300 W x 1 (4 &Omega;)<br />\r\n	&nbsp;&nbsp;&nbsp; o 500 W x 1 (2 &Omega;)\r\n	<ul>\r\n		<li>Max power output: 1000 watts</li>\r\n		<li>Class-D technology</li>\r\n		<li>Frequency Response: 20 Hz &ndash;200Hz</li>\r\n		<li>Input sensitivity (RCA) - 0.2 V &ndash; 5.0 V</li>\r\n		<li>Signal to noise ratio - 100 dB</li>\r\n		<li>Input impedance - 10 k&Omega;</li>\r\n		<li>Low pass filter frequency: 50 Hz &ndash; 200 Hz (variable)</li>\r\n		<li>Bass Boost Control (40 Hz), 0 &ndash; +18 dB (variable)</li>\r\n		<li>Dimensions (W &times; H &times; D) 240 &times; 56 &times;192mm</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Kenwood KAC-8106D monoblock amplifier</li>\r\n		<li>Fittings as per Manufacturer</li>\r\n		<li>Manual</li>\r\n	</ul>\r\n	<strong>One year warranty</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KAC-8106D-Monoblock-Amplifier-fb_pixels.png', 891, 'KENWOOD-KAC-8106D-Monoblock-Amplifier-thumbnail.png', 'KENWOOD-KAC-8106D-Monoblock-Amplifier-001.png', NULL, 'KENWOOD-KAC-8106D-Monoblock-Amplifier-002.png', NULL, NULL, '2019-05-01 05:50:39', '2019-05-01 05:50:39'),
(102, 'KENWOOD KAC-PS917D Mono Amplifier', 'kenwood-kac-ps917d-mono-amplifier', '0', NULL, 0, 'In Stock', 'Kenwood 2000watts monobock amplifier', '25000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'KAC-PS917D', 'Kenwood', '0', NULL, '<p>The Kenwood KAC-PS917D Class D <strong>Mono</strong> Power Amplifier has a tiny footprint and a mighty <strong>powerful kick.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Monoblock Amplifier</li>\r\n	<li>Class D</li>\r\n	<li>2 Ohm Stable</li>\r\n	<li>Low-Pass Filter: 50-200Hz (Variable)</li>\r\n	<li>Bass Boost Control: 0-18dB</li>\r\n	<li>Speaker Level Inputs (with Signal Sensing Turn On)</li>\r\n	<li>Cast Aluminum Heat Sink Design</li>\r\n	<li>Power MOS-FET Switching Power Supply</li>\r\n	<li>Total Max Power: 2000W</li>\r\n	<li>RMS Power:</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1ch Configuration:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 x 500W (4&Omega;)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1 x 1000W (2&Omega;)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KAC-PS917D car amplifier</li>\r\n	<li>Fittings as per manufacturer</li>\r\n	<li>User manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KAC-PS917D-Mono-Amplifier-fb_pixels.png', 891, 'KENWOOD-KAC-PS917D-Mono-Amplifier-thumbnail.png', 'KENWOOD-KAC-PS917D-Mono-Amplifier-001.png', NULL, 'KENWOOD-KAC-PS917D-MONOBLOCK-AMPLIFIER-002.jpg', NULL, NULL, '2019-05-01 05:51:32', '2019-05-01 05:51:32'),
(103, 'KENWOOD KAC-PS704EX Car Audio Booster', 'kenwood-kac-ps704ex-car-audio-booster', '0', NULL, 0, 'In Stock', '1000W Max 4/3/2 Channel Car Power Amplifier', '10000', 500, '5', NULL, NULL, 1, 0, 0, 0, 'KAC-PS704EX', 'Kenwood', '0', NULL, '<p>The KAC-PS704EX <strong>Performance Standard series</strong> amplifier is one of the best Kenwoods series of&nbsp;&nbsp;Amplifiers.&nbsp;<br />\r\n<br />\r\nBoasting a maximum Power of <strong>1000 watts</strong> &amp;<strong> 4 bridgeable channels</strong>&nbsp;the KAC-PS704EX provides outstanding dynamics, holding the musical reproduction to the highest standard whether delivering impactful bass or the most detailed notes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Rated power output:</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o 70W x 4 (4 &Omega;)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o 100W x 4 (2 &Omega;)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o Bridged power output (4&Omega;)&nbsp; 400W x 2</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Max power output: 1000 watts</li>\r\n	<li>CEA-2006 Compliant</li>\r\n	<li>Low-pass/ High-pass Filter</li>\r\n	<li>Switched Mode Power supply&nbsp;&nbsp;&nbsp; - MOS-FET</li>\r\n	<li>Cooling Fan</li>\r\n	<li>Signal Sensing Turn-on</li>\r\n	<li>Line in - 4 RCA / Speaker level</li>\r\n	<li>Speaker Level Input</li>\r\n	<li>Single Side Terminals</li>\r\n	<li>Die-Cast Aluminium Heat Sink</li>\r\n	<li>Signal to Noise Ratio: 100dB</li>\r\n	<li>Dimensions (WxHxD): 335 x 56 x 204(mm)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KAC-PS704EX 4 channel Car Amplifier</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', '446-fb_pixels.png', 891, 'KENWOOD-KAC-PS704EX-Car-Audio-Booster-thumbnail.png', 'KENWOOD-KAC-PS704EX-Car-Audio-Booster-001.png', NULL, 'KENWOOD-KAC-PS704EX-CAR-AUDIO--BOOSTER-002.jpg', NULL, NULL, '2019-05-01 05:52:42', '2019-05-01 05:52:42'),
(104, 'KENWOOD 4 Channel Car Amplifier', 'kenwood-4-channel-car-amplifier', '0', NULL, 0, 'In Stock', 'KAC-HQR1004 1200W Max Power 4/3/2-channel amplifier', '13500', 500, '5', NULL, NULL, 0, 0, 0, 0, 'KAC-HQR1004', 'Kenwood', '0', NULL, '<p>Add some <strong>punch</strong> to your car sound system with this Kenwood KAC-HQR1004<strong> 1200 Watts</strong> Amplifier.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Power Output</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; o 100W RMS x 4 at 4 Ohms<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; o 130W RMS x 4 at 2 Ohms</p>\r\n\r\n<ul>\r\n	<li>270W RMS x 2 Bridge at 4 ohms</li>\r\n	<li>Max Power: 1200W</li>\r\n	<li>Variable Low Pass Filter (50-200[Hz],-12dB/oct)</li>\r\n	<li>Variable High Pass Filter (50-200[Hz],-12dB/oct)</li>\r\n	<li>Bass Boost (40[Hz],+18dB)</li>\r\n	<li>Frequency Response: 5Hz-50 kHz</li>\r\n	<li>Input Sensitivity (RCA): 0.2V-5.0V</li>\r\n	<li>Signal to noise ratio: 100dB</li>\r\n	<li>Operating Voltage: 14.4V (11-16V allowable)</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood KAC-HQR1004 4 channel Amplifier</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-4-Channel-Car-Amplifier-fb_pixels.png', 891, 'KENWOOD-4-Channel-Car-Amplifier-thumbnail.png', 'KENWOOD-4-Channel-Car-Amplifier-001.png', NULL, 'KENWOOD-KAC-HQR1004-4-CHANNEL-CAR-AMPLIFIER-002.jpg', 'KENWOOD-4-Channel-Car-Amplifier-003.png', NULL, '2019-05-01 05:53:48', '2019-05-01 05:53:48'),
(105, 'KENWOOD KFC-T40A Car Tweeter', 'kenwood-kfc-t40a-car-tweeter', '0', NULL, 0, 'In Stock', '280W Wide Range Tune Up Tweeters (pair)', '4500', 500, '3', NULL, NULL, 0, 0, 0, 0, 'KFC-T40A', 'Kenwood', '0', NULL, '<ul>\r\n	<li>\r\n	<p>A pair of Kenwood<strong> KFC T40A</strong>&nbsp; balanced dome tweeters can make a big <strong>improvement</strong> in your system&rsquo;s soundstage. The balanced dome design offers wide dispersion for excellent imaging, and this 1&Prime; polyetherimide tweeter can handle up to <strong>40 watts RMS</strong>.&nbsp;<br />\r\n	<br />\r\n	The Kenwood Tweeters have in-line high-pass filters that maintain the high-efficiency, low-distortion output.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key Features</strong>\r\n\r\n	<ul>\r\n		<li>Power Handling:</li>\r\n	</ul>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Peak: 280 watts<br />\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; RMS: 65 watts\r\n	<ul>\r\n		<li>40mm Cone Tweeter</li>\r\n		<li>Sensitivity: 90dB at 1m</li>\r\n		<li>Frequency Response: 3,000Hz -20,000 Hz</li>\r\n		<li>Impedance: 6 ohms</li>\r\n		<li>In-line Crossover Network</li>\r\n		<li>Dimension: 75.3mm x 81.3mm</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Kenwood KFC-T40A Tweeters (pair)</li>\r\n		<li>Two Capacitors</li>\r\n		<li>Wiring</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'KENWOOD-KFC-T40A-Car-Tweeter-fb_pixels.png', 895, 'KENWOOD-KFC-T40A-Car-Tweeter-thumbnail.png', 'KENWOOD-KFC-T40A-Car-Tweeter-001.png', NULL, 'KENWOOD-KFC-T40A-CAR-TWEETERS-002.jpg', 'KENWOOD-KFC-T40A-Car-Tweeter-003.png', NULL, '2019-05-01 05:55:21', '2019-05-01 05:55:21'),
(106, 'JVC KD-R498 Car Radio receiver', 'jvc-kd-r498-car-radio-receiver', '0', NULL, 0, 'In Stock', 'CD Receiver with Front USB/AUX Input', '7500', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KD-R498', 'JVC', '0', NULL, '<p>The <strong>JVC KD-R498 </strong>Car Stereo offers a simple plug &amp; play solution by directly connecting your Android Smartphone or Tablet through<strong> USB</strong> for Music playback.<br />\r\n<br />\r\nYou can as well connect your smartphone through a front Auxilliary &amp; Play media through<strong> CD.</strong><br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>FM/AM&nbsp;</li>\r\n	<li>CD Player</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>Max Power output 50W * 4</li>\r\n	<li>Variable Color Illumination</li>\r\n	<li>Auto Dimmer</li>\r\n	<li>Brightness Control</li>\r\n	<li>3 Band Equalizer</li>\r\n	<li>Detachable Face Panel</li>\r\n	<li>Bass Bost</li>\r\n	<li>2.5V 2 Pre-out</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC KD-R498</li>\r\n	<li>Power Socket</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong><br />\r\n<br />\r\n&nbsp;</p>', 'JVC-KD-R498-Car-Radio-receiver-fb_pixels.png', 505766, 'JVC-KD-R498-Car-Radio-receiver-thumbnail.png', 'JVC-KD-R498-Car-Radio-receiver-001.png', NULL, 'JVC-KD-R498-Car-Radio-receiver-002.jpg', 'JVC-KD-R498-Car-Radio-receiver-003.png', NULL, '2019-05-01 05:57:04', '2019-05-01 05:57:04');
