(107, 'JVC KD-DV5606  Car Radio system', 'jvc-kd-dv5606-car-radio-system', '0', NULL, 0, 'In Stock', 'Multimedia DVD/CD/USB Receiver with Front AUX', '12000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KD-DV5606', 'JVC', '0', NULL, '<p>Experience a new dimension of in-car entertainment with the<strong> JVC KD-DV5606 </strong>receiver.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The receiver is packed to the hilt with many features to give you the best <strong>audio-video</strong> experience.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Connect an External Monitor, i.e., <strong>Dashboard Monitor</strong> or<strong> headrest monitor </strong>for reverse camera display or to watch Videos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM/AM</li>\r\n	<li>DVD Player</li>\r\n	<li>Front USB port &amp; AUX In</li>\r\n	<li>2.5V&nbsp; 2 Pre-out</li>\r\n	<li>1 Video Output</li>\r\n	<li>3 band Equalizer</li>\r\n	<li>Detachable Face Panel</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC KD-DV5606 DVD Receiver</li>\r\n	<li>Power Socket</li>\r\n	<li>User Manual</li>\r\n	<li>Remote Control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'JVC-KD-DV5606--Car-Radio-system-fb_pixels.png', 505766, 'JVC-KD-DV5606--Car-Radio-system-thumbnail.png', 'JVC-KD-DV5606--Car-Radio-system-001.png', NULL, 'JVC-KD-DV5606-Car-Radio-system-002.jpg', 'JVC-KD-DV5606--Car-Radio-system-003.png', NULL, '2019-05-01 05:57:55', '2019-05-01 05:57:55'),
(108, 'JVC  Car Radio with Bluetooth', 'jvc-car-radio-with-bluetooth', '0', NULL, 0, 'In Stock', 'Double din CD front USB AUX car stereo receiver', '13000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KW-R930BT', 'JVC', '0', NULL, '<div>JVC\'s KW-R930BT CD receiver is a sleek layout double din Radio that gives you control over <b>Bluetooth¬Æ,</b>&nbsp; and your music collection through <b>Spotify,</b> <b>USB</b> &amp; <b>AUX.</b><br><br>It has a 2-line Display that helps you quickly see the song info. You can also assign different illumination colors to two separate areas of the display to match the interior of your car. </div><b>Key Features</b><br><b></b><ul><li>FM/AM</li><li>Works with Spotify</li><li>Bluetooth Wireless Connectivity</li><li>K2 Technology</li><li>Android music playback via USB</li><li>iPod/iPhone music control</li><li>2 Phones Full-Time Bluetooth Connection</li><li>Bluetooth Automatic Pairing</li><li>Streaming DJ</li><li>USB 1.5A Charging</li><li>2-Line VA LCD Display</li><li>2-Zone Variable Color</li><li>Steering Remote Ready (Interface sold separately)</li><li>Remote Control App</li><li>MOS-FET 50W x 4</li><li>Time Alignment</li></ul><div></div><b>What‚Äôs in the Box?</b><br><div></div><ul><li>JVC KW-R930BT radio head unit</li><li>Power Cable</li><li>User Manual</li><li>Remote Control</li></ul>One Year Warranty<br>', NULL, 505766, 'JVC--Car-Radio-with-Bluetooth-thumbnail.png', 'JVC--Car-Radio-with-Bluetooth-001.png', NULL, 'JVC-KW-R930BT-Car-Radio-with-Bluetooth-hands-free-calling-002.jpg', NULL, NULL, '2019-05-01 05:59:02', '2019-05-01 05:59:02'),
(109, 'JVC KW-V230BTM', 'jvc-kw-v230btm', '0', NULL, 0, 'Out of Stock', 'Car Stereo with Spotify & Reverse camera input DVD/CD/USB receiver 6.2 inch touch screen display.', '22000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'KW-V230BTM', 'JVC', '0', NULL, 'Featuring most of the current popular technologies,&nbsp;the KW-V230BTM<b> 6.2\" </b>Touch screen radio built-in Bluetooth, <b>DVD </b>Playback,<b> USB</b> Input &amp; Video output.<br><br>Dual Connectivity built-in Bluetooth allows you to connect 2 Bluetooth devices simultaneously for audio streaming or hands-free calling.<br><br><b>Key Features<br></b><ul><li>6.2\" Touch Screen Display</li><li>FM/AM</li><li>Dual Connectivity built-in Bluetooth</li><li>DVD Player</li><li>Time Alignment</li><li>Sound Lift</li><li>Space enhancement</li><li>4.0 3 Pre-outs</li><li>Reverse camera input</li><li>Pandora&nbsp;</li><li>Spotify</li></ul><b>What\'s in the Box?<br></b><ul><li>JVC KW-V230BTM&nbsp;</li><li>Microphone</li><li>Remote Control</li><li>Power Socket</li><li>User manual</li></ul><b>One Year Warranty</b><br><br>', NULL, 505766, 'JVC-KW-V230BTM-thumbnail.png', 'JVC-KW-V230BTM-001.png', NULL, 'JVC-KW-V230BTM-Car-Stereo-with-spotify-and-Reverse-camera-input-002.jpg', 'JVC-KW-V230BTM-003.png', NULL, '2019-05-01 06:00:16', '2019-05-01 06:00:16'),
(110, 'JVC CS-DR162 Doors Speakers', 'jvc-cs-dr162-doors-speakers', '0', NULL, 0, 'In Stock', '16cm (6-1/2‚Ä≥) 2-way coaxial speakers', '3000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'CS-DR162', 'JVC', '0', NULL, '<p>The DR Speakers are designed for the JVC head-unit to produce superior directivity, dynamic sound, which we call <strong>&ldquo;drvn sound.&rdquo;</strong></p>\r\n\r\n<p><br />\r\nThe Speakers have Full Cover Grill Design, which protects the woofer and tweeter in open installations.<br />\r\nHorn Ring Sound Enhancer that improves mid &ndash; higher frequency sound character and reproduces life-like sound.</p>\r\n\r\n<p>Lightweight PP + Mica Cone Material provides highly responsive, clear, and undistorted sound.</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>6.5&quot; Speaker Size</li>\r\n	<li>Maximum Power Output 300 Watts</li>\r\n	<li>Nominal power 50 Watts</li>\r\n	<li>2 Way Speakers</li>\r\n	<li>Frequency Response 88-22000 Hz</li>\r\n	<li>Sensitivity 88db</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC CS-DR162 6 inch speakers (pair)</li>\r\n	<li>Power Cables</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'JVC-CS-DR162-Doors-Speakers-fb_pixels.png', 895, 'JVC-CS-DR162-Doors-Speakers-thumbnail.png', 'JVC-CS-DR162-Doors-Speakers-001.png', NULL, 'JVC-CS-DR162-DOOR-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 06:01:35', '2019-05-01 06:01:35'),
(111, 'JVC CS-DR6930 Oval Speakers', 'jvc-cs-dr6930-oval-speakers', '0', NULL, 0, 'In Stock', '6\"x9\" 3-way car speakers', '5000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'CS-DR6930', 'JVC', '0', NULL, '<p>The JVC CD-DR6930<strong> 3 </strong>way <strong>6&quot; by 9&quot; </strong>Speakers offer strong audio performance with excellent <strong>power handling.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>6&quot;x9&quot; carbon mica woofer</li>\r\n	<li>Maximum Power Output 500 Watts</li>\r\n	<li>RMS Power Output 70 Watts</li>\r\n	<li>3- way Speakers</li>\r\n	<li>cloth and rubber hybrid surround</li>\r\n	<li>frequency response: 58-21,000 Hz</li>\r\n	<li>sensitivity: 88 dB</li>\r\n	<li>grilles included</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC CS-DR6930 Oval Speakers</li>\r\n	<li>User Manual</li>\r\n	<li>Power Cable</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'JVC-CS-DR6930-Oval-Speakers-fb_pixels.png', 895, 'JVC-CS-DR6930-Oval-Speakers-thumbnail.png', 'JVC-CS-DR6930-Oval-Speakers-001.png', NULL, 'JVC-CS-DR6930-OVAL-SPEAKERS-002.jpg', NULL, NULL, '2019-05-01 06:02:38', '2019-05-01 06:02:38'),
(112, 'JVC ¬†CW-DRA8 Under seat Subwoofer', 'jvc-cw-dra8-under-seat-subwoofer', '0', NULL, 0, 'In Stock', 'Compact powered subwoofer: 250 watts and an 8\" sub', '22000', 500, '23', NULL, NULL, 0, 0, 0, 0, 'CW-DRA8', 'JVC', '0', NULL, '<p>As cars become increasingly smaller, it&#39;s getting harder and harder to find a place to install a subwoofer.<br />\r\n<br />\r\nJVC&#39;s CW-DRA8<strong> powered sub</strong> gives you deep, full bass from a low-profile enclosure that easily fits under your car&#39;s seat or in a corner of your trunk.<br />\r\n<br />\r\nIts built-in amplifier delivers <strong>150 watts RMS</strong> to the 8&quot; sub, and it&#39;s Class D design ensures that it&#39;ll run cool in some very tight places.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>powered subwoofer with space-saving enclosure</li>\r\n	<li>8&quot; shallow-profile woofer</li>\r\n	<li>150 watt RMS Class D amplifier (250 watts peak)</li>\r\n	<li>low-pass crossover variable from 50-125 Hz</li>\r\n	<li>Wired Remote</li>\r\n	<li>frequency response: 35-150 Hz</li>\r\n	<li>dimensions: 13-3/4&quot;W x 2-15/16&quot;H x 9-7/16&quot;D</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC&#39;s CW-DRA8 Under-seat sub woofer</li>\r\n	<li>Wire Harness</li>\r\n	<li>Wired Remote</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', '825-fb_pixels.png', 895, 'JVC-¬†CW-DRA8-Under-seat-Subwoofer-thumbnail.png', 'JVC-¬†CW-DRA8-Under-seat-Subwoofer-001.png', NULL, 'JVC--CW-DRA8-UNDERSEAT-SUBWOOFER-002.jpg', NULL, NULL, '2019-05-01 06:04:00', '2019-05-01 06:04:00'),
(113, 'JVC KS-DR5004 Amplifier', 'jvc-ks-dr5004-amplifier', '0', NULL, 0, 'In Stock', '4 channel 1000 watts Car Amplifier', '8500', 500, '5', NULL, NULL, 0, 0, 0, 0, 'KS-DR5004', 'JVC', '0', NULL, '<p>When it is time for some serious power for your car audio system, JVC KS-DR5004<strong> 4 channel Bridgeable</strong> audio amplifier is the way to go. The 4 channel Bridgeable Series Amplifiers are in line with the high power output that JVC is known for.<br />\r\n&nbsp;</p>\r\n\r\n<p>Incorporating Super circuitry allows for dedicated, efficient power for a higher bass response without sacrificing sound pressure. The outputs chosen for the amplifier are typically used for music production where <strong>high power</strong>, efficient cooling, and minimal distortion are key. They allow these amps to produce high power with<strong> minimal distortion</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>4 channel Amplifier</li>\r\n	<li>Maximum Power Output 1000W</li>\r\n	<li>RMS Power Output (4 ohm) [ 1% THD 14.4V] 70W x 4 (20 - 20,000Hz)</li>\r\n	<li>RMS Power Output (2 ohm) [ 1% THD 14.4V] 100W x 4 (1,000Hz)</li>\r\n	<li>RMS Power Output (Bridged 4 ohm) [ 1% THD 14.4V] 200W x 2 (1,000Hz)</li>\r\n	<li>Class Class-AB</li>\r\n	<li>Signal-to-Noise Ratio (reference: 1W into 4 ohms), CEA-2006 Compliant &gt; 100dB</li>\r\n	<li>Load Impedance</li>\r\n	<li>Load Impedance Allowance 2 - 8 ohms</li>\r\n	<li>HPF 80Hz (-12dB/0ct)</li>\r\n	<li>LPF 50Hz - 200Hz (-24dB/oct)</li>\r\n	<li>RCA Input Ach L/R, Bch L/R</li>\r\n	<li>High Level Input (Speaker Level Input) Yes</li>\r\n	<li>High Level Input Auto Power Control (Signal Sensing Turn On) Yes</li>\r\n	<li>Input Sensitivity 0.2 - 5V</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC KS-DR5004 4 Channel 1000W Amplifier</li>\r\n	<li>Fittings as per manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'JVC-KS-DR5004-Amplifier-fb_pixels.png', 891, 'JVC-KS-DR5004-Amplifier-thumbnail.png', 'JVC-KS-DR5004-Amplifier-001.png', NULL, 'JVC-KS-DR5004-AMPLIFIER-002.jpg', NULL, NULL, '2019-05-01 06:05:39', '2019-05-01 06:05:39'),
(123, 'BOSCHMANN Bridgeable Car Amplifier', 'boschmann-bridgeable-car-amplifier', '0', NULL, 0, 'In Stock', 'PCH-4880DX 1300 Watts 4channel Bridgeable Amplifier', '9000', 500, '5', NULL, NULL, 1, 0, 0, 1, 'PCH-4880DX', 'BOSCHMANN', '0', NULL, '<p>The Boschmann PCH-4880DX is a 4 channel<strong> Bridgeable</strong> Car Amplifier with a maximum power output of <strong>1300 watts</strong>.<br />\r\n<br />\r\nPower your Bass Speaker, Mid-range, tweeters with the <strong>Boschmann Booster</strong> and get the most out of your sound system.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Amplifier Type: 4/3/2 channel PWM MOSFET</li>\r\n	<li>Frequency Response: +1/-1db @6hz-60KHZ</li>\r\n	<li>4-ohms cont.power output :66W x 4CH</li>\r\n	<li>2-ohms cont.power Output:130W x 4CH</li>\r\n	<li>4-Ohms Bridgeable cont Output: 280w x 2ch</li>\r\n	<li>4-Ohms Max Bridgeable output:650w x 2ch</li>\r\n	<li>Low Pass Filter : 40HZ-150HZ(var)</li>\r\n	<li>High Pass Filter: 80HZ-1.2Khz(var)</li>\r\n	<li>Bass Boost: 0/+6/+12db</li>\r\n	<li>Stereo separation: &gt;91 db</li>\r\n	<li>Damping factor : 185</li>\r\n	<li>Input sensitivity: 200mv-3V</li>\r\n	<li>Signal To Noise Ratio : &gt; 100db</li>\r\n	<li>Operation Voltage : DC 12A</li>\r\n	<li>Speaker Impedance(stereo) : 4ohms</li>\r\n	<li>Fuse Rating : 40 Amp X 1</li>\r\n	<li>Watts: 1300w</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1xManual</li>\r\n	<li>4xscrew</li>\r\n	<li>2x fuse</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'BOSCHMANN-Bridgeable-Car-Amplifier-fb_pixels.png', 891, 'BOSCHMANN-Bridgeable-Car-Amplifier-thumbnail.png', 'BOSCHMANN-Bridgeable-Car-Amplifier-001.png', NULL, 'BOSCHMANN-PCH-4880DX-BRIDGEABLE-CAR--AMPLIFIER-002.jpg', NULL, NULL, '2019-05-01 06:23:26', '2019-05-01 06:23:26'),
(126, '9 inch Car DVD Headrest monitor', '9-inch-car-dvd-headrest-monitor', '0', NULL, 0, 'In Stock', '9 Inch TFT LED Screen Headrest Monitor With DVD Player, USB & inbuilt Games.', '18000', 500, '6', NULL, NULL, 0, 0, 0, 0, 'HDR1', 'Others', '0', NULL, '<ul>\r\n	<li>\r\n	<p>These DVD Monitors features two high-quality 9-inch&nbsp;TF LCD monitors for backseat<strong> headrests</strong>. Each has a widescreen 1440 x 234 resolution with adjustable mounting; the vehicle headrest mounts display player can be installed to car models that fit the 4.7&rsquo;&rsquo;-7.5&#39;&#39; adjustable mounting posts.<br />\r\n	<br />\r\n	&nbsp;They already come with everything needed - power cables, wiring harness, and remote control. The Headrest operates on a<strong> master-servant</strong> relationship. Let your Family Enjoy watching all types of media files on these monitors while on the road.<br />\r\n	<br />\r\n	The monitor comes with&nbsp;&nbsp;Over <strong>300 games </strong>for kids to play and stay entertained</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key Features</strong>\r\n\r\n	<ul>\r\n		<li>9 inch TFT LED Screen Monitor</li>\r\n		<li>DVD Player</li>\r\n		<li>USB port</li>\r\n		<li>Inbuilt Games</li>\r\n		<li>SD card Slot</li>\r\n		<li>Adjustable Mounting</li>\r\n		<li>Come as a pair</li>\r\n		<li>Color: Silver, Grey, Beige.</li>\r\n		<li>Power: DC 12V</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>A pair of 9-inch Headrest Monitors</li>\r\n		<li>Power Cables</li>\r\n		<li>Remote control</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '9-inch-Car-DVD-Headrest-monitor-fb_pixels.png', 8483, '9-inch-Car-DVD-Headrest-monitor-thumbnail.png', '9-inch-Car-DVD-Headrest-monitor-001.png', '2020-08-1019:57:44imageHeadrestmonitorpx.png', '9-INCH-TFT-LED-SCREEN-HEADREST-MONITOR-WITH-DVD-PLAYER,-GAMES-002.jpg', NULL, NULL, '2019-05-01 09:42:49', '2019-05-01 09:42:49'),
(127, '5 Inch Foldable Car LCD Dashboard mon', '5-inch-foldable-car-lcd-dashboard-mon', '0', NULL, 0, 'In Stock', 'Screen Parking Monitor', '4000', 500, '6', NULL, NULL, 0, 1, 0, 0, 'FDSHD', 'Others', '0', NULL, '<ul>\r\n	<li>\r\n	<p>Use the<strong> 5 inches</strong> digital TFT LCD foldable monitor to watch videos and as a backup camera display.<br />\r\n	<br />\r\n	It is widely used on vehicles with a 12V Power Source.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>Display:5 inch</li>\r\n		<li>Resolution: 800 * 480</li>\r\n		<li>Video-Input: 2 way AV input</li>\r\n		<li>Signal format: PAL / NTSC</li>\r\n		<li>Can be connected to a reverse camera</li>\r\n		<li>Display Rate: 16:9</li>\r\n		<li>Power: 4.5W</li>\r\n		<li>Rated Voltage: DC 12V</li>\r\n		<li>Language: English</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>1 x 5 LCD Monitor</li>\r\n		<li>1 x Power Cable</li>\r\n		<li>1 x Video Cable</li>\r\n		<li>1 x User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '5-Inch-Foldable-Car-LCD-Dashboard-mon-fb_pixels.png', 8483, '5-Inch-Foldable-Car-LCD-Dashboard-mon-thumbnail.png', '5-Inch-Foldable-Car-LCD-Dashboard-mon-001.png', NULL, '5-Inch-Foldable-Car-LCD-Dashboard-mon-002.png', '5-Inch-Foldable-Car-LCD-Dashboard-mon-003.png', NULL, '2019-05-01 09:44:54', '2019-05-01 09:44:54'),
