(129, 'Rearview Monitor With USB & SD Card', 'rearview-monitor-with-usb-sd-card', '0', NULL, 0, 'In Stock', '7 Inch Car rear view monitor With USB port, FM MP5, SD Card Slot & Bluetooth.', '4500', 500, '6', NULL, NULL, 0, 0, 0, 0, 'RVM', 'Others', '0', NULL, '<p>The <strong>7 Inch</strong> Car Rear View Monitor<strong> supports</strong> Bluetooth, MP5, FM Transmitter, USB &amp; SD Card.<br />\r\nThe high resolution (<strong>800x480</strong> Pixels)&nbsp;monitor has two-channel stereo audio output (AV1 &amp; AV2), Working Perfectly with Car DVD, Camera, Satelite receiver and other video&nbsp;equipment.<br />\r\n<br />\r\nThe monitor has <strong>parking rearview priority</strong> where the monitor&nbsp;starts up automatically and synchronously displays the video from rearview camera when you&#39;re backing your car; the monitor will close itself after backing.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Screen Size: 7 inch&nbsp;</li>\r\n	<li>Display Component: Color TFT LCD</li>\r\n	<li>Display format: 16:9</li>\r\n	<li>Resolution: 800 x 480 Pixel</li>\r\n	<li>Response Time: B&rarr;W 50ms; WB 30ms</li>\r\n	<li>Contrast Ratio: 300: 1</li>\r\n	<li>Brightness: 350cd/m2</li>\r\n	<li>Video Frequency: PAL / NTSC&nbsp;</li>\r\n	<li>Video-Input: 2-CH video input</li>\r\n	<li>Audio Input: 2-CH audio output</li>\r\n	<li>Power Supply: DC 12V</li>\r\n	<li>Power Consumption: 7W&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Support video format: RM/RMVB/AVI/MPG/DAT/MP4/MP5/MOV/VOB</li>\r\n	<li>Support music format: MP3/WMA</li>\r\n	<li>Support image format: JPG/BMP/GIF/PNG/TIFF</li>\r\n	<li>1 x USB 2.0 Port</li>\r\n	<li>1 x SD Card Slot</li>\r\n	<li>Support Bluetooth Function: Yes</li>\r\n	<li>FM Transmitter Launch Range: 10 meters</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1 x Car Bluetooth Rearview Monitor</li>\r\n	<li>1 x Video and Power Cable</li>\r\n	<li>1 x Remote Controller</li>\r\n	<li>1 x User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '537-fb_pixels.png', 8483, 'Rearview-Monitor-With-USB-&-SD-Card-thumbnail.png', 'Rearview-Monitor-With-USB-&-SD-Card-001.png', NULL, '7-INCH-CAR-REARVIEW-MONITOR-WITH-USB-PORT-SD-CARD-SLOT-002.jpg', 'Rearview-Monitor-With-USB-&-SD-Card-003.png', NULL, '2019-05-01 09:48:21', '2019-05-01 09:48:21'),
