(133, 'HD Car Reverse Camera Round', 'hd-car-reverse-camera-round', '0', NULL, 0, 'In Stock', 'Waterproof, Night Vision, Wide angle View Car backup camera', '2000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'RRC', 'Others', '0', NULL, '<p>Reversing has never been this easy! This&nbsp;Brand New round back up camera can be mounted&nbsp;by<strong> drilling </strong>or <strong>Screwing.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Waterproof</li>\r\n	<li>170 degrees wide viewing angle</li>\r\n	<li>Night Vision</li>\r\n	<li>Applicable to a variety of Vehicles: car, truck, RV, mini-van, etc</li>\r\n	<li>Can help avoid incidents and accidents abrasion well</li>\r\n	<li>Compact design and easy to install</li>\r\n	<li>Image sensor: CMOS Sensor</li>\r\n	<li>Resolution: 728 x 512 Pixel</li>\r\n	<li>Horizontal resolution: 420TVL</li>\r\n	<li>(Rear) mirror function</li>\r\n	<li>Automatic White Balance</li>\r\n	<li>automatic back light compensation</li>\r\n	<li>Minimum illumination 0.2 lux only</li>\r\n	<li>RCA video output Vpp / 75O hm</li>\r\n	<li>Operating on 12V DC / ca. 200 mA</li>\r\n	<li>Operating Temperature: -20~ 60 degree</li>\r\n	<li>Storage temperature: -30 ~ 60 degree</li>\r\n	<li>Video cable length: 6 m</li>\r\n	<li>Power supply cable length: 1.2 m</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Car Reverse camera (round)</li>\r\n	<li>Wiring Cables</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'HD-Car-Reverse-Camera-Round-fb_pixels.png', 6968, 'HD-Car-Reverse-Camera-Round-thumbnail.png', 'HD-Car-Reverse-Camera-Round-001.png', NULL, 'HD-Car-Reverse-Camera-Round-002.png', 'HD-Car-Reverse-Camera-Round-003.png', NULL, '2019-05-24 04:18:50', '2019-05-24 04:18:50'),
(134, 'HD Square Reverse Camera', 'hd-square-reverse-camera', '0', NULL, 0, 'In Stock', 'Night vision Waterproof Car backup camera', '1500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'SRC', 'Others', '0', NULL, '<p><strong>HD</strong> Square Back up Camera its <strong>waterproof</strong> has <strong>night vision</strong> and <strong>led backlight </strong>Display.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>high-quality HD</li>\r\n	<li>Waterproof</li>\r\n	<li>Compact design and easy to install</li>\r\n	<li>Easily mount the camera at any place of the car body, it could be used as front view / side view / rear view camera</li>\r\n	<li>Applicable to variety of vehicles: Car, truck, RV, mini-van etc.</li>\r\n	<li>Image sensor: Color</li>\r\n	<li>Effective pixels: 510 x 492 Pixels</li>\r\n	<li>Sensing area: 4.08x 3.102mm</li>\r\n	<li>Horizontal Resolution: 420TVL</li>\r\n	<li>Shutter speed: 1/60-20us</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Square Reverse Camera</li>\r\n	<li>Wiring Cable</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'HD-Square-Reverse-Camera-fb_pixels.png', 6968, 'HD-Square-Reverse-Camera-thumbnail.png', 'HD-Square-Reverse-Camera-001.png', NULL, 'HD-Square-Reverse-Camera-002.png', 'HD-Square-Reverse-Camera-003.png', NULL, '2019-05-24 04:20:56', '2019-05-24 04:20:56'),
(135, 'Drilling Car Reverse Camera', 'drilling-car-reverse-camera', '0', NULL, 0, 'In Stock', 'Universal reverse camera with Night Vision.', '3500', 500, '10', NULL, NULL, 0, 1, 0, 0, 'RCS', 'Others', '0', NULL, '<p>This <strong>HD Reverse camera</strong> is unique in the fact that it&#39;s mounted by <strong>Drilling</strong>&nbsp;it to the bumper &amp; for the fact that it&#39;s not easily vandalized.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>wide-angle lens universal auto parking reversing backup camera</li>\r\n	<li>Display a reversed camera image on the monitor to duplicate the normal view seen in a rear view mirror.</li>\r\n	<li>It&#39;s a night vision camera, you can easily get a clear situation in your back.</li>\r\n	<li>Waterproof, high-definition, can be used both in car and home</li>\r\n	<li>Fit into most vehicle key holes, no other installation needed.</li>\r\n	<li>Low power consumption and low maintenance.</li>\r\n	<li>Can help avoid incidents and accidents abrasion well</li>\r\n	<li>Compact design, easy to install and operate.</li>\r\n	<li>Effective Pixel: 656 x 492</li>\r\n	<li>Scanning System: 2 : 1 Interlace</li>\r\n	<li>Min Illumination: 0.1</li>\r\n	<li>Resolution: 420 TV lines</li>\r\n	<li>Lens Angle: 170 degrees</li>\r\n	<li>Sensor Area: 4.08 x 3.12 mm</li>\r\n	<li>Shutter Speed: 1/60-1/20000</li>\r\n	<li>Gamma Coefficient: 0.4</li>\r\n	<li>S / N Ratio: More than 48 dB</li>\r\n	<li>Water-proof</li>\r\n	<li>Power Supply: DC 12 V</li>\r\n	<li>Wired Or Wireless: Wired</li>\r\n	<li>Shell Material: Plastic</li>\r\n	<li>Lens Material: Plastic + Glass</li>\r\n	<li>Video Line Length: 6 m</li>\r\n	<li>White Balance: Auto</li>\r\n	<li>Color: Black</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>One reverse Camera</li>\r\n	<li>Power Cable</li>\r\n	<li>Video Cable</li>\r\n	<li>Screw</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Drilling-Car-Reverse-Camera-fb_pixels.png', 6968, 'Drilling-Car-Reverse-Camera-thumbnail.png', 'Drilling-Car-Reverse-Camera-001.png', NULL, 'Drilling-Car-Reverse-Camera-002.png', NULL, NULL, '2019-05-24 04:22:33', '2019-05-24 04:22:33'),
(137, 'Dual recording Dashcam', 'dual-recording-dashcam', '0', NULL, 0, 'In Stock', 'Front & back Recording Dash cam With motion Detection & G- sensor', '5500', 500, '10', NULL, NULL, 0, 1, 0, 0, 'DDVR', 'Others', '0', NULL, '<p><em><strong>New Upgrade Dual-lens camera design</strong></em>: front camera with up to 170-degree viewing angle to ensure you have covered all the angles recorded with <em><strong>Led Night Vision &amp; Waterproof </strong></em>rear camera.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When the camera is connected, the device can simultaneously record front and rearview videos. These videos are automatically stored in different folders.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Seamless Video recording</em></strong>: no matter what time will not be interrupted, Automatic seamless video recording in loop to use the storage efficiently, with the earliest unlocked video clips being overwritten when reaching the storage card&#39;s maximal capacity. Customizable video clip length of 1, 2 and 3minutes.<br />\r\n<br />\r\nRecord Full HD 1920x1080 high-resolution video, 720P HD rear camera lens with LED Night Vision, easy to switch between the front and rear lens. As well as a<em><strong> G-Sensor</strong></em>, which senses sudden acceleration and collisions to automatically capture and protect critical footage in an accident.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>Motion detection</li>\r\n	<li>Parking detection</li>\r\n	<li>G-Sensor: Record the crash information in a traffic accident, real black box</li>\r\n	<li>Double DVR Parameter</li>\r\n	<li>Power Battery Type: Build-in</li>\r\n	<li>Input: 5V 1.5A</li>\r\n	<li>Charge way: Car Charger plugs into the cigar lighter</li>\r\n	<li>Camera Lens: Front Camera: 12.0MP</li>\r\n	<li>Wide Angle: 170-degree wide-angle</li>\r\n	<li>Video Format: AVI</li>\r\n	<li>Video Resolution:1920X1080P; 1280x720P</li>\r\n	<li>Image Format: JPEG</li>\r\n</ul>\r\n\r\n<p><em>Function:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dual Camera Recording simultaneously: Yes</li>\r\n	<li>Auto Reverse Parking view: Yes</li>\r\n	<li>2 split-view display simultaneously: Yes</li>\r\n	<li>Decode Mute: Yes</li>\r\n	<li>Loop-Cycle Recording: Yes</li>\r\n	<li>Motion Detection: Yes</li>\r\n	<li>Multiple Language: English, Chinese, Russian, Italian</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1XDual dash cam</li>\r\n	<li>1xmanual</li>\r\n	<li>1xpower cable</li>\r\n	<li>1xreverse camera</li>\r\n	<li>2x mounting straps</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Dual-recording-Dashcam-fb_pixels.png', 8301, 'Dual-recording-Dashcam-thumbnail.png', 'Dual-recording-Dashcam-001.png', NULL, 'DUAL-CAMERA-REAR-VIEW-MIRROR-DASHCAM-FULL-HD-RECORDER-002.jpg', NULL, NULL, '2019-05-24 04:27:12', '2019-05-24 04:27:12'),
(138, 'KENWOOD DRV-N520 Drive Recorder', 'kenwood-drv-n520-drive-recorder', '0', NULL, 0, 'In Stock', 'Car Dash cam for use with select Kenwood video receivers', '22000', 500, '14', NULL, NULL, 0, 0, 0, 0, 'KDVR', 'Kenwood', '0', NULL, '<p>Add this <strong>DRV-N520</strong> dash camera and drive assistant to select Kenwood multimedia receivers to enhance your driving experience.<br />\r\n<br />\r\nWhen it&#39;s connected to the receiver&#39;s front camera input, you&#39;ll gain an in-dash view of whatever this dash cam&nbsp;records, plus departure delay warnings, collision alerts, and more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Full HD portable digital video recorder compatible with select Kenwood video receivers only</li>\r\n	<li>includes vehicle power cable, hard-wire cable option, adhesive-backed mount, an 8GB microSD card</li>\r\n	<li>works with select Kenwood multimedia receivers</li>\r\n	<li>incident time-stamping</li>\r\n	<li>117&deg; wide-angle view</li>\r\n	<li>alerts driver with warnings of forward collision and departure delay</li>\r\n	<li>&nbsp;High dynamic range for a sharper image</li>\r\n	<li>G-sensor incident and motion detection</li>\r\n	<li>resolution: 2304 x 1296</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dashboard camera</li>\r\n	<li>11.5&#39; Power/Video harness</li>\r\n	<li>Self-adhesive mounting bracket</li>\r\n	<li>Cable holder</li>\r\n	<li>8GB microSD card</li>\r\n	<li>microSD-to-SD card adapter</li>\r\n	<li>Instruction Manual</li>\r\n	<li>Warranty Card</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>One year warranty</strong></p>', 'KENWOOD-DRV-N520-Drive-Recorder-fb_pixels.png', 8301, 'KENWOOD-DRV-N520-Drive-Recorder-thumbnail.png', 'KENWOOD-DRV-N520-Drive-Recorder-001.png', NULL, 'KENWOOD-DRV-N520-DRIVE-RECORDER-002.jpg', NULL, NULL, '2019-05-24 04:28:35', '2019-05-24 04:28:35'),
(141, 'Auto Central Lock System Car Control', 'auto-central-lock-system-car-control', '0', NULL, 0, 'In Stock', 'Central door lock system universal for all cars', '2500', 500, '17', NULL, NULL, 0, 0, 0, 0, 'CNTRL', 'Others', '0', NULL, '<p>From design, engineering and construction, this central locking system is built not only to look good but to provide you with the ability to lock/unlock via a compact system.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong><br />\r\n&bull; Lock/unlock<br />\r\n&bull; 4 Door lock actuators<br />\r\n&bull; Control module<br />\r\n&bull; Wiring harness<br />\r\n&bull; Actuator mounting hardware<br />\r\n&bull; Central lock built-in; Central door lock automatically<br />\r\n&bull; Voltage Input: 12V<br />\r\n&bull; Adds power door locks to most vehicles<br />\r\n&bull; Central door lock automatically</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&bull; Universal for any cars, applicable for the car that without central lock model</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong><br />\r\n&bull; 4 door Lock Actuators<br />\r\n&bull; Control Module<br />\r\n&bull; Wiring Harness<br />\r\n&bull; Actuator mounting hardware</p>', NULL, 2768, 'Auto-Central-Lock-System-Car-Control-thumbnail.png', 'Auto-Central-Lock-System-Car-Control-001.png', NULL, 'Auto-Central-Lock-System-Car-Control-002.png', NULL, NULL, '2019-05-24 04:38:06', '2019-05-24 04:38:06'),
(142, 'Real Time Vehicle GPS Tracker TK-303F', 'real-time-vehicle-gps-tracker-tk-303f', '0', NULL, 0, 'In Stock', 'Car tracking device with android app/ iPhone web based & sms tracking.', '6499', 500, '17', NULL, NULL, 0, 1, 0, 0, 'TK-303F', 'Others', '0', NULL, '<p>The TK-303F is a wired <strong>Car Tracking Device</strong> based on the <strong>GSM </strong>/<strong> GPRS</strong> network and GPS satellite positioning system, which set multiple functions of security, positioning, monitoring surveillance, emergency alarms and tracking in its entirety.<br />\r\nIt can track and <strong>monitor</strong> remote target by<strong> SMS or internet</strong>. Special&nbsp;<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>GPS Positioning - Sends the coordinates ( longitude &amp; latitude) of the vehicle position.</li>\r\n	<li>GPRS - View your car&#39;s location through google maps with the street names.</li>\r\n	<li>Engine Stop - Cut off the oil &amp; power system using SMS Command or via Application.</li>\r\n	<li>GPS Blind Spot - Sends you an alert message &quot;no GPS + last valid latitude/longitude&quot; before the lost signal.</li>\r\n	<li>Geo-Fence - Restrict movements within a certain location, if your asset goes out of the location it sends an alert message to the authorized numbers.</li>\r\n	<li>Fleet Management - Monitor your fleet from the same platform. Each asset has to be installed with the TK-303F Car Tracker.</li>\r\n	<li>Sim Change Alarm - If anybody changes device SIM Card, an alert will be sent</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>GPS Tracker</li>\r\n	<li>User Manual</li>\r\n	<li>wiring Cables</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Real-Time-Vehicle-GPS-Tracker-TK-303F-fb_pixels.png', 8301, 'Real-Time-Vehicle-GPS-Tracker-TK-303F-thumbnail.png', 'Real-Time-Vehicle-GPS-Tracker-TK-303F-001.png', NULL, 'REAL-TIME-VEHICLE-GPS-TRACKER-TK-303F-002.jpg', 'Real-Time-Vehicle-GPS-Tracker-TK-303F-003.png', NULL, '2019-05-24 04:39:54', '2019-05-24 04:39:54'),
(143, 'Portable Car GPS Tracker TK-310', 'portable-car-gps-tracker-tk-310', '0', NULL, 0, 'In Stock', 'Mini portable car GPS tracker', '7499', 500, '17', NULL, NULL, 0, 0, 0, 0, 'TK-310', 'Others', '0', NULL, '<p>The wireless<strong> TK310 Portable Tracker</strong> is a miniature GPS tracker designed for personal and asset tracking.<br />\r\n<br />\r\nWith alerts like geo-fence boundary crossings, low battery, SIM card change alert, and many other advanced <strong>reporting features</strong>, TK310 is simply the most versatile tracker. With a <strong>1000mAh Li-ion battery</strong>, it can work up to 6 days.<br />\r\n<br />\r\n<strong>Key Features:</strong></p>\r\n\r\n<ul>\r\n	<li>GPS Positioning - Sends the coordinates ( longitude &amp; latitude) of the vehicle position.</li>\r\n	<li>GPRS - View your car&#39;s location through google maps with the street names.</li>\r\n	<li>GPS Blind Spot - Sends you an alert message &quot;no GPS + last valid latitude/longitude&quot; before the lost signal.</li>\r\n	<li>Geo-Fence - Restrict movements within a certain location, if your asset goes out of the location it sends an alert message to the authorized numbers.</li>\r\n	<li>Fleet Management - Monitor your fleet from the same platform. Each asset has to be installed with the TK-303F Car Tracker.</li>\r\n	<li>Two-way talk - With MIC and speaker connected, it&#39;s easy to realize two-way audio</li>\r\n	<li>Listen-in - Send command to the device and you can hear the live voice around it</li>\r\n	<li>SOS call -Thumb-sized button allowing urgent call during an emergency case</li>\r\n	<li>Falls alarm - An alarm will be sent to the nominated phone number if fall is detected</li>\r\n	<li>SIM change alarm -If anybody changes the device SIM card, an alert will be sent</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>TK310 Tracking Device</li>\r\n	<li>USB Charging Cable</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Portable-Car-GPS-Tracker-TK-310-fb_pixels.png', 8301, 'Portable-Car-GPS-Tracker-TK-310-thumbnail.png', 'Portable-Car-GPS-Tracker-TK-310-001.png', NULL, 'PORTABLE-CAR-GPS-TRACKER-TK-310-002.jpg', 'Portable-Car-GPS-Tracker-TK-310-003.png', NULL, '2019-05-24 04:41:08', '2019-05-24 04:41:08'),
(144, '4PC Car Parking Sensor LED Display', '4pc-car-parking-sensor-led-display', '0', NULL, 0, 'In Stock', 'Car backup reverse radar system ‚Äòwarning alarm kit.', '3000', 500, '10', NULL, NULL, 1, 0, 0, 0, 'PRKS', 'Others', '0', NULL, '<ul>\r\n	<li><strong>Parking sensors </strong>are handy for almost everyone. However, if you drive a larger vehicle, these sensors are nearly essential. They use <strong>proximity sensing technology </strong>to measure the distance of the sensor pickup from all types of obstructions, alerting you when you get too close.\r\n	<p>The effect is that you have a way to detect objects in your blind spots, without sending your loved ones outside of your vehicle to flag you into your parking spot.<br />\r\n	&nbsp;&nbsp;<br />\r\n	Don&#39;t worry if your vehicle doesn&#39;t have these. Most bumpers have spots where parking sensors can be mounted, and either you or your mechanic can install the parts quite easily. Upgrade your safety or replace your broken sensor with this quality option.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key Features</strong>\r\n\r\n	<ul>\r\n		<li>Digital and color LED display with BiBi sound reminder</li>\r\n		<li>By three steps than the sound alarm</li>\r\n		<li>Left and right obstacle indication</li>\r\n		<li>Digital display from 2.0 meters to 0 meters</li>\r\n		<li>4 sensor system, double CPU and advanced chipset for enhanced coverage and detection.</li>\r\n		<li>High sensitivity.</li>\r\n		<li>With sound alert when the 4 cameras detect dangers.</li>\r\n		<li>The closer the obstacles, the louder and faster the sound alert.</li>\r\n		<li>Help to prevent dangerous and costly collisions.</li>\r\n		<li>Help to provide increased safety for passengers, pedestrians, and family members who happen to be around the moving vehicle.</li>\r\n		<li>Detect small children and low walls as well.</li>\r\n		<li>Anti-freeze and rainproof.</li>\r\n		<li>Easy to install.</li>\r\n		<li>A saw drill head included convenient to drill hole.</li>\r\n		<li>Color: black, grey, white</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>1 x LED Display</li>\r\n		<li>4 x Parking Sensors with 2.5m Line</li>\r\n		<li>1 x Power Cable</li>\r\n		<li>1 x Hole Saw</li>\r\n		<li>2 x Double Sided Adhesive Pad</li>\r\n		<li>1 x User manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '4PC-Car-Parking-Sensor-LED-Display-fb_pixels.png', 6968, '4PC-Car-Parking-Sensor-LED-Display-thumbnail.png', '4PC-Car-Parking-Sensor-LED-Display-001.png', NULL, '4PC-CAR-PARKING-SENSORS-LED-DISPLAY-002.jpg', NULL, NULL, '2019-05-24 04:42:22', '2019-05-24 04:42:22'),
(145, 'Car Jump Starlet & Air Compressor', 'car-jump-starlet-air-compressor', '0', NULL, 0, 'In Stock', 'Portable 16,800mAh Starting Device 600A Charger for Car Battery Booster Car Air Pump Starter', '7000', 500, '10', NULL, NULL, 1, 0, 0, 0, 'JUMPS1', 'Others', '0', NULL, '<p>There is nothing as embarrassing as being stuck in the Middle of the road due to low battery issues with absolutely no forthcoming help. This 16<strong>,800 mah </strong>Car <strong>Jumpstarte</strong>r will get you out of that situation and do much more as indicated below.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Start the car when the battery is low</li>\r\n	<li>Charge Cellphones (tablet PC)</li>\r\n	<li>Charge Laptops (other devices)</li>\r\n	<li>LED Lights</li>\r\n	<li>SOS Lights (police lights)</li>\r\n	<li>Warning lights&nbsp;</li>\r\n	<li>Capacity: 18,000 Mah</li>\r\n	<li>Life Span: 3-5 years</li>\r\n	<li>Output: 15V-1A, 16V-2A, 19V-3.5A</li>\r\n	<li>Input: 15V-1A</li>\r\n	<li>Starting Current: 300A</li>\r\n	<li>Highest Current: 600AFull charging time: 4~6 hours</li>\r\n	<li>Working Temp: -20-60&deg;</li>\r\n	<li>Air compressor</li>\r\n	<li>Material: ABS</li>\r\n	<li>Color: black</li>\r\n	<li>Size: 160*75*28mm</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1 x 18000 mAh Power Bank</li>\r\n	<li>1 x Home Power Plug</li>\r\n	<li>1 x Car Charger</li>\r\n	<li>1 x Laptop Charging Adapter</li>\r\n	<li>8 x Laptop Connector</li>\r\n	<li>1 x Digital Charging Cable</li>\r\n	<li>1 x Storage Battery Wire Clip</li>\r\n	<li>1 x User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Car-Jump-Starlet-&-Air-Compressor-fb_pixels.png', 5068, 'Car-Jump-Starlet-&-Air-Compressor-thumbnail.png', 'Car-Jump-Starlet-&-Air-Compressor-001.png', NULL, 'CAR-JUMP-STARTER-and-AIR-COMPRESSOR-002.jpg', 'Car-Jump-Starlet-&-Air-Compressor-003.png', NULL, '2019-05-24 04:44:45', '2019-05-24 04:44:45'),
(146, 'Jump starter kit with air Compressor', 'jump-starter-kit-with-air-compressor', '0', NULL, 0, 'In Stock', 'Upgraded high power Car Jump Starter.', '12,000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'JUMPK2', 'Others', '0', NULL, '<p>There is nothing as embarrassing as being stuck in the Middle of the road due to low battery issues with absolutely no forthcoming help. This <strong>50,800 mAh </strong>Car Jump starter with get you out of that situation and do much more as indicated below.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>It can start ANY 12V car</li>\r\n	<li>New upgraded highest capacity in the market: 50800mAh</li>\r\n	<li>4 alarm lights,2 USB connectors, meet your multiple needs for charging phone, laptop.</li>\r\n	<li>Hammer in the front, play an important role when emergency escape.</li>\r\n	<li>Used as torch, guide you to the right direction when camping,climbing or hiking in evening.</li>\r\n	<li>SOS flashlight, never feel helpless in urgency.</li>\r\n	<li>Anti-slip design, clutch it with no worry even in the hot summer.</li>\r\n	<li>Plastic case package: easy carry, easy storage.</li>\r\n	<li>High capacity with high power polymer battery is adopted for fast charging.</li>\r\n	<li>It can support an emergency jump start and entirely replace the included battery for a car startup.</li>\r\n	<li>It also supports general cellular phones/laptops charging and completely replaces products similar to mobile power banks.</li>\r\n	<li>With true powerful flashlight , three-function switch-over, emergency rescue, signaling lighting,deterrence, defense and other powerful features</li>\r\n	<li>it is the ideal choice for night shift workers, overtime workers and many others.</li>\r\n	<li>Four levels of power display indicate battery status, real-time recharging reminders, automatic shutdown under no-load condition.</li>\r\n	<li>Over-current protects the device from overload, making it more convenient, safer and more energy-efficient.</li>\r\n	<li>Battery capacity: 50,800 mAh</li>\r\n	<li>LED illumination light with 4 alarm lights, voltage output indicator and battery indicator.</li>\r\n	<li>Electrical quantity indicator light. Key switch, Master switch.</li>\r\n	<li>Emergency safety hammer</li>\r\n	<li>Emergency seat belt cutting knife</li>\r\n	<li>12V / 16V / 19V voltage output indicator lights</li>\r\n	<li>12V / 16V / 19V --- 2A / 3A / 3.5A output</li>\r\n	<li>4 USB output:5V / 1-2.1A</li>\r\n	<li>Charge input: 12V - 1A</li>\r\n	<li>Starting current: 200-300A</li>\r\n	<li>Peak Current: 600A</li>\r\n	<li>Battery life: 3000 circles</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1 x Car jump starter 50800mAh</li>\r\n	<li>1 x Pair Battery clamps</li>\r\n	<li>1 x Car charger</li>\r\n	<li>1 x Power adapter</li>\r\n	<li>1 x Notebook adapter cable</li>\r\n	<li>8 x Notebook adapter connector</li>\r\n	<li>1 x Mobile phone adapter cable</li>\r\n	<li>1 x User manual</li>\r\n	<li>1x Plastic carrying case</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Jump-starter-kit-with-air-Compressor-fb_pixels.png', 5068, 'Jump-starter-kit-with-air-Compressor-thumbnail.png', 'Jump-starter-kit-with-air-Compressor-001.png', NULL, 'CAR-JUMP-STARTER-KIT-WITH-AIR-COMPRESSOR-50800MAH-002.jpg', 'Jump-starter-kit-with-air-Compressor-003.png', NULL, '2019-05-24 04:46:29', '2019-05-24 04:46:29');
