(148, 'industrial Power Supply unit (PSU) 12', 'industrial-power-supply-unit-psu-12', '0', NULL, 0, 'In Stock', 'Industrial power supply unit', '6000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'PSU6', 'Others', '0', NULL, '<p><strong>Power supply unit</strong>&nbsp;for home or industrial use. It converts power from&nbsp;<strong>&nbsp;AC to DC</strong><br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>High efficiency</li>\r\n	<li>Long life and high reliability</li>\r\n	<li>Low DC ripple</li>\r\n	<li>High efficiency</li>\r\n	<li>Low operation temperature</li>\r\n	<li>Long performance life</li>\r\n	<li>Excellent insulation property</li>\r\n	<li>High dielectric strength</li>\r\n	<li>100% full-load burning test</li>\r\n	<li><em><strong>INPUT:</strong></em></li>\r\n	<li>AC input voltage range (V): AC 170~250V</li>\r\n	<li>Input current (A):17.5A / 230V</li>\r\n	<li>Frequency (Hz): 50/60Hz;</li>\r\n	<li>Efficiency: 85% Type(230V AC Full Load)</li>\r\n	<li>Inrush current(A): 60A/230V cold start</li>\r\n	<li>Leakage current(mA): &lt;3.5mA/240V AC</li>\r\n	<li><strong><em>OUTPUT:</em></strong></li>\r\n	<li>Output Voltage(V): 12V DC;</li>\r\n	<li>Voltage Regulation: &plusmn;10%;</li>\r\n	<li>Output Current(A): 50A;</li>\r\n	<li>Current Range (A): 0~50A;</li>\r\n	<li>Rated Power(W): 600W;</li>\r\n	<li>Start Time, Hold-up Time(ms): Ton&le;150ms,Td&ge;26ms @230V ac Full Load</li>\r\n	<li>Rise Time(ms): 12ms @230Vac Full Load</li>\r\n	<li>Ripple/Noise(mVp-p): 150mVp-p.</li>\r\n	<li><strong><em>PROTECTION:</em></strong></li>\r\n	<li>Over Voltage Protection: &gt;115%~135% Rated output voltage;</li>\r\n	<li>Over Load Protection: &gt;105%~150% Auto recovery;</li>\r\n	<li>Short Circuit Protection: Latched.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Power Supply Unit 12V 50A</li>\r\n</ul>\r\n\r\n<p>&