(149, 'Boschmann EQX-75 PRO Audio Equalizer', 'boschmann-eqx-75-pro-audio-equalizer', '0', NULL, 0, 'In Stock', 'Professional Parametric  Equalizer', '3500', 500, '10', NULL, NULL, 1, 1, 0, 1, 'EQX-75PRO', 'BOSCHMANN', '0', NULL, '<ul>\r\n	<li>\r\n	<p>Boschmann <strong>EQX-75PRO</strong> gives you the best sound quality in your car with the<strong> 7-Band</strong> and Pre-amp Equalizer.<br />\r\n	This equalizer modifies interior sound to perfection. Install the 7 bands Boschmann equalizer in your car audio system, to produce the best listening experience.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>Professional Parametric Equalizer with Low Pass Cross-Over</li>\r\n		<li>Sub woofer Output and Control</li>\r\n		<li>13 Volts Peak line driver</li>\r\n		<li>Two Backlight Illumination Red/Green</li>\r\n		<li>Transparent Top Cover Panel</li>\r\n		<li>One-Half Din Size Chassis</li>\r\n		<li>Black chassis only</li>\r\n	</ul>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>What&rsquo;s in the box?</strong>\r\n\r\n	<ul>\r\n		<li>Professional Parametric Equalizer EQX-75 PRO</li>\r\n		<li>Fittings as per manufacturer</li>\r\n		<li>User Manual</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Boschmann-EQX-75-PRO-Audio-Equalizer-fb_pixels.png', 894, 'Boschmann-EQX-75-PRO-Audio-Equalizer-thumbnail.png', 'Boschmann-EQX-75-PRO-Audio-Equalizer-001.png', NULL, 'Boschmann-EQX-75-PRO-Audio-Equalizer-002.png', NULL, NULL, '2019-05-24 04:53:33', '2019-05-24 04:53:33'),
(150, '5 Way Crossover ABB-5DXi', '5-way-crossover-abb-5dxi', '0', NULL, 0, 'In Stock', 'Pro Audio Bank Crossover Aab-5dxi', '7000', 500, '10', NULL, NULL, 0, 0, 0, 0, '5CrossX', 'Others', '0', NULL, '<p>What is an automotive sound<strong> crossover</strong> for?<br />\r\n<br />\r\nEach speaker efficiently plays back a certain type of sound. Sub woofers reproduce bass, mid-woofers, <strong>bass mid-high</strong> and<strong> treble</strong> drivers, super high treble tweeters and so on. For them to perform fully, it is necessary to &quot;reach&quot; only the &quot;part&quot; of the sound that it can reproduce, such as reaching the sub woofers for the bass only.<br />\r\n&nbsp;</p>\r\n\r\n<p>The Automotive Sound Crossover serves to <strong>separate</strong> the types of <strong>sounds</strong> in tracks, directing them correctly to each type of speaker, so that the whole system has better quality and power, also reducing the risk of burning the speakers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>18db Active Cross Over Network</li>\r\n	<li>Bass Level Wired Remote Control-5m</li>\r\n	<li>Independent Output Level Controls</li>\r\n	<li>Dual Input On/Off Switch</li>\r\n	<li>S/N&nbsp; Ratio:110db</li>\r\n	<li>Channel Separation:85db</li>\r\n	<li>Sub woofer Low Pass;40hz-400hz Variable</li>\r\n	<li>Variable 0-18db Bass Boost&nbsp; @40hz-400hz</li>\r\n	<li>18db Subsonic Filter On/Off Switch</li>\r\n	<li>Phase Inversion0/180 Switch</li>\r\n	<li>Rear High/Band/Low Pass Mode Capability</li>\r\n	<li>Rear high Pass:65hz-4.5khz Variable</li>\r\n	<li>Rear Low Pass: 300hz-4.8khz Variable</li>\r\n	<li>Front High Pass:35hz-400hz Variable With Frequency Multiplier(*1,*20)</li>\r\n	<li>Silver Plated RCA And Power terminals</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Cross Over</li>\r\n	<li>Wiring Cables</li>\r\n	<li>Screws</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '5-Way-Crossover-ABB-5DXi-fb_pixels.png', 894, '5-Way-Crossover-ABB-5DXi-thumbnail.png', '5-Way-Crossover-ABB-5DXi-001.png', NULL, '5-Way-Crossover-ABB-5DXi-002.png', '5-Way-Crossover-ABB-5DXi-003.png', NULL, '2019-05-24 04:56:11', '2019-05-24 04:56:11'),
(151, '2 -din Car Radio Toyota Side bracket', '2-din-car-radio-toyota-side-bracket', '0', NULL, 0, 'In Stock', 'Side spacers Cover 0.5 inch on either side of the radio during installation', '1000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'SDS', 'Others', '0', NULL, '<p>These are the parts you need if you want to change the radio head unit in your Toyota car<strong> year&nbsp;2003 - 2012 Onward.</strong></p>\r\n\r\n<p>They are left and right brackets to suit Toyota vehicles double din Radio.<br />\r\nToyota side fascia brackets fill<strong> left </strong>and <strong>right</strong>-hand side gaps enabling for neat Toyota Radio replacement.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The holes in the side face of these spacers line up with the holes in the original metal cradle.</li>\r\n	<li>You can use these with a single din head unit - as shown - or with a double din unit.</li>\r\n	<li>Most double din units can fit straight into the metal cradle.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Ensure Radio Installations look neat.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>A pair Side spacers</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '932-fb_pixels.png', 8236, 'Double-din-Car-Radio-Toyota-Side-brac-thumbnail.png', 'Double-din-Car-Radio-Toyota-Side-brac-001.png', NULL, 'Double-din-Car-Radio-Toyota-SIDE-SPACERS-002.jpg', 'Double-din-Car-Radio-Toyota-Side-brac-003.png', NULL, '2019-05-24 04:58:20', '2019-05-24 04:58:20'),
(152, 'Single Din Car Radio Pocket Spacer', 'single-din-car-radio-pocket-spacer', '0', NULL, 0, 'In Stock', 'One Din Car Radio strorage spacer.', '500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'PSP', 'Others', '0', NULL, '<p>This<strong> Pocket Spacer </strong>or <strong>Storage box</strong> is used during the replacement of a factory-made radio with one Din sized aftermarket car radio on most Vehicles.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>Item Type: Fascia Pocket</li>\r\n	<li>Model Name: Use to fill the gap left when you install a one din Car Radio</li>\r\n	<li>Material Type: ABS</li>\r\n	<li>Color Name: Black</li>\r\n	<li>Placement: Dashboard</li>\r\n	<li>Type:1DIN</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pocket Spacer</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 8236, 'Single-Din-Car-Radio-Pocket-Spacer-thumbnail.png', 'Single-Din-Car-Radio-Pocket-Spacer-001.png', NULL, 'SINGLE-DIN-CAR-RADIO-POCKET-SPACER-002.jpg', 'Single-Din-Car-Radio-Pocket-Spacer-003.png', NULL, '2019-05-24 04:59:42', '2019-05-24 04:59:42'),
