(155, 'Car Music System Wiring Kit', 'car-music-system-wiring-kit', '0', NULL, 0, 'Out of Stock', 'pure copper amplifier power cable', '2000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'WIRINGK', 'Others', '0', NULL, '<p>This <strong>wiring kit set </strong>consists of quality Speaker wire, sub woofer Wire , Amplifier wire and fuse with holder suitable for a full set up car music installation.<br />\r\n<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>Power cable: Copper 8GA wire</li>\r\n	<li>Power cable length: 5m</li>\r\n	<li>Earth wire: 0.5m</li>\r\n	<li>RCA interconnect cable: 5m</li>\r\n	<li>Control cable: 5m</li>\r\n	<li>Fuse holder size: approx. 8.5 * 4.2 * 2.1cm / 3.3 * 1.6 * 0.8in</li>\r\n	<li>Fuse Maximum current: 60A</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>What&rsquo;s in the Package?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>1 * Power cable</li>\r\n	<li>1 * Earth wire</li>\r\n	<li>1 * Control cable</li>\r\n	<li>1 * RCA interconnect cable</li>\r\n	<li>1 * Fuse holder</li>\r\n	<li>1 * Bag of terminals</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 8236, 'Car-Music-System-Wiring-Kit-thumbnail.png', 'Car-Music-System-Wiring-Kit-001.png', NULL, 'CAR-MUSIC-SYSTEM-WIRING-KIT-002.jpg', 'Car-Music-System-Wiring-Kit-003.png', NULL, '2019-05-24 05:03:48', '2019-05-24 05:03:48'),
(156, 'Gauge Pro Series Amplifier Power Cabl', 'gauge-pro-series-amplifier-power-cabl', '0', NULL, 0, 'In Stock', '10 Gauge Clear Red Power Wire 100 ft. Sold per meter', '200', 500, '10', NULL, NULL, 0, 0, 0, 0, 'POWERC', 'Others', '0', NULL, '<p>This<strong> Oxygen-free copper</strong> power wire is of excellent quality. It comes on a very handy 100ft reel so you can pull off as much as you need. Perfect for professional installers or an install project with multiple power needs.<br />\r\n&nbsp;&nbsp;<br />\r\n<strong>Key features</strong></p>\r\n\r\n<ul>\r\n	<li>Sold as per 1 meter = 3.2 Feet</li>\r\n	<li>Cable length cut to order quantity</li>\r\n	<li>Maximum flexibility for easy installation</li>\r\n	<li>Exceeds AWG (American Wire Gauge) requirements</li>\r\n	<li>Pure Crystal-Oxygen Free Copper (PC-OFC)</li>\r\n	<li>High-quality matte insulation that is oil and extreme temperature resistant</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Package?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>10 gauge amplifier power cable</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 5613, 'Gauge-Pro-Series-Amplifier-Power-Cabl-thumbnail.png', 'Gauge-Pro-Series-Amplifier-Power-Cabl-001.png', NULL, 'GAUGE-PRO-SERIES-AMPLIFIER-POWER-CABLE-002.jpg', NULL, NULL, '2019-05-24 05:06:00', '2019-05-24 05:06:00'),
(157, 'RCA Jack Connectors', 'rca-jack-connectors', '0', NULL, 0, 'In Stock', 'Gold plated Equalizer RCA Jacks.', '200', 500, '10', NULL, NULL, 0, 0, 0, 0, 'RCA', 'Others', '0', NULL, '<ul>\r\n	<li>\r\n	<p>An <strong>RCA connector</strong> is designed to carry audio or video signals. This connector has an all-metal construction with a <strong>gold finish</strong>.<br />\r\n	<br />\r\n	It can be used to make a custom length of RCA cables or repair existing cables. The strain relief spring and <strong>corrosion-resistant </strong>make this connector an excellent choice for home users or professionals.</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key features</strong>\r\n\r\n	<ul>\r\n		<li>RCA plug (male)</li>\r\n		<li>Fits 12 AWG or smaller cable</li>\r\n		<li>Solder style</li>\r\n		<li>Metal housing</li>\r\n		<li>Gold-plated</li>\r\n		<li>Strain relief</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the package?</strong>\r\n\r\n	<ul>\r\n		<li>RCA Connectors &ndash; 4 pcs</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'RCA-Jack-Connectors-fb_pixels.png', 5613, 'RCA-Jack-Connectors-thumbnail.png', 'RCA-Jack-Connectors-001.png', NULL, 'RCA-JACK-CONNECTORS-002.jpg', 'RCA-Jack-Connectors-003.png', NULL, '2019-05-24 05:07:37', '2019-05-24 05:07:37'),
