(162, 'Universal Car Smart Phone Holder', 'universal-car-smart-phone-holder', '0', NULL, 0, 'In Stock', 'phone holder With long goose neck arm, 360 degrees rotation', '800', 500, '10', NULL, NULL, 0, 0, 0, 0, 'PHD1', 'Others', '0', NULL, '<p>This is a<strong> 3 in 1</strong> Car mount <strong>smartphone holder</strong> with 3 mounting options: Air Vent, Dashboard &amp; Wind Screen.<br />\r\nIts made out of long lasting<strong> ABS </strong>material for durability and firm gripping.<br />\r\n<br />\r\n<strong>key features</strong></p>\r\n\r\n<ul>\r\n	<li><em><strong>360&deg; Rotation</strong></em> - Easy adjustment that provides a quick change from portrait to landscape view which is<em> Perfect</em> for optimal viewing. You don&#39;t have to remove your mobile phone from the holder to adjust the orientation!</li>\r\n	<li><strong><em>Extra Long Goose neck arm</em></strong> - Made from heavy-duty material, the length provides convenience for user&#39;s easy reach which helps promote safe driving practices. Its long arm is flexible enough to adjust to any angle, yet super sturdy that it absorbs vibration for a stable viewing environment. Plus, it is so <em>easy to Install</em>. No tools required!</li>\r\n	<li><em><strong>Soft padded mount</strong> </em>- The cushioned grips at the sides, back, and bottom secure the phone on the cradle without scratching your device. An easy one-press button opens the arms up to 4&frac12; inches to allow <em>any </em>size&nbsp;smartphone to fit, even those with bulky cases!</li>\r\n	<li><em><strong>Strong Suction cup</strong></em> - Silica gel vacuum suction offers reliable strength for effortlessly mounting your device firmly and securely to the windshield with its locking mechanism. Removal is a breeze with an added silica arm to help release the suction cup. <em>Plus</em>, additional support is provided with a bracket that holds the arm like a crutch on the dashboard for a more steady under gird.</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Universal Car Phone Holder</li>\r\n	<li>Suction Socket</li>\r\n	<li>Vent Mount</li>\r\n	<li>Dashboard Mount</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 5613, 'Universal-Car-Smart-Phone-Holder-thumbnail.png', 'Universal-Car-Smart-Phone-Holder-001.png', '2020-08-1019:59:13image3in1CarMountUniversalcarmountforsmartphone.png', 'Universal-Car-Smart-Phone-Holder-002.png', 'Universal-Car-Smart-Phone-Holder-003.png', NULL, '2019-05-24 05:13:12', '2019-05-24 05:13:12'),
(163, 'Universal Car Smart Phone Holder', 'universal-car-smart-phone-holder', '0', NULL, 0, 'Out of Stock', 'Windshield install phone holder, 360 degrees rotation', '1000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'PHD2', 'Others', '0', NULL, '<p>Hold your smartphone safe and secure in your car. This <strong>Car Smartphone holder</strong> is designed to make car journeys more enjoyable and hassle-free.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><em><strong>360&deg; Rotation </strong></em>- Easy adjustment that provides a quick change from portrait to landscape view which is Perfect for optimal viewing. You don&#39;t have to remove your mobile phone from the holder to adjust the orientation!</li>\r\n	<li><em><strong>Easy to Install </strong></em>- No tools required!</li>\r\n	<li><em><strong>Soft Padded Mount&nbsp;</strong></em>- The cushioned grips at the sides, back, and bottom secure the phone on the cradle without scratching your device. An easy one-press button opens the arms up to 4&frac12; inches to allow any size smartphone to fit, even those with bulky cases!</li>\r\n	<li><em><strong>Strong Suction Cup&nbsp;</strong></em>- Silica gel vacuum suction offers reliable strength for effortlessly mounting your device firmly and securely to the windshield with its locking mechanism. Removal is a breeze with an added silica arm to help release the suction cup. <em><strong>Plus</strong></em>, additional support is provided with a bracket that holds the arm like a crutch on the dashboard for a more steady under gird</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Universal Car Phone Holder</li>\r\n	<li>Suction Socket</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 5613, 'Universal-Car-Smart-Phone-Holder-thumbnail.png', 'Universal-Car-Smart-Phone-Holder-001.png', NULL, 'Universal-Car-Smart-Phone-Holder-002.png', NULL, NULL, '2019-05-