(167, 'Car Audio Power Capacitor 4.0 FARAD', 'car-audio-power-capacitor-40-farad', '0', NULL, 0, 'In Stock', 'High Performance Digital power Capacitor', '6000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'PCAP', 'Others', '0', NULL, '<ul>\r\n	<li><strong><em>What Is A Capacitor?</em></strong> A capacitor is a passive (it consumes but does not produce energy) two-terminal electrical component. In building a sound system for your car, you would want to use a capacitor for a couple of different reasons.\r\n	<p><em><strong>Why Do I Need One? </strong></em>The main reason a capacitor is recommended is for power reserve. The capacitor stores energy and releases it very quickly to the amplifier(s).<br />\r\n	&nbsp;<strong><em>How does this help?</em></strong> Music is dynamic, no matter what type you listen to. The dynamics in musical content can vary from soft voices to thundering bass notes. These moments are when the benefit of having a capacitor is heard. The<strong> amplifier </strong>requires a <strong>constant amount of steady</strong> <strong>power</strong> to function efficiently and power the speakers. A capacitor will keep the power going to the amplifier consistent and stabilized, which means a better sounding system.<br />\r\n	<em>Important: </em>The remote output of the head unit is connected to the remote turn-on of the capacitor. The capacitor will not function if the remote wire is not connected</p>\r\n\r\n	<p>&nbsp;</p>\r\n	<strong>Key Features</strong>\r\n\r\n	<ul>\r\n		<li>4.0 Farad Neon Digital Capacitor</li>\r\n		<li>4 Digit Red LED Voltage Display</li>\r\n		<li>Polarity Protection and Buzzer</li>\r\n		<li>Over or Under-voltage Buzzer</li>\r\n		<li>Clear Plastic Protective Terminal Cover</li>\r\n		<li>Platinum Plated Terminals</li>\r\n		<li>Quad Hex Shape</li>\r\n		<li>DC 12V- 16v Volt</li>\r\n		<li>Surge volt DC 20v</li>\r\n		<li>Aluminum Case Gift Box With Front Glass Display</li>\r\n		<li>Mounting Hardware Included</li>\r\n		<li>Audible warning tone for reverse polarity</li>\r\n		<li>Audible warning tone for low battery voltage</li>\r\n		<li>Audible warning tone for VOLTAGE OVERLOAD</li>\r\n	</ul>\r\n	<strong>What&rsquo;s in the Box?</strong>\r\n\r\n	<ul>\r\n		<li>Digital power capacitor</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Car-Audio-Power-Capacitor-4.0-FARAD-fb_pixels.png', 8526, 'Car-Audio-Power-Capacitor-4.0-FARAD-thumbnail.png', 'Car-Audio-Power-Capacitor-4.0-FARAD-001.png', NULL, 'HIGH-PERFORMANCE-CAR-AUDIO-POWER-CAPACITOR-4.0-FARAD-002.jpg', NULL, NULL, '2019-05-24 05:19:08', '2019-05-24 05:19:08'),
(168, 'Pioneer CD-SR110 Steering Buttons', 'pioneer-cd-sr110-steering-buttons', '0', NULL, 0, 'In Stock', 'Steering wheel control Device for Pioneer Radio.', '3500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'CD-SR110', 'Pioneer', '0', NULL, '<p>Keeping your Eyes On the road is simple with the optional<strong> </strong>Cd-Sr110 <strong>Steering Wheel Remote</strong> Control.<br />\r\n<br />\r\nThe remote can be mounted right onto the Steering Wheel with the supplied strap so you have control of the most <strong>frequently</strong> used <strong>features </strong>of the <strong>Audio system </strong>at your Fingertips.&nbsp; Control the Volume, Mute, Source Selection (Am, FM, Cd, Etc.), Up/Down/Left/Right Cursors, and Audio settings. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>The Cd-Sr110 is<strong> compatible</strong> with most DEH, AVH &amp; MVH Pioneer receiver models that are remote-capable.</p>\r\n\r\n<p>Steering Wheel Remote with&nbsp;<strong>Bluetooth</strong>. Apart from enabling player Or Navigation System, This Steering Wheel Remote Also Enables You To Control Bluetooth Functionality. You Can<strong> Pick Up</strong> and <strong>Hang Up</strong> With the Touch of the Remote.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Remote Control</li>\r\n	<li>Mount,</li>\r\n	<li>Two Straps</li>\r\n	<li>Lithium Battery (Cr2032)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-CD-SR110-Steering-Buttons-fb_pixels.png', 8526, 'Pioneer-CD-SR110-Steering-Buttons-thumbnail.png', 'Pioneer-CD-SR110-Steering-Buttons-001.png', NULL, 'Pioneer-CD-SR110-Steering-Wheel-Remote-Control-002.jpg', NULL, NULL, '2019-05-24 05:20:16', '2019-05-24 05:20:16'),
