(277, 'Pioneer Ts-r1651s Door Speakers', 'pioneer-ts-r1651s-door-speakers', '0', NULL, 0, 'In Stock', '6.5 inch 300 watts car speakers.', '2999', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-R1651S', 'Pioneer', '0', NULL, '<div>Pioneer<b> TS-R1651S</b> Car speakers are <b>3-way</b> coaxial speakers mostly installed on the car doors. <br><br>Boasting a maximum power output of <b>300 watts</b>, this are high-performance speakers.</div><div><br></div><div><b>Key Features</b><br></div><ul><li>6.5\" Speaker Size</li><li>Maximum Power Output 300 Watts</li><li>Nominal power output 40 Watts</li><li>Frequency Response 30Hz\r\nto 18kHz</li><li>Impedance 4 Œ©</li><li>Sensitivity 90dB</li></ul><div><b>What\'s in the Box?</b></div><div><ul><li>2 X TS-R1651S Speakers</li><li>Power Cables</li><li>User Manual</li></ul></div><br><br>', NULL, 895, 'Pioneer-Ts-r1651s-Door-Speakers-thumbnail.png', 'Pioneer-Ts-r1651s-Door-Speakers-001.png', NULL, 'Pioneer-Ts-r1651s-Door-Speakers-002.jpeg', 'Pioneer-Ts-r1651s-Door-Speakers-003.svg', NULL, '2019-07-29 13:46:19', '2019-07-29 13:46:19'),
(278, 'Car Sub woofer with 1400W Max power', 'car-sub-woofer-with-1400w-max-power', '0', NULL, 0, 'In Stock', 'Pioneer TS-W311S4 Dual magnet subwoofer with powerful bass', '8500', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-W311S4', 'Pioneer', '0', NULL, '<p><strong>Built tough for solid bass&nbsp; </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pioneer&#39;s TS-W311S4 12&quot; subwoofer is built to take it as well as dishing it out. This Pioneer Champion Series sub features a ribbed cone that&#39;s injection-molded for exceptional precision and strength. A double-layered elastic polymer surround supports the woofer during cone excursion so you&#39;ll get right-on, hard-hitting bass notes even when the music&#39;s turned up loud. Wire a pair of these in parallel and they&#39;re a great match for a mono amplifier.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Add some <strong>boom</strong> to your daily drive If your vehicle&#39;s audio system is sounding a little thin, this Pioneer sub can remedy that situation, bringing out all the punch and power in your music by filling in the lowest frequencies of the sound spectrum.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Throw one or two of these subs in your daily ride, power them up with a nice amp, and you&#39;ll understand what the fuss is all about &mdash; whatever you listen to, great bass will make it sound much, much better.To drive this single sub-woofer,we recommend a 1000 watts 4 channel Pioneer Amplifier. <a href=\"https://www.amanivehiclesounds.co.ke/product/PIONEER%20GM-A6704%204%20CHANNEL%20AMPLIFIER\" target=\"\">https://www.amanivehiclesounds.co.ke/product/PIONEER%20GM-A6704%204%20CHANNEL%20AMPLIFIER</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>12&quot; 4-ohm subwoofer</li>\r\n	<li>IMPP composite seamless cone</li>\r\n	<li>2-layer fiber-reinforced elastic polymer surround</li>\r\n	<li>stamped steel basket</li>\r\n	<li>power handling: 400 watts RMS</li>\r\n	<li>peak power handling: 1,400 watts</li>\r\n	<li>frequency response: 20-125 Hz</li>\r\n	<li>sensitivity: 95 dB</li>\r\n	<li>top-mount depth: 6&quot;</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Pioneer Ts-w311s4 speaker</li>\r\n	<li>User Manual</li>\r\n	<li>sealing Rubber</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 2833, 'Car-Sub-woofer-with-1400W-Max-power-thumbnail.png', 'Car-Sub-woofer-with-1400W-Max-power-001.png', NULL, 'Car-Sub-woofer-Pioneer-TS-W311S4--Max-Power-1400-Watts-002.jpg', NULL, NULL, '2019-07-30 14:59:45', '2019-07-30 14:59:45'),
(279, 'Champion series Pioneer Bass Speaker', 'champion-series-pioneer-bass-speaker', '0', NULL, 0, 'In Stock', 'TS-W300D4 Pioneer Car Subwoofer', '6499', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-300D4', 'Pioneer', '0', NULL, '<div>The new Pioneer Champion Series Subwoofer&nbsp;\r\n PRO TS-W300D4 delivers the chest-pounding bass you expect from a 12‚Äù \r\nsubwoofer. Its rugged construction enables it to handle up to 600 watts \r\nRMS without a problem, for performance you can count on. This sub offers\r\n the versatility of dual 4-ohm voice coils (DVC) and the ability to work\r\n in a sealed or ported enclosure, so it‚Äôll fit right in your system, no \r\nmatter what type of bass you like</div><div><br></div><div><b>Key features</b></div><br><ul><li>12‚Ä≥ subwoofer with dual 4-ohm voice coils</li><li>IMPP composite seamless woofer cone with dual-layer elastic polymer surround</li><li>spring-loaded speaker terminal posts</li><li>frequency response: 20-80 Hz</li><li>power handling: 100-600 watts RMS</li><li>peak power: 1200 watts</li><li>sensitivity: 96 dB</li><li>top-mount depth: 6-9/10‚Ä≥</li><li>sealed box volume: 0.85 cu. ft</li><li>ported box volume: 1.75 cu. ft</li></ul><div><b>What\'s in the Box?</b></div><div><ul><li>Pioneer TS-W300D4 Bass Speaker</li><li>User Manual<br></li></ul></div><br>', NULL, 2833, 'Champion-series-Pioneer-Bass-Speaker-thumbnail.png', 'Champion-series-Pioneer-Bass-Speaker-001.png', NULL, 'Champion-series-Pioneer-Bass-Speaker-002.png', NULL, NULL, '2019-07-30 15:25:23', '2019-07-30 15:25:23'),
