(289, 'Pioneer  TS-A1680F Door Speakers.', 'pioneer-ts-a1680f-door-speakers', '323', NULL, 0, 'In Stock', '350 Watts High performance door speakers with 80W RMS Power.', '6499', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-A1680F', 'Pioneer', '0', NULL, 'The Pioneer&nbsp;<b>Ts-A1680F 6.5\"</b>&nbsp;Speakers are designed to replace the vehicles factory-installed speakers and produce improved sound quality at an exceptional value.<br><br>The A-Series door speakers&nbsp;offer&nbsp;<b>improved&nbsp;</b>bass and dynamic range, higher power handling,&nbsp;and a new cosmetic design.<br><br><b>Key Features</b><br><b></b><ul><li>6.5\" in Size</li><li>Max power output of 350 Watts</li><li>RMS Power 80 Watts</li><li>3 Way</li><li>Carbon and mica reinforced IMPP woofer cone<br></li></ul><b>What\'s in the Box?</b><br><ul><li>A pair of Pioneer TS-A1680F Door Speakers&nbsp;</li><li>Speaker Spacers</li><li>Wiring Cables</li></ul><br><b><br><br></b><b><br></b>', NULL, 895, 'Pioneer--TS-A1680F-Door-Speakers.-thumbnail.png', 'Pioneer--TS-A1680F-Door-Speakers.-001.png', NULL, 'Pioneer--TS-A1680F-Door-Speakers.-002.png', 'Pioneer--TS-A1680F-Door-Speakers.-003.png', NULL, '2019-12-02 20:35:58', '2019-12-02 20:35:58'),
