(291, 'Pioneer TS-A30S4 1400W Subwoofer', 'pioneer-ts-a30s4-1400w-subwoofer', '0', NULL, 0, 'In Stock', '1400W Car Bass Speaker', '5000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-A30S4', 'Pioneer', '0', NULL, '<p>Get powerful,<strong> punchy Bass</strong> from the Pioneer <strong>TS-A30S4</strong> single Coil Speaker.</p>\r\n\r\n<p>This subwoofer has a peak power handling of <strong>1400 Watts</strong> &amp; Continous power of <strong>400 Watts.</strong><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>12&quot; Speaker Size</li>\r\n	<li>Max power output 1400 Watts</li>\r\n	<li>Nominal Power Output 400 Watts</li>\r\n	<li>Single Voice Coil Speaker</li>\r\n	<li>Frequency response22 H z to 1.6 kH z</li>\r\n	<li>Sensitivity&nbsp;87 dB<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-A30S4 Car Subwoofer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '741-fb_pixels.png', 2833, 'Pioneer-TS-A30S4-1400W-Subwoofer-thumbnail.png', 'Pioneer-TS-A30S4-1400W-Subwoofer-001.png', NULL, 'Pioneer-TS-A30S4-1400W-Subwoofer-002.png', NULL, NULL, '2019-12-02 21:26:48', '2019-12-02 21:26:48'),
(292, 'MVH-S325BT Car Stereo with Bluetooth', 'mvh-s325bt-car-stereo-with-bluetooth', '0', NULL, 0, 'In Stock', 'Car Multimedia Tuner with Dual Bluetooth, Spotify, Smartphone connectivity & Siri Eyes Free.', '8500', 500, '1', NULL, NULL, 0, 1, 0, 0, 'MVH-S325BT', 'Pioneer', '0', NULL, '<p>The Pioneer <strong>MVH-S325BT</strong> Is a Modern Car stereo that allows you to connect two smartphones simultaneously through Bluetooth.<br />\r\n<br />\r\nIn addition to<strong> Bluetooth</strong>, you get to connect your iPhone or Android phone through USB for music playback or charging.<br />\r\n<br />\r\nFor iPhone, you get to enjoy voice control through Siri. You can ask questions or give commands!<br />\r\n<br />\r\nThis Digital Stereo does not play CD&#39;S<br />\r\n<br />\r\n<strong>KEY FEATURES</strong></p>\r\n\r\n<ul>\r\n	<li>FM/AM Radio&nbsp;</li>\r\n	<li>Dual USB Rear &amp; back</li>\r\n	<li>Bluetooth with dual connectivity</li>\r\n	<li>1 RCA Pre-out</li>\r\n	<li>Spotify</li>\r\n	<li>Siri Eyes Free</li>\r\n	<li>USB Direct Control for iPhone/iPod&nbsp;</li>\r\n	<li>Power Output 50W*4</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in The Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer MVH-S325BT</li>\r\n	<li>Microphone</li>\r\n	<li>Power Cable</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One year Warranty</strong></p>', 'MVH-S325BT-Car-Stereo-with-Bluetooth-fb_pixels.png', 505766, 'Pioneer-MVH-S325BT-Car-Stereo-with-Bluetooth-hands-free-Calling.-thumbnail.png', 'Pioneer-MVH-S325BT-Car-Stereo-with-Bluetooth-hands-free-Calling.-001.png', NULL, 'Pioneer-MVH-S325BT-Car-Stereo-with-Bluetooth-hands-free-Calling.-002.png', 'Pioneer-MVH-S325BT-Car-Stereo-with-Bluetooth-hands-free-Calling.-003.png', NULL, '2020-08-06 14:53:24', '2020-08-06 14:53:24'),
(293, 'Sony XAV-1500 Car Radio with weblink cast', 'sony-xav-1500-car-radio-with-weblink-cast', '0', NULL, 1, 'In Stock', 'Enjoy mirrored smartphone contents with WebLink‚Ñ¢ Cast on this Sony car radio.', '22000', 500, '1', NULL, NULL, 0, 0, 0, 1, 'XAV-1500', 'Sony', '0', NULL, '<p><strong>WebLink&trade; Cast</strong> <strong>mirrors your smartphone contents.</strong></p>\r\n\r\n<p>Connect your compatible Apple or Android smartphone to mirror and control it directly from the car audio screen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Anti-glare clear responsive touchscreen.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The anti-glare 6.2&quot; (15.7cm) touchscreen gives you intuitive control over music playback, making phone calls and more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Turn or push to control</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The ergonomic rotary dial makes operation distraction-free.</strong></p>\r\n\r\n<p>Turn it to control volume or push the integrated button to launch sound control menus.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hear music your way .</strong></p>\r\n\r\n<p>Multiple customization options let you adapt the audio experience to your liking. And with the built-in 4 x 55W amplification, music sounds clear even at high volumes.</p>\r\n\r\n<p><strong>Rear&ndash;view camera ready.</strong></p>\r\n\r\n<p>Have a rear camera installed? View its feed through the screen, along with customizable guidelines that help you back in safely.</p>\r\n\r\n<p><strong>Easy installation with a compact rear chassis</strong>.</p>\r\n\r\n<p>Despite its double-DIN display, the rear chassis is far smaller than conventional double-DIN units. This makes for much easier installation, and leaves plenty of room for cabling and other accessories in the space behind the display.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.2 &quot; anti-glare touch display</li>\r\n	<li>Webcast Mirror link for I phone and Android</li>\r\n	<li>Front USB &amp; AUX</li>\r\n	<li>Bluetooth hands free calling and music streaming</li>\r\n	<li>power output 55W*4</li>\r\n	<li>Compact rear chassis for easy installation.</li>\r\n	<li>Rear camera input</li>\r\n	<li>Steering wheel control compatible.(adapter required)</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Whats in The Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Sony Radio</li>\r\n	<li>Power Socket</li>\r\n	<li>User manual</li>\r\n	<li>Microphone</li>\r\n	<li>Remote</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', 'Sony-XAV-1500-Car-Radio-with-weblink-cast-fb_pixels.png', 505766, 'Sony-XAV-1500-Car-Radio-with-weblink-cast-thumbnail.png', 'Sony-XAV-1500-Car-Radio-with-weblink-cast-001.png', '2021-06-0707:09:00imageXAV-1500(5).png', 'Sony-XAV-1500-Car-Radio-with-weblink-cast-002.png', NULL, NULL, '2020-08-06 14:57:00', '2020-08-06 14:57:00'),
(294, 'Pioneer Car Reverse Camera', 'pioneer-car-reverse-camera', '0', NULL, 0, 'In Stock', 'HD car backup camera with Night Vision', '2500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'RCAM1', 'Pioneer', '0', NULL, '<p>Pioneer<strong> RCAM1 </strong>Car Reverse camera is compatible will all Pioneer Multimedia Receivers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Its simple modest design &amp;<strong> small size</strong> doesn&#39;t draw attention. With this backup camera,you will get a<strong> clear</strong> full sight of the back of your car when reversing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>High Definition 170 degrees wide angle view.</li>\r\n	<li>High Sensitivity &amp; low power Consumption.</li>\r\n	<li>Small size</li>\r\n	<li>High quality</li>\r\n	<li>embedded mounting in rear bumper.</li>\r\n	<li>Waterproof</li>\r\n	<li>Night Vision.</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Mounting Screws</li>\r\n	<li>Power cable</li>\r\n	<li>Reverse camera</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-Car-Reverse-Camera-fb_pixels.png', 6968, 'Pioneer-Car-Reverse-Camera-thumbnail.png', 'Pioneer-Car-Reverse-Camera-001.png', NULL, 'Pioneer-Car-Reverse-Camera-002.png', NULL, NULL, '2020-08-06 15:33:42', '2020-08-06 15:33:42'),
(295, 'Kenwood Powered Subwoofer PA-W801B', 'kenwood-powered-subwoofer-pa-w801b', '0', NULL, 0, 'In Stock', 'Kenwood 400 Watts powered enclosed car sub-woofer.', '27000', 500, '23', NULL, NULL, 1, 0, 0, 0, 'PA-W801B', 'Kenwood', '0', NULL, '<p>The Kenwood <strong>PA-W801B</strong> is a self amplified bass speaker with a maximum power output of<strong> 400 Watts</strong> and a high efficiency <strong>Class D Amplifier</strong> to provide strong deep bass.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The speaker is housed in a compact design down firing ported enclosure with a height of <strong>5-7/8&quot;.</strong> Thus, the speaker can be installed <strong>under the seat</strong> in most vehicles, allowing you to enjoy strong deep bass regardless of space available.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Car Sub-woofer comes with a <strong>detachable power connector</strong> allowing for easy box removal when extra space is needed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>8&quot; sub-woofer in ported enclosure</li>\r\n	<li>Maximum power output 400 watts</li>\r\n	<li>Built in Class D Amplifier</li>\r\n	<li>Wired Remote control</li>\r\n	<li>Speaker level/RCA Input.</li>\r\n	<li>Detachable power connector</li>\r\n	<li>Height 5-7/8&quot;.</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood PA-W801B Powered sub-woofer</li>\r\n	<li>Wiring Harness</li>\r\n	<li>Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty.</strong></p>', '828-fb_pixels.png', 895, 'Kenwood-Powered-Subwoofer-PA-W801B-thumbnail.png', 'Kenwood-Powered-Subwoofer-PA-W801B-001.png', NULL, 'Kenwood-Powered-Subwoofer-PA-W801B-002.png', NULL, NULL, '2020-08-06 15:44:53', '2020-08-06 15:44:53');
