(296, 'Kenwood Boxed Subwoofer KSC-W1200B', 'kenwood-boxed-subwoofer-ksc-w1200b', '0', NULL, 0, 'In Stock', '12 Inch enclosed Kenwood subwoofer with 1200 watts power output.', '16000', 500, '4', NULL, NULL, 1, 0, 0, 0, 'KSC-W1200B', 'Kenwood', '0', NULL, '<p>Kenwood KSC-W1200B box type passive subwoofer boasts a maximum power output of&nbsp;<strong>1200 Watts</strong>&nbsp;and&nbsp;<strong>300 watts RMS&nbsp;</strong>power.<br />\r\n<br />\r\nTo get the most out of this subwoofer, add a powerful Kenwood Amplifier.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Non ported Subwoofer box</li>\r\n	<li>300mm speaker</li>\r\n	<li>1200W Peak input power</li>\r\n	<li>RMS Power 300 watts</li>\r\n	<li>Compact size cabinet</li>\r\n	<li>Two-color embroidery</li>\r\n	<li>Easy to install and remove by quick-release belts.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kenwood 1200 Watts Bass Speaker.</li>\r\n	<li>Fittings as per manufacturer.</li>\r\n	<li>User manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '848-fb_pixels.png', 2833, 'Kenwood-Boxed-Subwoofer-KSC-W1200B-thumbnail.png', 'Kenwood-Boxed-Subwoofer-KSC-W1200B-001.png', NULL, 'Kenwood-Boxed-Subwoofer-KSC-W1200B-002.png', NULL, NULL, '2020-08-06 15:59:32', '2020-08-06 15:59:32'),
(297, 'DRV-330 Kenwood recording Camera', 'drv-330-kenwood-recording-camera', '0', NULL, 0, 'In Stock', 'High Definition, GPS Integrated front Recording stand-alone driver recorder, Dashcam.', '15000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'DVR330', 'Kenwood', '0', NULL, '<p>DRV-330 Is a Compact, Full HD, <strong>GPS integrated</strong>, stand-alone Dashboard Camera that supports up to 32GB micro SD storage.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>2 Megapixels CMOS Image Sensor</li>\r\n	<li>F2.0 Bright &amp; Wide Viewing Angle Lens</li>\r\n	<li>Full HD recording (1920x1080px)</li>\r\n	<li>Normal/incident record &amp; store</li>\r\n	<li>Parking surveillance mode with an optional hardwire kit</li>\r\n	<li>Built-in 3 Axis G-Sensor</li>\r\n	<li>Integrated GP&uml;S</li>\r\n	<li>High Dynamic Range Technology</li>\r\n	<li>Selectable Video Clip length</li>\r\n	<li>Recording on Micro SDHC card Class 6 or higher (max.32GB)</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>DRV-330</li>\r\n	<li>Car Charger Adapter with 3.5m cable</li>\r\n	<li>Car Mount Bracket</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 8526, 'DRV-330-Kenwood-recording-Camera-thumbnail.png', 'DRV-330-Kenwood-recording-Camera-001.png', NULL, 'DRV-330-Kenwood-recording-Camera-002.png', NULL, NULL, '2020-08-06 16:07:04', '2020-08-06 16:07:04'),
(298, 'Car Modulator G7', 'car-modulator-g7', '0', NULL, 0, 'In Stock', 'Car G7 Modulator enables your stock radio to function with Bluetooth,USB & AUX input.', '1500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'CARG7', 'Others', '0', NULL, '<p>The Car G7 Modulator enables you to enjoy<strong> USB</strong>, <strong>Auxiliary </strong>and <strong>Bluetooth</strong> features on your old school car Stereo.&nbsp;<br />\r\nEnjoy handsfree calling on the road by simply pairing your phone with the Bluetooth <strong>FM Transmitter.<br />\r\n<br />\r\nKey Features</strong></p>\r\n\r\n<ul>\r\n	<li>Fast and Safe Charge</li>\r\n	<li>Rated operating voltage: 12V-24V</li>\r\n	<li>Working Voltage limits: 9-26V</li>\r\n	<li>USB Output: 5V/2.5A</li>\r\n	<li>Working Temp: 0-50&deg;</li>\r\n	<li>Play format: MP3 WMA WAV FLV</li>\r\n	<li>Bluetooth hands-Free Calling</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Solid Pin Bluetooth MP3 Player FM Transmitter Car Charger</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 111, 'Car-Modulator-G7-thumbnail.png', 'Car-Modulator-G7-001.png', NULL, 'Car-Modulator-G7-002.png', NULL, NULL, '2020-08-06 16:11:27', '2020-08-06 16:11:27'),
(299, 'TS-WX1210AH 12\" Reflex Sub-woofer', 'ts-wx1210ah-12-reflex-sub-woofer', '0', NULL, 0, 'In Stock', 'Pioneer 1500 watts Powered Sub woofer', '35000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-WX1210AH', 'Pioneer', '0', NULL, '<p>Upgrade your vehicle&#39;s sound system with this easy to install single driver subwoofer package for strong powerful bass, maximum power of <strong>1500 W</strong> and a nominal power of<strong> 500 W</strong>. (Remote control and cables included).&nbsp;<br />\r\n<br />\r\nThe cabinet mechanism and the bass reflex port of the <strong>TS-WX1210AH</strong> are optimized to take advantage of the low-frequency response of a single driver with a 30 cm woofer unit. This enables the original bass reproduction of the device and makes it possible to enjoy a high-quality and powerful heavy bass reproduction. Equipped with a bass boost circuit, it is possible to adjust the sound pressure level and the frequency characteristics. You can adjust your favorite music to your liking.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>12 inch Speaker Size</li>\r\n	<li>Maximum power 1500 Watts</li>\r\n	<li>Nominal Power 500 Watts</li>\r\n	<li>Frequency response&nbsp; &nbsp;20 Hz - 2.9 kHz</li>\r\n	<li>Sensitivity114 dB (in car, 2V) dB</li>\r\n	<li>Impedance0.6 &Omega;</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-WX1210AH Subwoofer</li>\r\n	<li>Fittings per manufacturer</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', '854-fb_pixels.png', 2833, 'TS-WX1210AH-12\"-Reflex-Sub-woofer-thumbnail.png', 'TS-WX1210AH-12\"-Reflex-Sub-woofer-001.png', NULL, 'TS-WX1210AH-12\"-Reflex-Sub-woofer-002.png', NULL, NULL, '2020-08-06 16:26:49', '2020-08-06 16:26:49'),
(300, 'TS-WX1220AH Double bass Reflex Sub', 'ts-wx1220ah-double-bass-reflex-sub', '0', NULL, 0, 'In Stock', '1000 watts Pioneer double powered bass-reflex sub woofer system.', '45000', 500, '23', NULL, NULL, 1, 0, 0, 0, 'TS-WX1220AH', 'Pioneer', '0', NULL, '<p>Upgrade your vehicle&#39;s sound system with this easy to install dual-driver subwoofer package for strong powerful bass, <strong>maximum power of 3000 W</strong> and a <strong>nominal power of 1000 W.</strong> (Remote control and cables included).<br />\r\n<br />\r\n&nbsp;The cabinet mechanism and the bass reflex port of the<strong> TS-WX1220AH</strong> are optimized to take advantage of the low-frequency response of a dual-driver with two 30 cm woofer units. This enables the original bass reproduction of the device and makes it possible to enjoy a high-quality and powerful heavy bass reproduction. Equipped with a bass boost circuit, it is possible to adjust the sound pressure level and the frequency characteristics. You can adjust your favorite music to your liking.<br />\r\n<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>12 inch * 2 Speaker Size</li>\r\n	<li>maximum Power 3000 Watts</li>\r\n	<li>Nominal Power 1000 Watts</li>\r\n	<li>Frequency response20 Hz - 2.9 kHz</li>\r\n	<li>Sensitivity118 dB (in car, 2V) dB</li>\r\n	<li>Impedance0.3 &Omega;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-WX1220AH Powered Subwoofer</li>\r\n	<li>Fitting per manufacturer</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>', '429-fb_pixels.png', 895, 'TS-WX1220AH-Double-bass-Reflex-Sub-thumbnail.png', 'TS-WX1220AH-Double-bass-Reflex-Sub-001.png', NULL, 'TS-WX1220AH-Double-bass-Reflex-Sub-002.png', NULL, NULL, '2020-08-06 16:31:08', '2020-08-06 16:31:08'),
(301, 'Pioneer TS-WX400DA powered subwoofer.', 'pioneer-ts-wx400da-powered-subwoofer', '0', NULL, 0, 'In Stock', 'Compact 250 watts Pioneer  Powered Underseat subwoofer.', '23000', 500, '23', NULL, NULL, 0, 0, 0, 0, 'TS-WX400DA', 'Pioneer', '0', NULL, '<p>Pioneer&#39;s <strong>TS-WX400DA</strong> powered subwoofer brings you deep, <strong>powerful bass</strong> in a truly compact enclosure. At only 4&rdquo; tall, this enclosure is designed to fit into those tight spots in your vehicle such as under a front seat, behind a truck seat, or inside a storage compartment. It&#39;s an excellent solution that allows you to pump up the bass while saving space.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>compact powered subwoofer</li>\r\n	<li>9-1/2&quot; x 5-1/2&quot; sub with polypropylene cone and urethane surround</li>\r\n	<li>built-in amplifier: 100 watts RMS (250 watts peak)</li>\r\n	<li>down-firing design for impressive bass from a small enclosure</li>\r\n	<li>adjustable low-pass filter (50-125 Hz)</li>\r\n	<li>wired remote controls:\r\n	<ul>\r\n		<li>gain</li>\r\n		<li>low-pass filter</li>\r\n		<li>selectable phase control (0&deg;, 180&deg;)</li>\r\n		<li>Bass Mode (Deep/Dynamic)</li>\r\n	</ul>\r\n	</li>\r\n	<li>frequency response: 20-100 Hz</li>\r\n	<li>sensitivity: 100 dB</li>\r\n	<li>dimensions: 11-7/8&quot;W x 4&quot;H x 7-7/8&quot;D</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Powered subwoofer</li>\r\n	<li>Wired remote control with attached 16.25&#39; cable</li>\r\n	<li>16.5&#39; Power Harness w/ inline 10A mini fuse (62&quot; ground lead / 8&quot; RCA input plugs)</li>\r\n	<li>2 Mounting plates</li>\r\n	<li>1 Cable strain-relief bar</li>\r\n	<li>Two 3/4&quot; screws</li>\r\n	<li>Two 1/2&quot; screws</li>\r\n	<li>Two 1/4&quot; screws</li>\r\n	<li>1-1/2&quot; Hook-and-loop fastener pad</li>\r\n	<li>Instruction manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', '982-fb_pixels.png', 895, 'Pioneer-TS-WX400DA-powered-subwoofer.-thumbnail.png', 'Pioneer-TS-WX400DA-powered-subwoofer.-001.png', NULL, 'Pioneer-TS-WX400DA-powered-subwoofer.-002.png', NULL, NULL, '2020-08-06 16:34:15', '2020-08-06 16:34:15'),
(302, 'Pioneer Car Android Tablet.', 'pioneer-car-android-tablet', '0', NULL, 0, 'In Stock', 'SDA-835TAB SPH-T20BT 8-inch Pioneer Car Android Tablet with play Store, inbuilt Bluetooth.', '42000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'SDA-835TAB', 'Pioneer', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In-dash Smart Unit Receiver with 8&quot; Capacitive Android Display, Play Store, Pioneer Smart Sync, Built-in Bluetooth&reg; and Full HD Video Playback from USB Device<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>2</strong> Din Size</li>\r\n	<li>Bluetooth</li>\r\n	<li>USB Playback</li>\r\n	<li><strong>Video Format&nbsp;</strong>H.264 / DivX / XviD / MKV / FLV / MPEG</li>\r\n	<li>Back-Up Camera Ready</li>\r\n	<li>13 Band Equalizer</li>\r\n	<li>Time Alignment</li>\r\n	<li>Pioneer Smart sync</li>\r\n	<li>Waze Compatibility</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer SDA-835TAB &amp; SPH-T20BT</li>\r\n	<li>Fittings per Manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-Car-Android-Tablet.-fb_pixels.png', 505766, 'Pioneer-SDA-835TAB-SPH-T20BT-Car-Android-Tablet.-thumbnail.png', 'Pioneer-SDA-835TAB-SPH-T20BT-Car-Android-Tablet.-001.png', NULL, 'Pioneer-SDA-835TAB-SPH-T20BT-Car-Android-Tablet.-002.png', 'Pioneer-SDA-835TAB-SPH-T20BT-Car-Android-Tablet.-003.png', NULL, '2020-08-06 16:38:37', '2020-08-06 16:38:37'),
(303, 'Ma Audio Powered Subwoofer 12 inch.', 'ma-audio-powered-subwoofer-12-inch', '0', NULL, 0, 'Out of Stock', 'Powered Speaker with 1600 watts peak power.', '16000', 500, '23', NULL, NULL, 0, 0, 0, 0, 'MA10ABS', 'Others', '0', NULL, 'The<b> MA10ABS Bass system</b> is a powered speaker with a built-in \r\nClass AB Monoblock Amplifier, designed to effortlessly produce smooth \r\nsound with dynamic high impact bass that lets you feel the music.<br><br><b>Key Features&nbsp;&nbsp;<br><br></b><ul><li>Maximum Power output 1600 Watts</li><li>RMS Power 400 watts</li><li>12 inch Speaker driver</li><li>Built-in Class A&amp;B monoblock Amplifier</li><li>Computer Engineered and precision-tuned Enclosure.</li></ul><b>What\'s in the Box?</b><br><ul><li>Ma Audio powered Speaker</li><li>Power Socket</li></ul><br>', NULL, 895, 'Ma-Audio-Powered-Subwoofer-12-inch.-thumbnail.png', 'Ma-Audio-Powered-Subwoofer-12-inch.-001.png', NULL, 'Ma-Audio-Powered-Subwoofer-12-inch.-002.png', NULL, NULL, '2020-08-06 16:43:02', '2020-08-06 16:43:02'),
(304, 'Sony XAV-W601 DVD Receiver', 'sony-xav-w601-dvd-receiver', '57', NULL, 0, 'Out of Stock', 'car radio with front USB, DVD player.', '15000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XAV-W601', 'Sony', '0', NULL, 'Set the mode for any journey with powerful rich audio that makes your favorite songs sound even better.<br><br>The Sony<b>&nbsp;XAV-W601</b>&nbsp;has 3 RCA Pre-out, thus you can even add more Amplifiers and Speakers to build your dream In Car Sound system.<br><span>Play Your favorite music through DVD Player, USB &amp; AUX.<br><br><b>Key Features<br></b></span><ul><li>6.2 \" Touch Screen Display</li><li>FM/AM&nbsp;</li><li>DVD Player</li><li>Reverse camera input</li><li>Internal EQ5 Advanced Equalizer</li><li>Get powerful sound with 4 x 55W Dynamic Reality Amp 2</li><li>High pass &amp; Low Pass Filter</li><li>Extra Bass</li></ul><b>Whats In the Box?<br></b><ul><li>Sony XAV-W601</li><li>Power cable</li><li>User Manual</li><li>Remote Control</li></ul><b>One Year Warranty</b><br>', NULL, 505766, 'Sony-XAV-W601-DVD-Receiver-thumbnail.png', 'Sony-XAV-W601-DVD-Receiver-001.png', NULL, 'Sony-XAV-W601-DVD-Receiver-002.png', 'Sony-XAV-W601-DVD-Receiver-003.png', NULL, '2020-08-06 16:53:10', '2020-08-06 16:53:10'),
(305, 'Sony DSX-A110U Affordable car stereo', 'sony-dsx-a110u-affordable-car-stereo', '0', NULL, 0, 'In Stock', 'Sony Affordable car stereo system with excellent FM Reception, USB & AUX Input.', '5500', 500, '1', NULL, NULL, 0, 1, 0, 0, 'DSX-A110U', 'Sony', '0', NULL, '<p>&nbsp; Enjoy powerful sound on the road on the<strong> Sony DSX-A110U</strong> at an Affordable price. EXTRA BASS enhances the beats in your music, while the 4 x 55w amplification gives you all the volume you need. Stream music from your phone easily with the AOA 2.0 compatible <strong>front USB</strong> input or <strong>AUX input</strong>, and customize the sound with the 10-band equalizer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM Radio&nbsp;</li>\r\n	<li>Front USB &amp; AUX Input</li>\r\n	<li>&nbsp;Adjustable 10-band equalizer with karaoke mode</li>\r\n	<li>&nbsp;Power output 55W*4&nbsp;</li>\r\n	<li>EXTRA BASS Mode&nbsp;</li>\r\n	<li>Play music from any app on your Android phone</li>\r\n	<li>&nbsp;Steering Wheel remote input (Adapter Required)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Sony DSX-A110U car radio</li>\r\n	<li>&nbsp;Remote control&nbsp;</li>\r\n	<li>User manual.</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong><br />\r\n<br />\r\n<br />\r\n&nbsp;</p>', 'Sony-DSX-A110U-Affordable-car-stereo-fb_pixels.png', 505766, 'Sony-DSX-A110U-Affordable-car-stereo-thumbnail.png', 'Sony-DSX-A110U-Affordable-car-stereo-001.png', '2020-08-1020:04:56imageSonyDSX-A110U.jpg', 'Sony-DSX-A110U-Affordable-car-stereo-002.png', 'Sony-DSX-A110U-Affordable-car-stereo-003.png', NULL, '2020-08-08 07:26:54', '2020-08-08 07:26:54'),
(306, 'Sony Bluetooth car stereo DSX-A410BT', 'sony-bluetooth-car-stereo-dsx-a410bt', '0', NULL, 0, 'In Stock', 'Car Stereo with dual phone Bluetooth connection', '8000', 500, '1', NULL, NULL, 1, 0, 0, 0, 'DSX-A410BT', 'Sony', '0', NULL, '<p>&nbsp; Keep in touch on the road with <strong>Dual Bluetooth</strong>&reg; connectivity from the DSX-A410BT. Wireless connect your first phone to play music, get directions and communicate with contacts. Add a second phone to make additional hands-free calls on the move.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>FM Radio</li>\r\n	<li>Front USB &amp; AUX Input</li>\r\n	<li>Bluetooth dual phone connection for hands free calling &amp; audio streaming.</li>\r\n	<li>Built in 55W*4 Amplification</li>\r\n	<li>EXTRABASS - Boost the Beat</li>\r\n	<li>Voice Control for Android &amp; Siri for IOS</li>\r\n	<li>10 Band Digital Equalizer to customize your music</li>\r\n	<li>Built in microphone.</li>\r\n</ul>\r\n\r\n<p><strong>What&rsquo;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony DSX-A410BT Car Bluetooth radio</li>\r\n	<li>Wiring harness</li>\r\n	<li>Remote Control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>\r\n</p>\r\n</p>\r\n</p>\r\n</p>\r\n</p>', 'Sony-Bluetooth-car-stereo-DSX-A410BT-fb_pixels.png', 505766, 'Sony-Bluetooth-car-stereo-DSX-A410BT-thumbnail.png', 'Sony-Bluetooth-car-stereo-DSX-A410BT-001.png', NULL, 'Sony-Bluetooth-car-stereo-DSX-A410BT-002.png', NULL, NULL, '2020-08-08 08:01:41', '2020-08-08 08:01:41'),
(307, 'Sony Car Stereo system with Webcast', 'sony-car-stereo-system-with-webcast', '0', NULL, 1, 'In Stock', '9 inch car radio with one din chassis installation , webcast link & 3 way adjustable mount,', '48000', 500, '1', NULL, NULL, 0, 0, 0, 1, 'XAV-AX8000', 'Sony', '0', NULL, '<p><strong>Oversized touchscreen</strong></p>\r\n\r\n<p>A huge anti-glare 22.7 cm (8.95&quot;)&nbsp;display gives you more intuitive and safer control over music playback and smartphone functions</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3-way adjustable mount</strong></p>\r\n\r\n<p>The sturdy mount adjusts in three directions, enabling flexible installation</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Web-link cast compatible</strong></p>\r\n\r\n<p>Web-link is a lightweight app delivery platform designed especially for in-vehicle use. Using the Android or iOS device connection, it is now possible to mirror your smartphone screen right on the XAV-AX8000 display &ndash; for reliable, responsive infotainment anytime on the road.</p>\r\n\r\n<p><br />\r\n<strong>Quick wake up</strong></p>\r\n\r\n<p>With Sony Quick Wake Up, you&#39;re ready to go right after turning on the ignition.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Rear view camera ready</strong></p>\r\n\r\n<p>Have a rear camera installed? View its feed through the screen, along with customizable guidelines that help you back in safely.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>8.95&quot; Anti -glare touch Screen Display</li>\r\n	<li>3 way Adjustable mount.</li>\r\n	<li>Bluetooth with hands Free Calling &amp; Audio streaming.</li>\r\n	<li>Weblink cast Compatible</li>\r\n	<li>Apple Carplay (Wired)</li>\r\n	<li>Android Auto (Wired)</li>\r\n	<li>One Din Installation chassis</li>\r\n	<li>EXTRA BASS&trade; adds low-end power</li>\r\n	<li>Power output 55W*4</li>\r\n	<li>Steering wheel control compatible (Adapter required)</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Sony XAV-AX8000 Car stereo system</li>\r\n	<li>Wiring harness</li>\r\n	<li>Remote control</li>\r\n	<li>User manual.</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Sony-Car-Stereo-system-with-Webcast-fb_pixels.png', 505766, 'Sony-Car-Stereo-system-with-Webcast-thumbnail.png', 'Sony-Car-Stereo-system-with-Webcast-001.png', '2021-06-0708:04:58imageXAV-AX8000(3).png', 'Sony-Car-Stereo-system-with-Webcast-002.png', '9\"-Car-Stereo-system-Sony-XAV-AX8000-with-Webcast-003.png', NULL, '2020-08-08 09:33:01', '2020-08-08 09:33:01'),
(308, 'Sony XS-GTF1639 3 way car Speakers.', 'sony-xs-gtf1639-3-way-car-speakers', '0', NULL, 0, 'In Stock', '270 Watts Maximum power 3 way car door Speakers with 45 watts RMS Power.', '3000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'XS-GTF1639', 'Sony', '0', NULL, '<div>Blast out your favorite driving songs with the <b>XS-GTF1639</b> 3-way \r\nspeakers. Featuring a HOP Aramid Carbon Fiber Matrix  cone woofer for \r\npunchy bass, and high-power handling to pump up the volume without \r\naffecting sound quality.</div><div><br></div><div><b>Key Features</b></div><div><ul><li>16CM/ 6.5\" Size</li><li>Max power output 270 Watts</li><li>RMS Power 45 Watts</li><li>3 way speaker system</li><li>Frequency 55-24,000Hz</li><li>90 dB</li></ul><b>Whats in the Box?</b></div><div><ul><li>Sony XS-GTF1639 Speakers - pair</li><li>Wiring Harness</li><li>User manual<br></li></ul></div><div><br></div><br>', NULL, 895, 'Sony-XS-GTF1639-3-way-car-Speakers.-thumbnail.png', 'Sony-XS-GTF1639-3-way-car-Speakers.-001.png', NULL, 'Sony-XS-GTF1639-3-way-car-Speakers.-002.png', NULL, NULL, '2020-08-08 09:45:32', '2020-08-08 09:45:32'),
(309, 'Pioneer DMH-G225BT 6.2\"screen', 'pioneer-dmh-g225bt-62screen', '0', NULL, 0, 'In Stock', 'Pioneer DMH-G225BT is an affordable car stereo offering the best features with touch screen display, Bluetooth & reverse camera input.', '18000', 500, '1', NULL, NULL, 1, 0, 0, 0, 'DMH-G225BT', 'Pioneer', '0', NULL, '<p><strong>Clear Type Resistive Touch Screen</strong></p>\r\n\r\n<p>Designed for beautiful crisp and detailed display reproduction with enhanced visibility.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bluetooth</strong></p>\r\n\r\n<p>Built-in Bluetooth Wireless Technology makes audio playback and phone call operation comfortable and safe while driving.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Direct Control for Certain Android Phones</strong></p>\r\n\r\n<p>Conveniently control your compatible Android smartphone directly from your car dashboard. Enjoy songs from your music library in superior sound quality, while charging the battery.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7-Band Graphic Equalizer</strong></p>\r\n\r\n<p>Adjust your audio output in detail for a music experience tailored to your preferences.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Reverse Camera-ready</strong></p>\r\n\r\n<p>Reversing can be a stressful experience. The reverse camera input allows you to connect an optional camera for improved safety and peace of mind.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 RCA Pre-outs</strong></p>\r\n\r\n<p>More connection options for your Pioneer headunit.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.2&quot; Touch screen Display</li>\r\n	<li>Front USB &amp; AUX Input (Plays Videos via USB)</li>\r\n	<li>Built in Bluetooth with hands Free calling &amp; audio Streaming.</li>\r\n	<li>Reverse camera Input</li>\r\n	<li>7 Band Internal Equalizer.</li>\r\n	<li>2 RCA Pre-outs</li>\r\n	<li>Steering wheel control compatible (adapter required)</li>\r\n</ul>\r\n\r\n<p><strong>Whats In the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer DMH-G225BT Radio</li>\r\n	<li>Wiring Harness</li>\r\n	<li>User Manual</li>\r\n	<li>remote control</li>\r\n</ul>\r\n\r\n<p><strong>One year warranty</strong></p>\r\n\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;\r\n<p>&nbsp;</p>\r\n</p>\r\n</p>\r\n</p>\r\n</p>', 'Pioneer-DMH-G225BT-6.2\"screen-fb_pixels.png', 505766, 'Pioneer-DMH-G225BT-6.2\"-AV-Receiver-with-Bluetooth.-thumbnail.png', 'Pioneer-DMH-G225BT-6.2\"-AV-Receiver-with-Bluetooth.-001.png', NULL, 'Pioneer-DMH-G225BT-6.2\"-AV-Receiver-with-Bluetooth.-002.png', 'Pioneer-DMH-G225BT-6.2\"-AV-Receiver-with-Bluetooth.-003.png', NULL, '2020-08-08 10:11:02', '2020-08-08 10:11:02'),
(310, 'Pioneer 10\" Shallow Mount Speaker', 'pioneer-10-shallow-mount-speaker', '0', NULL, 0, 'In Stock', 'TS-A2500LB Pioneer 10 inch shallow mount bass Speaker 1200 watts.', '17500', 500, '4', NULL, NULL, 1, 0, 0, 0, 'TS-A2500LB', 'Pioneer', '0', NULL, '<p>Thanks to its innovative enclosure design, the <strong>TS-A2500LB</strong> enclosure can be installed freely in the cabin or luggage area for optimal utilization of space. Compact space-saving dimensions make it easy to install the sub woofer in a variety of trucks- standard-cab, extended-cab, or crew-cab. The enclosure is fully carpeted, creating a non-slip and scratch resistant surface.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>10 Inch Shallow Mount Speaker</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Power 1,200w Max / 300w RMS</li>\r\n	<li>2 ohms Single Voice Coil</li>\r\n	<li>Rubber Surround</li>\r\n	<li>Fully Covered Steel Mesh Grille</li>\r\n	<li>Removable Feet &amp; Cushions</li>\r\n	<li>Carpeted Enclosure with Embroidered Logo</li>\r\n	<li>Enclosure size (WxHxD): 20-7/8&rdquo; W x 5-29/32&rdquo; H x 11-13/16&rdquo; D</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Pioneer TS-A2500LB Enclosed Subwoofer</li>\r\n	<li>Fittings per manufacturer</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '617-fb_pixels.png', 2833, 'Pioneer-10\"-Shallow-Mount-Speaker-thumbnail.png', 'Pioneer-10\"-Shallow-Mount-Speaker-001.png', NULL, 'Pioneer-10\"-Shallow-Mount-Speaker-002.png', NULL, NULL, '2020-08-08 10:24:18', '2020-08-08 10:24:18'),
(311, 'MVH-S215BT  Multimedia Tuner', 'mvh-s215bt-multimedia-tuner', '0', NULL, 0, 'In Stock', 'Car  Bluetooth radio with USB ,AUX Input, android smartphone support.', '8000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'MVH-S21BT', 'Pioneer', '0', NULL, '<p>The<strong> MVH-S215BT </strong> lets you enjoy hands-free calling and audio streaming in the car, courtesy of <strong>built-in Bluetooth</strong>&reg; with internal mic.</p>\r\n\r\n<p>Other entertainment options include a <strong>front USB</strong> input, Aux-In and AM/FM radio.Receive pristine sound from the MVH-S215BT&rsquo;s built-in amplifiers with 4 x 50W of pure MOSFET power. For even more power, you can use the RCA pre-out to hook up an amplifier to provide additional power for speakers or subwoofers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>FM Radio</li>\r\n	<li>USB &amp; AUX Input</li>\r\n	<li>Bluetooth with hands free calling &amp; audio streaming.</li>\r\n	<li>Compatible with android.</li>\r\n	<li>Power output 50w*4</li>\r\n	<li>Red color illumination.</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Pioneer mvh-s215bt</li>\r\n	<li>Wiring harness</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'MVH-S215BT--Multimedia-Tuner-fb_pixels.png', 505766, 'MVH-S215BT--Multimedia-Tuner-with-Bluetooth,-USB-&-Android-Smartphone-support.-thumbnail.png', 'MVH-S215BT--Multimedia-Tuner-with-Bluetooth,-USB-&-Android-Smartphone-support.-001.png', NULL, 'MVH-S215BT--Multimedia-Tuner-with-Bluetooth,-USB-and-Android-Smartphone-support.-002.png', 'MVH-S215BT--Multimedia-Tuner-with-Bluetooth,-USB-&-Android-Smartphone-support.-003.png', NULL, '2020-08-08 10:44:35', '2020-08-08 10:44:35'),
(312, 'Pioneer TS-A6960F Car Speakers', 'pioneer-ts-a6960f-car-speakers', '0', NULL, 0, 'In Stock', '6\"x9\" 4-Way Coaxial Oval car mid-range Speakers with Maximum power 450 Watts', '7000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'TS-A6960F', 'Pioneer', '0', NULL, '<div>Install the high Performance&nbsp; <b>Pioneer TS-A6960F&nbsp;</b> coaxial Speakers with a maximum power output of<b> 450 watts </b>&amp; <b>RMS</b> Power <b>90 Watts</b>. The Speakers come with 6\"*9\"<b> multi-fit installation adapters </b>that expand flexibility and improve acoustic performance.</div><div><br></div><div><b>Key Features</b><br></div><ul><li>6 x 9\" Diameter Size</li><li>Maximum Power Output 450 Watts</li><li>RMS Power 90 Watts</li><li>Frequency range 35 Hz to 24 kHz</li><li>Sensitivity 89 dB (+- 1.5dB)</li><li>Nominal Impedance 4 Ohms</li></ul><div><b>Whats in the Box?</b></div><div><ul><li><b></b>Pioneer TS-A6960F Oval car Speakers.</li><li>Installation adapters</li><li>Wiring Harness</li><li>User Manual</li></ul><br></div><br><br><br><br>', NULL, 895, 'Pioneer-TS-A6960F-Car-Speakers-thumbnail.png', 'Pioneer-TS-A6960F-Car-Speakers-001.png', NULL, 'Pioneer-TS-A6960F-Car-Speakers-002.png', 'Pioneer-TS-A6960F-Car-Speakers-003.png', NULL, '2020-08-08 14:15:04', '2020-08-08 14:15:04'),
(313, 'Kenwood DDX7019BTM AV Receiver', 'kenwood-ddx7019btm-av-receiver', '0', NULL, 0, 'In Stock', 'Enjoy 7 inch Screen display & USB Mirroring for Android or iphone.', '37000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'DDX7019BTM', 'Kenwood', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<h3>Smartphone Connectivity</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; By connecting your smartphone and receiver wirelessly, your driving time will be more fun and convenient</p>\r\n\r\n<h3>The Best Audio Experiences</h3>\r\n\r\n<p>Sound quality enthusiasts will love the playback support of various types of music formats, including compatibility with FLAC files. Simple touch screen sound customization is also available with its built-in 13-Band EQ and Digital Time Alignment.</p>\r\n\r\n<h3>Safe Driving</h3>\r\n\r\n<p>Keeping you safe on the road ahead is our top priority.This is courtesy of Bluetooth hands Free Calling.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>7 inch Touch Screen Display</li>\r\n	<li>Bluetooth With hands Free calling &amp; Audio streaming.</li>\r\n	<li>USB Mirroring Ready for iPhone &amp; Android</li>\r\n	<li>Built-in Bluetooth Dual Phone Connection</li>\r\n	<li>&nbsp;2 Camera Inputs&nbsp;</li>\r\n	<li>Spotify Full Control</li>\r\n	<li>&nbsp;13 Band EQ &amp; Digital Time Alignment</li>\r\n	<li>&nbsp;3 Preouts 4V</li>\r\n	<li>Steering wheel control compatible</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood DDX7019BTM</li>\r\n	<li>Wiring Harness</li>\r\n	<li>Remote control</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Kenwood-DDX7019BTM-AV-Receiver-fb_pixels.png', 505766, 'Kenwood-DDX7019BTM-AV-Receiver-thumbnail.png', 'Kenwood-DDX7019BTM-AV-Receiver-001.png', NULL, 'Kenwood-DDX7019BTM-AV-Receiver-002.png', 'Kenwood-DDX7019BTM-AV-Receiver-003.png', NULL, '2020-08-08 14:34:45', '2020-08-08 14:34:45'),
(314, 'Pioneer VREC-100 Recorder Dash camera', 'pioneer-vrec-100-recorder-dash-camera', '0', NULL, 0, 'In Stock', 'Front recording Dash cam with loop video recording, motion detection & 128GB memory support.', '13000', 500, '10', NULL, NULL, 0, 0, 0, 0, 'VREC-100', 'Pioneer', '0', NULL, '<p>The Pioneer <strong>VREC-100CH</strong> is a Dash Camera that will help to protect your vehicle and is your third eye on the road.</p>\r\n\r\n<p>This product can store up to 128 GB of recordings and has 5 file length modes, date and time setting, auto recording mode and an emergency backup. The VREC-100CH can be powered up via car charger slot .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>Wide angle view</p>\r\n\r\n<p>Capture the whole road ahead and never miss any obstacle with the wide view angle (Diagonal angle 125&deg;, horizontal angle 105&deg;, Vertical angle 58&deg;) video capture.</p>\r\n\r\n<p>Full HD 1296p Recording</p>\r\n\r\n<p>Capture every detail in 1296p HD clarity with VREC-100CH dash cam. Ensure all the important details are well captured.</p>\r\n\r\n<p><strong>Parking Mode</strong></p>\r\n\r\n<p>If the car is violently shaken by some impact the DVR G-Sensor detect vibration, and it powers on the unit, then it records the video for 30sec</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Loop Video Recording</strong></p>\r\n\r\n<p>Never miss any moments from your scenic drive with continuous recording.</p>\r\n\r\n<p><strong>Micro SD card port</strong></p>\r\n\r\n<p>Micro SD card port that supports cards up to 128GB perfect for long video recording. Micro SD card is not provided with product, but you can buy separately.</p>\r\n\r\n<p><strong>Motion Detect</strong></p>\r\n\r\n<p>If there&#39;s no change in the camera image for 5 seconds, the system will activate motion detect function &amp; stop recording video.</p>\r\n\r\n<p><strong>Collect Sudden Collision</strong></p>\r\n\r\n<p>The integrated G sensor detects collisions as well as sudden breaking or turning and securely saves this footage, preventing it from being overwritten.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lane Departure Warning System</p>\r\n\r\n<p>With LDWS feature turned ON, the device will give a warning sound and prompt on VREC screen when the vehicle is deviating from a driving lane</p>\r\n\r\n<p>Reduced motion blur</p>\r\n\r\n<p>Simply enjoy beautiful &amp; clear footage of your scenic drive in its 2.7-inch high-definition display screen.</p>\r\n\r\n<p>Elegant Design</p>\r\n\r\n<p>The superb design ensures that it will look stunning in car&#39;s interior. It&#39;s built to match stylish and modern car interiors.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>VREC-100 Dash camera</li>\r\n	<li>Power socket&nbsp;</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-VREC-100-Recorder-Dash-camera-fb_pixels.png', 8526, 'Pioneer-VREC-100-Recorder-Dash-camera-thumbnail.png', 'Pioneer-VREC-100-Recorder-Dash-camera-001.png', '2020-08-1020:00:37imagevrec-100ch-2-min.jpg', 'Pioneer-VREC-100-Recorder-Dash-camera-002.png', 'Pioneer-VREC-100-Recorder-Dash-camera-003.png', NULL, '2020-08-08 15:01:53', '2020-08-08 15:01:53'),
(315, 'Pioneer DMH-Z6350BT 6.8‚Ä≥ Multimedia', 'pioneer-dmh-z6350bt-68-multimedia', '0', NULL, 0, 'In Stock', 'Pioneer Car Radio with wireless Apple CarPlay & Android Auto, Alexa Built in.', '60000', 500, '1', NULL, NULL, 1, 0, 0, 0, 'DMH-Z6350BT', 'Pioneer', '0', NULL, '<p>Taking your &ldquo;connected&rdquo; in-car experience to the next level the Pioneer<strong> DMH-Z6350BT </strong>provides you with unmatched performance in a compact design! The DMH-Z6350BT provides &ldquo;Out of this world&rdquo; performance featuring a 6.8&Prime; capacitive screen, sleek design with capacitive touch buttons but when limited space is available, the DMH-Z6350BT is only 87mm deep allowing for a wide range of installation opportunities. It supports a wide selection of entertainment and information services including: <strong>Alexa Built-in</strong>. Alexa is the intelligent cloud-based voice service that you can talk to on your Pioneer DMH-Z6350BT.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Speak to Alexa through your Pioneer DMH-Z6350BT to play music, hear the news, check weather, control smart home devices(*), and more. Alexa lives in the cloud, so Alexa is always getting smarter, adding new capabilities that are delivered to your device automatically. Using Alexa on your Pioneer DMH-Z6350BT is simple and hands-free &ndash; just ask, and Alexa will respond instantly. Also supporting<strong> Apple CarPlay</strong> (wireless or cable connection), <strong>Android Auto</strong> (wireless or cable connection), connected services including live weather (**), sports scores,&nbsp;internet browser ,&nbsp;HD video playback from USB,&nbsp;Hi-Res audio playback,&nbsp;AM/FM Tuner and more, you will never want to leave your car!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>6.8&rdquo; Capacitive Touch panel screen</li>\r\n	<li>Short chassis (87mm deep)</li>\r\n	<li>Alexa Built-in</li>\r\n	<li>Apple CarPlay (Wireless or Cable Connection)</li>\r\n	<li>Android Auto (Wireless or Cable Connection)</li>\r\n	<li>Bluetooth (Dual phone)</li>\r\n	<li>Dual Camera Inputs&nbsp;&nbsp;</li>\r\n	<li>Steering Wheel Control Compatible</li>\r\n	<li>USB&nbsp;</li>\r\n	<li>Steering control compatible</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box</strong></p>\r\n\r\n<ul>\r\n	<li>Pioneer DMH-Z6350BT</li>\r\n	<li>Wiring Harness</li>\r\n	<li>User Manual</li>\r\n	<li>Remote Control</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Pioneer-DMH-Z6350BT-6.8‚Ä≥-Multimedia-fb_pixels.png', 505766, 'Pioneer-DMH-Z6350BT-6.8‚Ä≥-Capacitive-Touch-screen-Multimedia-player-with-Alexa-Built-in,-Apple-CarPlay-&-Android-Auto.-thumbnail.png', 'Pioneer-DMH-Z6350BT-6.8‚Ä≥-Capacitive-Touch-screen-Multimedia-player-with-Alexa-Built-in,-Apple-CarPlay-&-Android-Auto.-001.png', NULL, 'Pioneer-DMH-Z6350BT-6.8‚Ä≥-Capacitive-Touch-screen-Multimedia-player-with-Alexa-Built-in,-Apple-CarPlay-and-Android-Auto.-002.png', 'Pioneer-DMH-Z6350BT-6.8‚Ä≥-Capacitive-Touch-screen-Multimedia-player-with-Alexa-Built-in,-Apple-CarPlay-&-Android-Auto.-003.png', NULL, '2020-08-18 09:17:35', '2020-08-18 09:17:35'),
(316, 'Kenwood KW-M150BT car radio', 'kenwood-kw-m150bt-car-radio', '0', NULL, 0, 'In Stock', 'JVC KW-M150BT is a car radio that gives you many features at an affordable Price. Enjoy Bluetooth, AUX Input & USB with android mirroring.', '19000', 500, '1', NULL, NULL, 1, 0, 0, 0, 'kw-m150bt', 'JVC', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is a Digital Media Receiver featuring 6.8&quot; WVGA Capacitive Monitor / USB Mirroring for Android Phones / Bluetooth / 13-Band EQ / Shallow Chassis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>USB Mirroring for Android</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seamlessly display your Android phone on the JVC screen via USB. Touch control is supported from both screen and smartphone.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><em>Bluetooth&reg;&nbsp;Wireless Technology</em></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Bluetooth Voice Recognition</h3>\r\n\r\n<p>Improved Sound Quality with HFP 1.6 Wideband Speech</p>\r\n\r\n<p>Improved sound quality thanks to HD Voice contributes to a higher level of voice recognition accuracy.</p>\r\n\r\n<h3>Bluetooth AVRCP1.5 for Versatile Song Selection</h3>\r\n\r\n<p>In addition to repeat and random playback of music files, you can also easily search for songs using the browsing function. Just look for and choose the song you want to hear from the folder name and song name lists.<br />\r\n&nbsp;</p>\r\n\r\n<h3><em>Sound Optimization</em></h3>\r\n\r\n<h3>Time Alignment</h3>\r\n\r\n<p>By selecting the speaker type and the distance to the center of the listening position, the receiver will automatically adjust the timing of the sound output from each of the speakers so that the sound from each of the speakers will arrive exactly at the same time to the listening position.</p>\r\n\r\n<h3>13-Band Equalizer</h3>\r\n\r\n<p>Use the 13-Band Equalizer to manually adjust the sound to your taste.</p>\r\n\r\n<h3>Capacitive Touchscreen</h3>\r\n\r\n<p>Capacitive touch screen has&nbsp;high clarity and allows for easier functioning with lighter contact and greater accuracy.</p>\r\n\r\n<h3>Various Formats Compatible</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Supports a variety of file formats for audio and video playback.<strong>Audio Format&nbsp;</strong><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;Video Format</strong><br />\r\nMP3/WMA&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MPEG 1/2<br />\r\nAAC&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MPEG-4<br />\r\nWAV&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;H.264<br />\r\nFLAC&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MKV</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Shallow Chassis</h3>\r\n\r\n<p>The reduced depth of the chassis contributes to a weight reduction and facilitates easier installation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Rear View Camera Ready</h3>\r\n\r\n<p>The Rear View Camera input allows you to connect an optional rear view camera (sold separately).<br />\r\nRear view cameras allow you to safely back up your vehicle, monitor towing, and more.</p>\r\n\r\n<h3>Steering Wheel Remote Control Ready</h3>\r\n\r\n<p>Factory steering wheel control functions can be retained with a third-party adapter (sold separately).</p>\r\n\r\n<h3>Steering Wheel Remote Control Ready</h3>\r\n\r\n<p>Factory steering wheel control functions can be retained with a third-party adapter (sold separately).</p>\r\n\r\n<h3>Remote Control (Optional)</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Remote control (RM-RK258) is optionally available.<br />\r\n<br />\r\n<strong>What&#39;s&nbsp;in the Box?</strong>JVC Car Stereo<br />\r\nUser Manual<br />\r\nPower Socket<br />\r\nRemote Control<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Kenwood-KW-M150BT-car-radio-fb_pixels.png', 505766, 'KW-M150BT-Affordable-car-stereo-thumbnail.png', 'KW-M150BT-Affordable-car-stereo-001.png', NULL, 'KW-M150BT-Affordable-car-stereo-002.png', 'KW-M150BT-Affordable-car-stereo-003.png', NULL, '2021-02-03 09:35:50', '2021-02-03 09:35:50'),
(317, 'Space saving Active Sub TS-WX010A', 'space-saving-active-sub-ts-wx010a', '0', NULL, 0, 'In Stock', 'Ultra Compact Space Saving Active Subwoofer with built-in Class-D Amplifier BASS  for impactful and quality bass.', '15,599', 500, '23', NULL, NULL, 0, 1, 0, 0, 'TS-WX010A', 'Pioneer', '0', NULL, '<p>Pioneer&#39;s TS-WX101A is the smallest Active Subwoofer in its Active Subwoofer category.<br />\r\n<br />\r\nDesigned to be installed in the passenger foot space area, TS-WX010A uses a Symbolic Trapezium design that can be easily installed vertically or horizontally.&nbsp;<br />\r\n<br />\r\nTS-WX010A gives a new sound experience, thanks to Pioneer&#39;s BASS SOUND CREATOR feature that offers impactful and high quality bass sound, a built-in CLASS-D amplifier and a down firing subwoofer for effective reproduction of low frequencies, so you can really feel the bass.<br />\r\n<br />\r\n&nbsp;Furthermore, by installing in the passenger foot space area, it can improve the front sound imaging, by creating a natural sound connection with the front speakers, allowing you to experience a new sound experience.&nbsp;Pioneer&rsquo;s TS-WX010A delivers 160 W Maximum Power and 50 W RMS Power.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\nCarSoundFit App&nbsp;<br />\r\nBASS SOUND CREATOR Technology<br />\r\nSize&nbsp;17 cm x 8 cm<br />\r\nType&nbsp;Enclosed Sealed Active<br />\r\nMaximum power&nbsp;160 W<br />\r\nContinuous power output&nbsp;50 W&nbsp;<br />\r\nFrequency response20 Hz to 200 Hz<br />\r\nSensitivity98 (Installed in foot space) dB<br />\r\nFunction&nbsp;&nbsp;Phase switch, Frequency control (50 Hz to 125 Hz), Gain control, Input Mode (High/Low)<br />\r\n<br />\r\n<strong>What&#39;s in the Box?</strong><br />\r\n&bull; Main Unit x 1<br />\r\n&bull; Mounting Bracket x 2<br />\r\n&bull; Under carpet installation bracket x 2<br />\r\n&bull; Screws (&phi;5 mm x 14 mm) x 2<br />\r\n&bull; Screws (M5 mm x 25 mm) x 2<br />\r\n&bull; Power cord assembly (2.5 m) x 1<br />\r\n&bull; Screw cover nut x 2<br />\r\n&bull; Adhesive tape x 4<br />\r\n&bull; Manual<br />\r\n&bull; Warranty document</p>', '793-fb_pixels.png', 895, 'Space-saving-Active-Sub-TS-WX010A-thumbnail.png', 'Space-saving-Active-Sub-TS-WX010A-001.png', NULL, 'Space-saving-Active-Sub-TS-WX010A-002.png', 'Space-saving-Active-Sub-TS-WX010A-003.png', NULL, '2021-02-03 09:55:25', '2021-02-03 09:55:25'),
(318, 'High Power Car Amplifier CA-3242', 'high-power-car-amplifier-ca-3242', '0', NULL, 0, 'In Stock', 'A 4 Channel 2000 watts Car Amplifier with 6 speaker output system & variable crossover.', '18000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'CA-3242', 'JEC', '0', NULL, '<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>4 channel.</li>\r\n	<li>2000W PMPO.</li>\r\n	<li>6-way speaker output system.</li>\r\n	<li>Variable crossover.</li>\r\n	<li>Low pass &amp; high pass filter.</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Car Amplifier</li>\r\n	<li>User Manual</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '154-fb_pixels.png', 891, 'High-Power-Car-Amplifier-CA-3242-thumbnail.png', 'High-Power-Car-Amplifier-CA-3242-001.png', NULL, 'High-Power-Car-Amplifier-CA-3242-002.png', NULL, NULL, '2021-02-03 10:20:05', '2021-02-03 10:20:05'),
(319, 'High Power Car Amplifier JEC CA-3243', 'high-power-car-amplifier-jec-ca-3243', '0', NULL, 0, 'In Stock', 'Mosfet High Power 4 Channel Car Amplifier CA-3243', '24000', 500, '5', NULL, NULL, 0, 0, 0, 0, 'CA-3243', 'JEC', '0', NULL, '<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Output power (4 channel x 80W RMS)</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Bridged and tri mode</li>\r\n	<li>6 ways speaker output system</li>\r\n	<li>Stable into 2 ohms</li>\r\n	<li>Variable crossover low pass and high pass filter</li>\r\n	<li>Adjustable input gain control</li>\r\n	<li>Variable bass boost ( + 12db ) @ 50Hz</li>\r\n	<li>Low level input, line output</li>\r\n	<li>&nbsp;Soft start and muting</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '381-fb_pixels.png', 891, 'High-Power-Car-Amplifier-JEC-CA-3243-thumbnail.png', 'High-Power-Car-Amplifier-JEC-CA-3243-001.png', NULL, 'High-Power-Car-Amplifier-JEC-CA-3243-002.png', NULL, NULL, '2021-02-03 10:42:48', '2021-02-03 10:42:48');
