(320, 'Space-saving Amplified Sub 150 Watts', 'space-saving-amplified-sub-150-watts', '0', NULL, 0, 'In Stock', 'Pioneer TS-WX210A is an active Subwoofer that is small and compact in size yet big in sound and performance.', '18500', 500, '23', NULL, NULL, 1, 0, 0, 0, 'TS-WX210A', 'Pioneer', '0', NULL, '<h3>Compact SPL power.</h3>\r\n\r\n<p>The TS-WX210A focuses on functionality and performance. Use this 20cm sub&nbsp;vertically or horizontally: it takes up a minimum amount of space in the boot or virtually disappears under a seat. But its performance punch is an attention-grabber. AA quality&nbsp;MOSFET 150 W amplifier&nbsp;provides powerful bass, while a cabinet-reinforcing&nbsp;aluminum&nbsp;die-cast heat sink&nbsp;is responsible for top sound performance, free of&nbsp;distortion. AA&nbsp;wired remote control&nbsp;is included for easy gain, phase and LPF tuning.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Amplified Subwoofer</li>\r\n	<li>Space Saving</li>\r\n	<li>Impendence&nbsp;4 ohms</li>\r\n	<li>Frequency response40 - 150</li>\r\n	<li>Sensitivity101 dB</li>\r\n	<li>Maximum power input150 W</li>\r\n	<li>Built-in variable LPF (50-125 Hz, -12dB/oct.)</li>\r\n	<li>Built in Amplifier</li>\r\n	<li>Dimensions250 x 265 x 110 mm</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer Powered Subwoofer</li>\r\n	<li>User Manual</li>\r\n	<li>Power Socket.</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '634-fb_pixels.png', 895, 'Space-saving-Amplified-Sub-150-Watts-thumbnail.png', 'Space-saving-Amplified-Sub-150-Watts-001.png', NULL, 'Space-saving-Amplified-Sub-150-Watts-002.png', 'Space-saving-Amplified-Sub-150-Watts-003.png', NULL, '2021-02-03 11:21:39', '2021-02-03 11:21:39'),
(321, 'TS-G1320F 13cm 2-Way Coaxial Speakers', 'ts-g1320f-13cm-2-way-coaxial-speakers', '0', NULL, 0, 'In Stock', 'This Pioneer Midrange speakers tap the Full potential in your cars Midrange', '3500', 500, '2', 5, NULL, 1, 0, 0, 0, 'TS-G1320F', 'Pioneer', '0', NULL, 'Thanks to their&nbsp;increased power handling&nbsp;and&nbsp;high sensitivity performance<span>, these speakers reproduce deep, impactful bass and natural highs ‚Äì even at high volumes.<br><br></span>Upgrade your in-car sound in a smart and affordable way with the TS-G1320F. This&nbsp;13cm 2-way coaxial speaker<span>&nbsp;delivers up to 35 Watts of nominal power and has a maximum power output of 250 Watts.<br></span><br><b>Key Features<br></b><ul><li>Speaker Size 5\" /13cm</li><li>Max power output 250 watts</li><li>Impedance4 Œ©Frequency response33 - 24 000</li><li>Sensitivity88 dB</li><li>Lowest resonance frequency101 Hz</li><li>Nominal input power35 W</li></ul><b>What\'s in the Box?<br></b><ul><li>A pair pioneer Speakers</li><li>User Manual</li><li>Wiring Harness</li></ul>', NULL, 895, 'TS-G1320F-13cm-2-Way-Coaxial-Speakers-thumbnail.png', 'TS-G1320F-13cm-2-Way-Coaxial-Speakers-001.png', NULL, 'TS-G1320F-13cm-2-Way-Coaxial-Speakers-002.png', NULL, NULL, '2021-02-03 11:35:43', '2021-02-03 11:35:43'),
(322, 'TS-A2013I 20cm 3-Way Coaxial Speakers', 'ts-a2013i-20cm-3-way-coaxial-speakers', '0', NULL, 0, 'In Stock', 'Upgrade your factory Speakers with Pioneer ts-a2013i 500 watts Speakers to achieve punching bass and improved midrange frequency response.', '14500', 500, '2', 5, NULL, 0, 0, 0, 0, 'Ts-a2013', 'Pioneer', '0', NULL, '<b>Key Features<br></b><br><ul><li>Maximum input power 500 W .</li><li>Nominal input power 80 W .</li><li>Impedance 4Œ© .</li><li>Frequency response 25 ‚Äì 28,000 Hz .</li><li>Sensitivity (1W/1m) 91 dB .</li><li>Woofer size 20 cm .</li><li>Woofer material Carbon Graphite Interlaced Aramid Fibre Cone with Foamed Rubber Coat Cloth Edge .</li><li>Tweeter size (mm) 17 mm .</li><li>Midrange size (mm) 57 mm .</li><li>Cut-out Hole 186 mm .</li><li>Mounting Depth 89 mm</li></ul><b>What\'s in the Box?<br></b><ul><li>A pair Speakers</li><li>User Manual</li><li>Wiring Harness</li></ul><b><br></b>', NULL, 895, 'TS-A2013I-20cm-3-Way-Coaxial-Speakers-thumbnail.png', 'TS-A2013I-20cm-3-Way-Coaxial-Speakers-001.png', NULL, 'TS-A2013I-20cm-3-Way-Coaxial-Speakers-002.png', NULL, NULL, '2021-02-04 13:00:57', '2021-02-04 13:00:57'),
(323, 'pioneer car speakers with Good Bass', 'pioneer-car-speakers-with-good-bass', '0', NULL, 0, 'In Stock', 'Car Door Speakers with high power output & good Bass, Pioneer TS-A1687S', '6500', 500, '2', 5, NULL, 1, 0, 0, 0, 'TS-A1687S', 'Pioneer', '0', NULL, 'Are you looking for <b>car door speakers</b> with good Bass?&nbsp;&nbsp;Pioneer car speakers TS-A1687S Will give you a maximum of 350 watts power output with an RMS power of 80 watts.<br><br>The speakers are round measuring 16.5cm or 6.5 inches and thus will go into most cars\'<b> front doors.</b><br><br><b>Key Features<br></b><ul><li>Size 6.5\"</li><li>4 - way speaker type</li><li>Maximum power 350 watts</li><li>RMS Power 80 watts</li><li>Frequency response 36 Hz to 25kHz</li><li>Sensitivity 88 dB</li><li>Impedance 4 ohms</li><li>Mounting depth 59 mm</li></ul><b>What\'s in the Box?</b><br><ul><li>Pioneer Door Speakers - pair</li><li>User Manual</li><li>Fittings per manufacture</li></ul><br>', NULL, 895, 'pioneer-car-speakers-with-Good-Bass-thumbnail.png', 'pioneer-car-speakers-with-Good-Bass-001.png', NULL, 'pioneer-car-speakers-with-Good-Bass-002.png', 'pioneer-car-speakers-with-Good-Bass-003.png', NULL, '2021-02-18 14:26:50', '2021-02-18 14:26:50'),
(324, 'JVC CS-GD1210 12 inch 1400W Subwoofer', 'jvc-cs-gd1210-12-inch-1400w-subwoofer', '0', NULL, 0, 'In Stock', 'Double coil Speaker in-car subwoofer with a maximum power output of 1400 watts and 12-inch speaker size.', '7000', 500, '4', NULL, NULL, 1, 0, 0, 0, 'CS-GD1210', 'JVC', '0', NULL, '<p>The JVC 1400 Watts car Subwoofer delivers the desirable Punchy bass thanks to its double coil make &amp; huge Magnet. Power it with the right amplifier&nbsp;<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Peak Power Handling: 1400 Watts</li>\r\n	<li>RMS Power Handling: 400 Watts</li>\r\n	<li>Impedance: Dual 4 Ohms</li>\r\n	<li>Frequency Response: 20 Hz - 20 kHz</li>\r\n	<li>Sound Pressure Level: 86.5 dB</li>\r\n	<li>Cone Size: 12&quot; inches</li>\r\n	<li>Cone Type: 3D Structure Sputtering Olefin</li>\r\n	<li>Frame: Painted SPCC Frame</li>\r\n	<li>Surround: Butyl Rubber</li>\r\n	<li>Gasket: Super Heat-Resistant ABS</li>\r\n	<li>Magnet: Ferrite Magnet</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>JVC 1400 Double coil Subwoofer</li>\r\n	<li>User Manual</li>\r\n	<li>Fittings as per Manufacturer</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 2833, 'JVC-CS-GD1210-12-inch-1400W-Subwoofer-thumbnail.png', 'JVC-CS-GD1210-12-inch-1400W-Subwoofer-001.png', NULL, 'JVC-CS-GD1210-12-inch-1400W-Subwoofer-002.png', 'JVC-CS-GD1210-12-inch-1400W-Subwoofer-003.png', NULL, '2021-02-24 15:16:41', '2021-02-24 15:16:41'),
(325, 'Sony XAV-AX5500 Car Stereo', 'sony-xav-ax5500-car-stereo', '0', NULL, 1, 'In Stock', 'Enjoy Apple Carplay, Android Auto, Weblink & Bluetooth features all in the new Sony car radio XAV-ax5500.', '38000', 500, '1', NULL, NULL, 1, 1, 0, 1, 'XAV-AX5500', 'Sony', '0', NULL, '<p>You will get all your desirable modern car radio features packed in the new Sony XAV-AX5500 Stereo.<br />\r\nSony combines Apple CarPlay &reg; and Android Auto to boost your in-car smartphone experience, so you can access your important apps for entertainment, text, navigation, and more, and even use your voice to make commands so that your eyes remain on the lane.<br />\r\n<br />\r\n<strong>Key Features</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>digital multimedia receiver with AM/FM tuner</li>\r\n	<li>6.95&quot; capacitive touchscreen display&nbsp;</li>\r\n	<li>works with Apple CarPlay, Android Auto, and WebLink</li>\r\n	<li>voice control with Siri and Google Assistant</li>\r\n	<li>plays media from USB memory devices</li>\r\n	<li>10-band equalizer</li>\r\n	<li>EXTRA BASS&trade; for bass enhancement</li>\r\n	<li>Dynamic Stage Organizer (DSO) compensates for low speaker positions</li>\r\n	<li>subwoofer controls</li>\r\n	<li>inputs: dual rear USB inputs, rear-view camera input</li>\r\n	<li>outputs: 5-channel preamp outputs (5-volt front, rear, mono sub)</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Sony XAV-AX5500 Radio.</li>\r\n	<li>User Manual</li>\r\n	<li>Power Socket</li>\r\n	<li>Microphone</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Sony-XAV-AX5500-Car-Stereo-fb_pixels.png', 505766, 'Sony-XAV-AX5500-Car-Stereo-thumbnail.png', 'Sony-XAV-AX5500-Car-Stereo-001.png', '2021-06-0707:46:16imageXAV-AX5500(5).png', 'Sony-XAV-AX5500-Car-Stereo-002.png', NULL, NULL, '2021-02-24 16:29:54', '2021-02-24 16:29:54'),
(326, 'Pioneer TS-W312D4 car Subwoofer', 'pioneer-ts-w312d4-car-subwoofer', '0', NULL, 0, 'In Stock', 'High-performance car subwoofer with a maximum power output of 1600 watts & RMS Power of 500 watts.', '8500', 500, '4', 7, NULL, 0, 1, 0, 0, 'TS-W312D4', 'Pioneer', '0', NULL, '<p>There is a new sheriff in town !! The Pioneer TS-W312D4 Boasts a whooping 1600 watts Maximum power &amp; 500 watts RMS Power, outdoing its other single-coil models available in the market.<br />\r\n<br />\r\nThis car subwoofers performance is out of this world, you just need to tune it in the right cabinet &amp; power it with an equally fitting amplifier such as the pioneer GM-E7004.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Size 30 cm (12&quot;)</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Maximum Music Power 1600 W</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>RMS 500 W</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Frequency Response 20 Hz to 1.6 kHz</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Sensitivity ( 1W / 1m ) 92dB</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Impedance Single 4&Omega;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Mounting Depth 157 mm</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Cut-Out Dimensions &oslash;283 mm</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Resonance Frequency 37 Hz</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>X max 7.7 mm</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Magnet Weight 2,540 g</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Recommended Enclosure 35.4 liters</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer 1600 Watts Subwoofer</li>\r\n	<li>User Manual</li>\r\n	<li>Fittings as per manufacturer.</li>\r\n</ul>', '316-fb_pixels.png', 2833, 'Pioneer-TS-W312S4-car-Subwoofer-thumbnail.png', 'Pioneer-TS-W312S4-car-Subwoofer-001.png', NULL, 'Pioneer-TS-W312S4-car-Subwoofer-002.png', 'Pioneer-TS-W312D4-car-Subwoofer-003.png', NULL, '2021-02-24 16:47:58', '2021-02-24 16:47:58'),
(327, 'GM-E7004 4-channel bridgeable Booster', 'gm-e7004-4-channel-bridgeable-booster', '0', NULL, 0, 'In Stock', 'Pioneer car booster,4 channel bridgeable', '10000', 500, '5', NULL, NULL, 1, 1, 0, 0, 'GM-E7004', 'Pioneer', '0', NULL, '<p>High Power and Energetic Sound</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>High output with the large-capacity electrolytic capacitors. Stable performance ensured with optimized PCB board</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Flexible Sound Tuning</p>\r\n\r\n<p>Wide range, variable LPF &amp; HPF for system flexibility. Two-step Bass Boost as a juice for more fun!<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Amplifier ClassClass AB</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>No. of Channels4/3/2</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>RMS power output70 W x 4 RMS (4&Omega;) 95 W x 4 (2&Omega;) 190W x 2 (Bridged)</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Frequency Response15 Hz to 22 kHz</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Total Harmonic Distortion(THD)&lt;0.1%</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>S/N Ratio&gt;80dB</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Speaker Level inputs</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Crossover TypeVariable HPF/LPF</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Crossover Frequency32Hz to 320 Hz</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Bass Boost Frequency50 Hz</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Baas Boost LevelMin/Mid/Max</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Dimensions343 mm x 55.5 mm x 240 mm</li>\r\n</ul>\r\n\r\n<p><strong>Whats in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Pioneer car Amplifier</li>\r\n	<li>User Manual</li>\r\n	<li>Fittings as per manufacturer.</li>\r\n</ul>\r\n\r\n<p><strong>One Year Warranty</strong></p>\r\n\r\n<p>&nbsp;</p>', '193-fb_pixels.png', 891, 'GM-E7004-4-channel-bridgeable-Booster-thumbnail.png', 'GM-E7004-4-channel-bridgeable-Booster-001.png', NULL, 'GM-E7004-4-channel-bridgeable-Booster-002.png', NULL, NULL, '2021-02-24 17:22:03', '2021-02-24 17:22:03'),
(328, 'Car Alarm system', 'car-alarm-system', '0', NULL, 0, 'In Stock', 'Car Alarm system for the car.', '3000', 500, '17', NULL, NULL, 0, 0, 0, 0, 'ALARM', 'Others', '0', NULL, '<p>Keep away car electronic thieves by installing our car alarm security system.<br />\r\n<br />\r\n<strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Anti-Hijack Function<br />\r\n	When the Anti- Car Hijack Mode is activated, in a certain event the unit will auto immobilize the vehicle after a user define action.</li>\r\n	<li>Automatic immobilizer<br />\r\n	For maximum security fuel pump, ignition system and starter motor immobilizer: The system will immobilize 40 seconds after the ignition is turned on.</li>\r\n	<li>Intelligent dual-stage shock sensor<br />\r\n	It gives a warning on a light impact and a full alarm on a heavy impact to the vehicle. It can distinguish between environmental shocks such as trucks or aircraft and a thief attempting to break in. It will auto-adjust its sensitivity for the environment on arming.</li>\r\n	<li>Data battery back-up siren<br />\r\n	A self-powered siren that communicates independently with the alarm so it cannot be fooled into turning off like normal battery back-up sirens.</li>\r\n	<li>Door, bonnet, and boot protection<br />\r\n	If the alarm is armed and a door, bonnet, or boot is opened the alarm will sound.</li>\r\n	<li>Central locking from the remote<br />\r\n	The alarm will lock/unlock the doors when the alarm is armed/ disarmed.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Car Alarm</li>\r\n	<li>User Manual</li>\r\n	<li>Wiring Harness.</li>\r\n</ul>', 'Car-Alarm-system-fb_pixels.png', 1802, 'Car-Alarm-system-thumbnail.png', 'Car-Alarm-system-001.png', NULL, 'Car-Alarm-system-002.png', NULL, NULL, '2021-02-27 17:22:03', '2021-02-27 17:22:03'),
(329, 'Afritec Car Alarm with Antihijack', 'afritec-car-alarm-with-antihijack', '0', NULL, 0, 'In Stock', 'Car Alarm system with cutoff / antihijack feature.', '6000', 500, '17', NULL, NULL, 1, 0, 0, 0, 'ALARM2', 'Others', '0', NULL, '<p>The Afritec&nbsp; Plus car security system has all of the features of the standard car alarm system with added anti-hijack feature and immobilizer.<br />\r\n<strong>Key Features</strong><br />\r\n-<strong> Anti-Hijack Function</strong><br />\r\nWhen the Anti- Car Hijack Mode is activated, in a certain event the unit will auto immobilize the vehicle after a user-defined action.<br />\r\n<strong>- Automatic immobilizer</strong><br />\r\nFor maximum security fuel pump, ignition system, and starter motor immobilizer: The system will immobilize 40 seconds after the ignition is turned on.<br />\r\n<strong>- Intelligent dual-stage shock sensor</strong><br />\r\nIt gives a warning on a light impact and a full alarm on a heavy impact to the vehicle. It can distinguish between environmental shocks such as trucks or aircraft and a thief attempting to break in. It will auto-adjust its sensitivity to the environment on arming.<br />\r\n- <strong>Data battery back-up siren</strong><br />\r\nA self-powered siren that communicates independently with the alarm so it cannot be fooled into turning off like normal battery back-up sirens.<br />\r\n-<strong> Door, bonnet, and boot protection</strong><br />\r\nIf the alarm is armed and a door, bonnet, or boot is opened the alarm will sound.<br />\r\n-<strong> Central locking from the remote</strong><br />\r\nThe alarm will lock/unlock the doors when the alarm is armed/ disarmed.<br />\r\n<br />\r\n<br />\r\n<strong>What&#39;s in the Box?</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Car Alarm</li>\r\n	<li>manual</li>\r\n	<li>Wiring Harness</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>&nbsp;</li>\r\n</ul>', 'Afritec-Car-Alarm-with-Antihijack-fb_pixels.png', 1802, 'Afritec-Car-Alarm-with-Antihijack-thumbnail.png', 'Afritec-Car-Alarm-with-Antihijack-001.png', NULL, 'Afritec-Car-Alarm-with-Antihijack-002.png', NULL, NULL, '2021-02-27 17:30:26', '2021-02-27 17:30:26'),
(330, 'Car Radio FM Signal Amplifier', 'car-radio-fm-signal-amplifier', '0', NULL, 0, 'In Stock', 'The FM Signal Amplifier is a tool used to Boost/ improve your car radio Signal Strength.', '2500', 500, '10', NULL, NULL, 0, 0, 0, 0, 'ANT-208', 'Others', '0', 'dPoSBQz_W44', '<p>&nbsp;</p>\r\n\r\n<p>Improve your Radio Signal Strength by installing the ANT-208&nbsp;Radio FM Signal Amplifier. This product is fitted between the car stereo &amp; antenna.</p>\r\n\r\n<p><strong>Benefits</strong></p>\r\n\r\n<ol>\r\n	<li>Static Noise reduction</li>\r\n	<li>Improved Signal Strength</li>\r\n	<li>Improved sound Quality</li>\r\n	<li>Overall Smooth Listening Experience</li>\r\n</ol>\r\n\r\n<p>What&#39;s in the Box?</p>\r\n\r\n<ul>\r\n	<li>Ant-208 Device</li>\r\n	<li>Fittings per manufacturer</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'Car-Radio-FM-Signal-Amplifier-fb_pixels.png', 8526, 'Car-Radio-FM-Signal-Amplifier-thumbnail.png', 'Car-Radio-FM-Signal-Amplifier-001.png', NULL, 'Car-Radio-FM-Signal-Amplifier-002.png', NULL, NULL, '2021-04-15 13:48:13', '2021-04-15 13:48:13'),
(331, 'Kenwood Speakers KFC-HQR1600', 'kenwood-speakers-kfc-hqr1600', '0', NULL, 0, 'In Stock', 'Kenwood car Speakers with excellent sound quality and design.', '14000', 500, '2', NULL, NULL, 0, 0, 0, 0, 'KFC-HQR1600', 'Kenwood', '0', NULL, '<p>The Kenwood<strong> KFC-HQR1600</strong> as the name suggests is a high-quality reference speaker setting a performance standard in their category.&nbsp;</p>\r\n\r\n<p>The 16cm round coaxial Speakers Boost a maximum <strong>Power Output</strong> of 400 watts and <strong>RMS input </strong>Power of 100 watts. These speakers will fit into most car&#39;s front &amp; back doors.</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Peak Input Power: 400W</li>\r\n	<li>Rated Input Power: 100W (CEA Spec.)</li>\r\n	<li>Woofer Features: 16cm Carbon Glass Fiber Cone Diaphragm</li>\r\n	<li>Midrange Features: 40mm PEI Cone Diaphragm</li>\r\n	<li>Tweeter Features: 12mm Ceramic Diaphragm</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s In the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Kenwood KFC-HQR1600</li>\r\n	<li>User Manual</li>\r\n	<li>Wiring</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '836-fb_pixels.png', 895, 'Kenwood-Speakers-KFC-HQR1600-thumbnail.png', 'Kenwood-Speakers-KFC-HQR1600-001.png', NULL, 'Kenwood-Speakers-KFC-HQR1600-002.png', NULL, NULL, '2021-04-18 12:51:20', '2021-04-18 12:51:20'),
(332, 'Pioneer TS-W312S4', 'pioneer-ts-w312s4', '0', 7000, 0, 'In Stock', '12\" Single Voice Coil 4 ohm Component Subwoofer', '7000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'TS-W312S4', 'Pioneer', '0', NULL, '<p>The Pioneer TS-W312S4 is one of the latest champion series models with a range of improvements set to fly the &quot; champion series name to the next level.</p>\r\n\r\n<p>With a lightweight/high rigidity cone design, dual-layer hybrid surround, large powerful motor assembly, and enclosed basket structure, the new &ldquo;Champion&rdquo; Series sub-woofers not only look good but will perform even better!</p>\r\n\r\n<p>Match with Pioneer&rsquo;s GM-D Series amplifiers for an impressive in-car experience!</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>Maximum power 1600 watts</li>\r\n	<li>RMS Power 500 watts</li>\r\n	<li>High rigidity (IMPP) composite seamless cone construction with honeycomb design</li>\r\n	<li>Dual-layer (elastic polymer &amp; fibre) surround for a highly durable design.</li>\r\n	<li>Massive 90 oz double stacked magnet and long&nbsp;voice coil with aluminium bobbin for increased bass and improved heat-dispersion.</li>\r\n</ul>', 'Pioneer-TS-W312S4-fb_pixels.png', 2833, 'Pioneer-TS-W312S4-thumbnail.png', 'Pioneer-TS-W312S4-001.png', NULL, NULL, NULL, NULL, '2021-05-26 15:09:59', '2021-05-26 15:09:59'),
(333, 'Sony XS-NW1202E Enclosed Subwoofer', 'sony-xs-nw1202e-enclosed-subwoofer', '0', NULL, 0, 'In Stock', 'Enjoy compact Bass on the Sony XS-NW1202E  Enclosed Subwoofer', '18000', 500, '4', NULL, NULL, 0, 0, 0, 0, 'XS-NW1202E', 'Sony', '0', NULL, '<p>Would you like to enjoy great bass in your car without having to customize your own subwoofer enclosure?&nbsp; The Sony&nbsp;XS-NWX1202E comes directly from the manufacturer with a high-quality precision-tuned enclosure.</p>\r\n\r\n<p>Boasting a maximum power output of 1800 watts and 420 watts RMS Power, this 12-inch Subwoofer delivers boomy bass when powered with the right Amplifiers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>12 &quot; Speaker Size</li>\r\n	<li>Max power 1800 watts</li>\r\n	<li>RMS power 300 watts</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>XS-NW-1202</li>\r\n	<li>User Manual</li>\r\n	<li>Wiring&nbsp;Harness</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '685-fb_pixels.png', 895, 'Sony-XS-NW1202E-Enclosed-Subwoofer-thumbnail.png', 'Sony-XS-NW1202E-Enclosed-Subwoofer-001.png', NULL, 'Sony-XS-NW1202E-Enclosed-Subwoofer-002.png', NULL, NULL, '2021-06-20 10:37:59', '2021-06-20 10:37:59'),
(334, 'Compact Powered Subwoofer XS-AW8', 'compact-powered-subwoofer-xs-aw8', '0', NULL, 0, 'In Stock', 'Sony XS-AW8 compact powered subwoofer with wired remote.', '24000', 500, '1', NULL, NULL, 0, 0, 0, 0, 'XS-AW8', 'Sony', '0', NULL, '<p>Enrich your in-car listening with the XS-AW8 compact powered subwoofer. The slim design allows installation in restricted spaces and fills your car with a 160W peak (75W RMS) of clean, dynamic bass. A supplied wired remote enables convenient level control from the driver&#39;s seat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Key Features</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>8&quot; (20cm) high-excursion shallow subwoofer</p>\r\n	</li>\r\n	<li>\r\n	<p>3 1/8&quot; (7.8cm) deep, low-resonance sealed aluminum enclosure</p>\r\n	</li>\r\n	<li>\r\n	<p>Built-in high-power (160W peak /75W RMS) amplifier with a low-pass filter</p>\r\n	</li>\r\n	<li>\r\n	<p>Line-level and high-level (speaker) inputs</p>\r\n	</li>\r\n	<li>\r\n	<p>Supplied wired remote commander for level control</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>What&#39;s in the Box?</strong></p>\r\n\r\n<ul>\r\n	<li>Sony Underseat</li>\r\n	<li>User Manual</li>\r\n	<li>Wired remote control</li>\r\n</ul>', 'Compact-Powered-Subwoofer-XS-AW8-fb_pixels.png', 895, 'Compact-Powered-Subwoofer-XS-AW8-thumbnail.png', 'Compact-Powered-Subwoofer-XS-AW8-001.png', NULL, 'Compact-Powered-Subwoofer-XS-AW8-002.png', NULL, NULL, '2021-06-23 17:12:59', '2021-06-23 17:12:59');
