(3, 'Kenwood radio for car', 'kenwood-radio-for-car', 'Kenwood car radio, Kenwood car stereo, Kenwood , Kenwood, Kenwood radio, Kenwood radio car, Kenwood radio for car.', 'Modern Kenwood radio for the car at affordable prices.', NULL, '2021-02-20 14:38:30', '2021-02-20 14:38:30'),
