(5, 'Car speakers', 'car-speakers', 'Car Speakers, midrange speakers, midrange speakers price in Kenya, Kenwood midrange speakers, pioneer midrange speakers, car door Speakers, car speakers Kenya', 'Are you wondering how to improve your car sound system? Upgrade your factory door speakers with high-quality midrange Speakers from Pioneer, Kenwood, or Sony.', NULL, '2021-02-20 15:57:52', '2021-02-20 15:57:52'),
(6, 'Car booster', 'car-booster', 'car amplifiers, car amplifiers for sale in Kenya, car amplifiers price in Kenya, car amplifier booster, booster amplifier price in Kenya, car booster.', 'Shop for a 2 channel, 4 channel, 5 channel &amp; monoblock amplifier booster to power your midrange Speakers &amp; bass speakers. We have a variety from Pioneer, JVCKenwood &amp; Sony.', NULL, '2021-02-20 16:36:02', '2021-02-20 16:36:02'),
(7, 'Car Subwoofers', 'car-subwoofers', 'car subwoofer, Car subwoofers, in-car subwoofers, car subwoofer price in Kenya, car subwoofer for sale in Kenya, car bass speaker, car subwoofer, car woofer, car woofers.', 'Add some Bass in your car by installing one of our quality high-performance subwoofers from JVCkenwood,Pioneer, Sony at a Budget-friendly cost.', NULL, '2021-02-22 16:18:40', '2021-02-22 16:18:40'),
(8, 'powered subwoofers', 'powered-subwoofers', 'powered subwoofers, powered bass Speaker, Active subwoofer, underseat subwoofer Kenya, underseat subwoofer pioneer, underseat subwoofer', 'A powered subwoofer is an enclosed bass Speaker with an inbuilt class D Amplifier. They are of two types Powered Subwoofers that are installed in the trunk &amp; Powered subwoofers installed in tight spaces for example under the seat.', NULL, '2021-02-22 16:37:50', '2021-02-22 16:37:50'),
(9, 'Car Tweeters & Equalizers', 'car-tweeters-equalizers', 'Boschmann equalizer, Boschmann Equalizer Price in Kenya, Audiobank crossover, Audio crossover, pioneer tweeters, pioneer tweeters price in Kenya, tss20, Kenwood tweeters, sony tweeters.', '&nbsp;Car tweeters produce high-frequency sounds making music much more enjoyable. Equalizers, on the other hand, Equalizers eg Boschmann Equalizer &amp; audio bank crossovers allow you to adjust individual frequencies &amp; volume for every music you listen to.', NULL, '2021-02-22 18:30:55', '2021-02-22 18:30:55'),
(10, 'In car Accessories', 'in-car-accessories', 'car accessories, in-car accessories, car accessories in Kenya, reverse camera, car phone holder, car mount, FM expander, car dashcam, car jump starter, car jumpstarter kit, parking sensors.', 'Shop for car accessories to make your life on the road Smooth. From car phone holder, Car jumpstarter, reversing, and recording cameras we got your back.', NULL, '2021-02-22 18:31:10', '2021-02-22 18:31:10'),
(11, 'Speaker Cabinet', 'speaker-cabinet', 'speaker cabinet design, subwoofer in cabinet, bass speaker cabinet, bass speaker box design, mid range cabinets.', 'shop online for a quality speaker cabinet made of the best material. Midrange and Bass Speaker cabinets available.', NULL, '2021-02-22 18:39:47', '2021-02-22 18:39:47'),
(12, 'car stereo trim kit', 'car-stereo-trim-kit', 'car stereo trim kit, car radio mounting frame, radio frame.', 'Car Stereo trim kits are used to upgrade factory radio to after-market car radio.', NULL, '2021-02-22 18:50:46', '2021-02-22 18:50:46'),
(13, 'led lights', 'led-lights', 'led lights, led lights strips, led lights for room, led lights prices in Kenya, led lights room, decorative led lights.', 'use the red, green, blue, white, or multicolor led lights to make your living room, bedroom, kitchen look beautiful.', NULL, '2021-02-22 22:30:35', '2021-02-22 22:30:35'),
(14, 'Car alarm & Car Tracker', 'car-alarm-car-tracker', 'car alarm, car alarm system, car alarm installation, car alarm system price, car alarm Kenya, car alarm Nairobi, car tracker, car tracker system, car tracker Kenya, car tracker Nairobi.', '&nbsp;Beef up your car security by installing a car alarm with cut-off and a car tracking system with no monthly fees.', NULL, '2021-02-22 22:31:39', '2021-02-22 22:31:39');
